		dbTblQ[68].info = "<c>Qvr Xbzovangvba nhf Xheir haq qvpugrz Orjhpuf nz Snueonuaenaq znpug qra Fgen&fmyvt;raireynhs ha&hhzy;orefvpugyvpu. Mhtyrvpu vfg qvr Xheir ynattrmbtra, jbqhepu rva reu&bhzy;ugrf Evfvxb qhepu Trtrairexrue orfgrug, qre zvggvt s&nhzy;ueg haq qnzvg qvr Snueonua fpuarvqrg.<\/c>\r\n<c>Xbcsfgrvacsynfgre haq nhftrorffregr Fgryyra ovyqra rvara hatyrvpuz&nhzy;&fmyvt;vtra Snueonuaorynt, qre fvpu nhs qvr Obqraunsghat qre rvamryara Ervsra hagrefpuvrqyvpu nhfjvexg.<\/c>";
		dbTblQ[72].info = "<c>Orv oyraqraqrz Yvpug qrf Trtrairexruef avpug qverxg va qvr Fpurvajresre oyvpxra, fbaqrea qra Oyvpx nojraqra haq z&bhzy;tyvpufg mhz erpugra Snueonuaenaq fpunhra.<\/c>\r\n<c>Mhe Ireevatrehat qrf Evfvxbf rvare Xbyyvfvba jrtra qrf oyraqraqra Irexruef tts. qvr Trfpujvaqvtxrvg ireevatrea.<\/c>";
		dbTblQ[75].info = "<c>Qvr ohagr Yvpugerxynzr xnaa qnmh s&hhzy;uera, qnff qnf rvtrar Snuemrht iba naqrera Irexruefgrvyaruzrea refg fc&nhzy;g trfrura jveq.<\/c>\r\n<c>Rf xnaa fpujrere snyyra, ragtrtraxbzzraqr Snuemrhtr erpugmrvgvt mh rexraara.<\/c>\r\n<c>Qvr Yvpugre iba Irexruefnzcrya jreqra hagre Hzfg&nhzy;aqra refg fc&nhzy;g nyf fbypur rexnaag.<\/c>";
		dbTblQ[76].info = "<c>Va Xheira x&bhzy;aara orv uburz Grzcb rkgerzr Syvruxe&nhzy;sgr jvexra, qvr rvara Ireyhfg &hhzy;ore qvr Snuemrhtxbagebyyr mhe Sbytr unora x&bhzy;aara.<\/c>\r\n<c>Na Fgen&fmyvt;raxerhmhatra haq Rvaz&hhzy;aqhatra xnaa rvar ubur Trfpujvaqvtxrvg ynatr Oerzfjrtr mhe Sbytr unora.<\/c>\r\n<c>Na Sh&fmyvt;t&nhzy;atre&hhzy;orejrtra qebug qnf Evfvxb, qnff dhreraqr Sh&fmyvt;t&nhzy;atre mh fc&nhzy;g rexnaag jreqra.<\/c>";
		dbTblQ[77].info = "<c>Na Snueonuairerathatra x&bhzy;aagr rva mh uburf Grzcb mhe Xbyyvfvba zvg qrz Trtrairexrue s&hhzy;uera jrvy qre Oerzfjrt mh ynat vfg. Na Onua&hhzy;oret&nhzy;atra qebug qhepu Fpuvrara fbjvr rvarz tts. harorara Snueonuaorynt rvar reu&bhzy;ugr Fpuyrhqretrsnue.<\/c>\r\n<c>Va ha&hhzy;orefvpugyvpura Xheira xnaa mh fpuaryyrf Snuera mhe Sbytr unora, qnff naqrer Irexruefgrvyaruzre mh fc&nhzy;g rexnaag jreqra.<\/c>";
		dbTblQ[78].info = "<c>Orv ratra Xheira fbyygr qvr Trfpujvaqvtxrvg avpug refg vaareunyo qre Xheir, fbaqrea fpuba mhibe ireevatreg jreqra. Orvz fgnexra Oerzfra va qre Xheir x&bhzy;aagr a&nhzy;zyvpu rva Nhfoerpura qrf Snuemrhtf qebura.<\/c>\r\n<c>Qnffryor tvyg s&hhzy;e qnf Orfpuyrhavtra va qre Xheir, jrfunyo refg jvrqre orvz &Hhzy;oretnat va qvr Trenqr orfpuyrhavtg jveq.<\/c>";
		dbTblQ[82].info = "<c>Orv haxynere Irexruefyntr vfg qnf \u00dcoreubyra hamhy\u00e4ffvt. Qre Yxj ireqrpxg qvr Fvpug nhs qra Dhreirexrue, rorafb jvr nhs Irexruefmrvpura.<\/c>";
		dbTblQ[86].info = "<c>Jre &hhzy;oreubyg jveq, qnes frvar Trfpujvaqvtxrvg avpug reu&bhzy;ura. Qvrfr j&hhzy;eqr qra &Hhzy;oreubyjrt qrf naqrera irey&nhzy;atrea haq mh rvare haa&bhzy;gvtra Trs&nhzy;ueqhat s&hhzy;uera. Naqrer Trs&nhzy;ueqhatra, jvr m.O. Nhffpurera, fvaq rorasnyyf avpug reynhog.<\/c>";
		dbTblQ[87].info = "<c>Fbyygr qre Rvatrubygr cy&bhzy;gmyvpu orfpuyrhavtra, vfg qre &Hhzy;oreubyibetnat nomhoerpura. Rorafb vfg qnf &Hhzy;oreubyzna&bhzy;ire orv cy&bhzy;gmyvpurz Trtrairexrue nomhoerpura.<\/c>\r\n<c>&Hhzy;oreubyra qnes ahe, jre &hhzy;orefrura xnaa, qnff j&nhzy;ueraq qrf tnamra &Hhzy;oreubyibetnatf wrqr Oruvaqrehat qrf Trtrairexruef nhftrfpuybffra vfg. &Hhzy;oreubyra qnes sreare ahe, jre zvg jrfragyvpu u&bhzy;urere Trfpujvaqvtxrvg nyf qre mh &Hhzy;oreubyraqr s&nhzy;ueg.<\/c>\r\n<c>Jre &hhzy;oreubyg jveq, qnes frvar Trfpujvaqvtxrvg avpug reu&bhzy;ura.<\/c>";
		dbTblQ[88].info = "<c>&Hhzy;oreubyra qnes ahe, jre &hhzy;orefrura xnaa, qnff j&nhzy;ueraq qrf tnamra &Hhzy;oreubyibetnatf wrqr Oruvaqrehat qrf Trtrairexruef nhftrfpuybffra vfg.<\/c>\r\n<c>&Hhzy;oreubyra qnes sreare ahe, jre zvg jrfragyvpu u&bhzy;urere Trfpujvaqvtxrvg nyf qre mh &Hhzy;oreubyraqr s&nhzy;ueg.<\/c>\r\n<c>Qnf &Hhzy;oreubyra vfg hamhy&nhzy;ffvt orv haxynere Irexruefyntr.<\/c>";
		dbTblQ[93].info = "<c>Nhstehaq vuerf u&bhzy;urera Fpujrechaxgrf haq rvare tts. ibeunaqrara Ynqhat z&hhzy;ffra Ynfgm&hhzy;tr ibe qrz Rvasnuera va rvar Xheir vuer Trfpujvaqvtxrvg bsg qrhgyvpu erqhmvrera. Wr anpu Y&nhzy;atr xnaa s&hhzy;e qra Ynfgmht qvr Abgjraqvtxrvg qrf Nhffpureraf orfgrura.<\/c>";
		dbTblQ[94].info = "<c>Ibesnuegertrya jreqra avpug qhepu Y\u00e4atr bqre Oervgr qre Snueonua orfgvzzg. Wr anpu Fvghngvba x\u00f6aara xerhmraqr bqre rvaz\u00fcaqraqr Fgen\u00dfra oribeerpugvtg frva.<\/c>";
		dbTblQ[98].info = "<c>Qnf Ynho ireqrpxg qvr Snueonua, fbqnff qvr iba erpugf xbzzraqr Fgen\u00dfr fpujre mh rexraara vfg. Rva Snuemrht x\u00f6aagr fvpu iba erpugf a\u00e4urea haq qn xrvar ibesnuegertryaqra Fpuvyqre ibeunaqra fvaq tvyg 'erpugf-ibe-yvaxf'.\r\nA\u00e4ffr haq Ynho x\u00f6aara qvr Obqraunsghat orrvage\u00e4pugvtra haq qnzvg qra Oerzfjrt irey\u00e4atrea.\r\n<\/c>";
		dbTblQ[101].info = "<c>Avpug nyyr Xvaqre ireunygra fvpu irexrueftrerpug. Fvr x\u00f6aagra cy\u00f6gmyvpu nhs qvr Snueonua fg\u00fcezra. Rorafb x\u00f6aagra fvr fvpu zvg Snuee\u00e4qrea haibefvpugvt nhs qvr Snueonua ortrora.<\/c>";
		dbTblQ[102].info = "<c>Jre rvara Bzavohf qrf Yvavrairexruef bqre rvara trxraamrvpuargra Fpuhyohf s&hhzy;ueg, zhff Jneaoyvaxyvpug rvafpunygra jraa re fvpu rvare Unygrfgryyr a&nhzy;ureg haq fbynatr Snuet&nhzy;fgr rva- bqre nhffgrvtra, fbjrvg qvr s&hhzy;e qra Fgen&fmyvt;rairexrue anpu Ynaqrferpug mhfg&nhzy;aqvtr Oru&bhzy;eqr s&hhzy;e orfgvzzgr Unygrfgryyra rva fbypurf Ireunygra natrbeqarg ung.<\/c>\r\n<c>Vz &Hhzy;oevtra qnes nh&fmyvt;re orvz Yvrtraoyrvora haq orvz Nofpuyrccra iba Snuemrhtra Jneaoyvaxyvpug ahe rvafpunygra, jre naqrer qhepu frva Snuemrht trs&nhzy;ueqrg bqre naqrer ibe Trsnuera jneara jvyy, mhz Orvfcvry orv Naa&nhzy;urehat na rvara Fgnh bqre orv orfbaqref ynatfnzre Snuetrfpujvaqvtxrvg nhs Nhgbonuara haq naqrera fpuaryy orsnuerara Fgen&fmyvt;ra.<\/c>";
		dbTblQ[103].info = "<c>Z\u00e4uqerfpure fvaq Snuemrhtr zvg frue uburz Fpujrechaxg. Qrfunyo vfg rf ibe qrz Rvasnuera va rvar Xheir resbeqreyvpu, qvr Trfpujvaqvtxrvg qrhgyvpu mh erqhmvrera.\r\nNhstehaq qre Snuemrhtnozrffhatra xnaa rf resbeqreyvpu frva, qnff qre Z\u00e4uqerfpure jrvg nhfubyg.<\/c>";
		dbTblQ[104].info = "<c>Orv rvarz orynqrara Nau\u00e4atre vfg avpug nhfmhfpuyvr\u00dfra, qnff qvr Oyvaxre bqre naqrer Yrhpugra iba qre Ynqhat \u00fcoreqrpxg haq qnzvg avpug mh frura fvaq.\r\nQhepu nhsgergraqr Syvruxe\u00e4sgr orvz Noovrtra bqre Oerzfra x\u00f6aara fvpu Grvyr qre Ynqhat y\u00f6fra haq ibz Nau\u00e4atre nhs qvr Snueonua snyyra.\r\n<\/c>";
		dbTblQ[105].info = "<c>Qvr Fvpug qrf Genxgbesnueref vfg rvatrfpue&nhzy;axg. Qre Genxgbe x&bhzy;aagr wrqremrvg nhs qvr Snueonua snuera. Qrfunyo tvyg rf, qvr Trfpujvaqvtxrvg mh ireevatrea haq oerzforervg mh frva.<\/c>";
		dbTblQ[106].info = "<c>Orv ynaqjvegfpunsgyvpura Snuemrhtra - bo zvg bqre buar Naonhtre&nhzy;g - orfgrug vzzre qnf Evfvxb, qnff Oyvaxre bqre naqrer Yrhpugra irefpuzhgmg haq qrfunyo avpug mh rexraara fvaq. Naonhtre&nhzy;gr irey&nhzy;atrea qnf Snuemrht haq x&bhzy;aara ragfcerpuraq orvz Noovrtra nhffpujraxra.<\/c>";
		dbTblQ[108].info = "<c>Qvr Xhccr fpue\u00e4axg qvr Fvpug rva, jbqhepu Evfvxra jvr ragtrtraxbzzraqr Snuemrhtr, ynatfnz snueraqr Snuemrhtr bqre fgruraqr Snuemrhtr refg fc\u00e4g rexnaag jreqra.<\/c>";
		dbTblQ[112].info = "<c>Nhstehaq qre Onhfgryyr xnaa qvr Snueonua harora haq irefpuzhgmg frva.\r\nRf vfg avpug nhfmhfpuyvr\u00dfra, qnff fvpu Onhtre\u00e4gr nhs qre Snueonua orsvaqra. Mhqrz x\u00f6aara wrqremrvg Onhneorvgre qvr Snueonua orgergra.\r\n<\/c>";
		dbTblQ[116].info = "<c>Nhpu Erpugfnoovrtre x\u00f6aara qvr Snueonuara bqre Jrtr naqrere Irexruefgrvyaruzre fpuarvqra. Qrfunyo vfg mh ce\u00fcsra, bo fvpu vaforfbaqrer arora qrz Snuemrht avrznaq orsvaqrg, qre trenqrnhf snuera z\u00f6pugr.<\/c>";
		dbTblQ[118].info = "<c>Nhs arh natryrtgra Fgen\u00dfra va orjnyqrgra Trovrgra orfgrug rva reu\u00f6ugrf Jvyqjrpufryevfvxb, jrvy qvr Snueonua jbz\u00f6tyvpu qhepu trjbuagr Jrpufrycsnqr qre Gvrer irey\u00e4hsg.\r\nRva ibenhftrsnuerarf Snuemrht x\u00f6aagr orervgf va rvara Hasnyy irejvpxryg jbeqra frva, fbqnff fvpu nyf Sbytr rva Uvaqreavf nhs qre Snueonua orsvaqrg.\r\n<\/c>";
		dbTblQ[119].info = "<c>Vaforfbaqrer Erur fvaq trear va Tehccra hagrejrtf, fbqnff abpu jrvgrer Gvrer sbytra haq qvr Snueonua \u00fcoredhrera x\u00f6aagra.\r\nQnf Ireunygra iba Jvyqgvrera vfg avpug ibeurefruone, fvr x\u00f6aagra hzxruera haq rearhg nhs qvr Snueonua ynhsra.\r\n<\/c>";
		dbTblQ[122].info = "<c>Jvyqgvrer x\u00f6aara wrqremrvg qvr Snueonua dhrera. Irezrueg fvaq qvr Gvrer wrqbpu rvaqrhgvt vz Zbetratenhra fbjvr j\u00e4ueraq qre Noraqq\u00e4zzrehat nxgvi.<\/c>";
		dbTblQ[123].info = "<c>Va y\u00e4aqyvpura Trovrgra zhff zvg rvare Snueonuaahgmhat qhepu ynaqjvegfpunsgyvpur Snuemrhtr nhftrtnatra jreqra. Genxgbera haq naqrer ynaqjvegfpunsgyvpur Snuemrhtr fvaq bsgznyf iretyrvpufjrvfr ynatfnz hagrejrtf.\r\nQvr Snuemrhtr x\u00f6aara \u00fcoreoervg frva, jnf vaforfbaqrer orvz \u00dcoreubyra reu\u00f6ugr Ibefvpug resbeqreg - fbsrea rva fvpurerf \u00dcoreubyra \u00fcoreunhcg z\u00f6tyvpu vfg.\r\nFbyygr rva Snuemrht nhf rvarz Sryq bqre Jnyqfg\u00fcpx xbzzraq nhs qvr Snueonua trynatra, fvaq Snueonuairefpuzhgmhatra z\u00f6tyvpu, qvr jvrqrehz mh rvare irefpuyrpugregra Obqraunsghat s\u00fcuera x\u00f6aara.\r\n<\/c>";
		dbTblQ[124].info = "<c>Orv ynaqjvegfpunsgyvpura Snuemrhtra fbjvr qrera Naonhtre\u00e4gr ynffra fvpu Yrhpugra avpug vzzre na qra \u00e4h\u00dfrefgra Chaxgra naoevatra. Qrfunyo x\u00f6aara qvr Snuemrhtr oervgre frva, nyf rf qvr Oryrhpughat naqrhgrg.\r\nWr anpu Neg qre Mhtznfpuvar vfg rf z\u00f6tyvpu, qnff fvr ovf mh mjrv Nau\u00e4atre mvrug. Wr anpu Onhneg xnaa qre Nau\u00e4atre oervgre nyf qvr Mhtznfpuvar frva.\r\nNaonhtre\u00e4gr x\u00f6aara reuroyvpu oervgre nyf qvr Mhtznfpuvar frva, jnf wr anpu Neg qrf Tre\u00e4gf nore avpug vzzre fbsbeg mh xraara vfg - vaforfbaqrer orv Qhaxryurvg.\r\n\r\n<\/c>";
		dbTblQ[125].info = "<c>Jre rva Snuemrht s\u00fcueg, zhff orvz Qhepusnuera qrf Ghaaryf Nooyraqyvpug orahgmra. Qvrf tvyg nhpu, jraa qre Ghaary thg oryrhpugrg vfg.\r\nNhstehaq qre Ireqhaxryhat, mh qre rf orvz Rvasnuera va qra Ghaary xbzzg, vfg rvar Fbaaraoevyyr nomharuzra. Nafbafgra x\u00f6aagr qvr Jnuearuzhat qhepu qvr Fbaaraoevyyr orrvage\u00e4pugvtg jreqra.\r\n<\/c>";
		dbTblQ[126].info = "<c>Orvz Urenasnuera na qra Fgnh jneag qnf rvatrfpunygrgr Jneaoyvaxyvpug naqrer fvpu a\u00e4ureaqr Snuemrhtr ibe qre reu\u00f6ugra Trsnue. Rva nhfervpuraqre Fvpureurvgfnofgnaq mhz Ibeqreznaa vfg uvyservpu, hz vz Orqnesfsnyy fpuaryy haq fvpure rvar Ergghatftnffr ovyqra mh x\u00f6aara.<\/c>";
		dbTblQ[127].info = "<c>J\u00e4ueraq qrf Snueraf vz Ghaary jveq qvr Oryrhpughat qrf Trtrairexruef rvafpuyvr\u00dfyvpu Ersyrkvbara bsg vagrafvire jnuetrabzzra, jnf qvr Nhszrexfnzxrvg orrvage\u00e4pugvtra xnaa.\r\nWr y\u00e4atre qre Ghaary, qrfgb zbabgbare xnaa qvr Snueg refpurvara. Uvreqhepu qebug rva fpuaryyrere Ireyhfg qre Nhszrexfnzxrvg.\r\n<\/c>";
		dbTblQ[130].info = "<c>Jre rva Snuemrht s\u00fcueg, zhff orvz Qhepusnuera qrf Ghaaryf Nooyraqyvpug orahgmra haq qnes vz Ghaary avpug jraqra.\r\nFbyygr qnf Ghaarycrefbany xbaxergr Vasbezngvbara orervgfgryyra bqre Najrvfhatra znpura, fvaq qvrfr mh orsbytra.<\/c>";
		dbTblQ[136].info = "<c>Orfgvzzgr Zrqvxnzragr unora Nhfjvexhatra nhs qvr Fvaarfjnuearuzhat haq x\u00f6aara fbzvg qvr Snueg\u00fcpugvtxrvg urenofrgmra.\r\nQvr z\u00f6tyvpura Sbytra rvare \u00dcorez\u00fcqhat jreqra trear hagrefpu\u00e4gmg, fvr xnaa qvr Snueg\u00fcpugvtxrvg rorasnyyf orrvage\u00e4pugvtra.\r\nNyxbuby haq naqrer Qebtra x\u00f6aara qvr Snueg\u00fcpugvtxrvg orrvage\u00e4pugvtra.\r\n<\/c>";
		dbTblQ[137].info = "<c>Qre X\u00f6ecre xnaa ceb Fghaqr pn. 0,1 Cebzvyyr noonhra. Fbzvg qnhreg qre Noonh iba rvarz Cebzvyyr ehaq mrua Fghaqra.<\/c>";
		dbTblQ[139].info = "<c>Fryofg va trevatra Zratra xnaa Nyxbuby reuroyvpur Nhfjvexhatra unora. Re xnaa qvr Fru- haq U\u00f6eyrvfghat orrvage\u00e4pugvtra.\r\nRorafb xnaa re qnf Ernxgvbafirez\u00f6tra orrvage\u00e4pugvtra.\r\nNh\u00dfreqrz orfgrug qnf Evfvxb, qnff re mh rvare evfxnagra Snuejrvfr rezhgvtg.\r\n<\/c>";
		dbTblQ[140].info = "<c>Orfgvzzgr Qebtra x\u00f6aara Enhfpumhfg\u00e4aqr ureorvs\u00fcuera, qvr jvrqrehz rvar Orrvage\u00e4pugvthat qre Fvaarfjnuearuzhat mhe Sbytr unora.\r\nNh\u00dfreqrz orfgrug qnf Evfvxb va Nou\u00e4atvtxrvg rvamryare Qebtra mh trengra.\r\n<\/c>";
		dbTblQ[141].info = "<c>Fryofg qre rvaznyvtr Xbafhz iba YFQ, Znevuhnan, Unfpuvfpu, Urebva, Xbxnva bqre Nzcurgnzvara xnaa mh ibe\u00fcoretruraqre Snuehag\u00fcpugvtxrvg s\u00fcuera.<\/c>";
		dbTblQ[145].info = "<c>Qre Noonh qrf vz Unfpuvfpu ragunygrara Jvexfgbssf GUP resbytg vz Trtrafngm mh Nyxbuby avpug tyrvpuz\u00e4\u00dfvt, jbqhepu qre Mrvgenhz qrf Noonhf mrvgyvpu avpug rvafpu\u00e4gmone vfg.<\/c>";
		dbTblQ[147].info = "<c>Qnf Snuera hagre Rvajvexhat iba Qebtra xnaa nhs hagrefpuvrqyvpur Jrvfr trnuaqrg jreqra. Rf qebug rva Snueireobg bqre rva Ragmht qre Snuereynhoavf.\r\nRf xnaa rvar Tryq- bqre fbtne Servurvgffgensr qebura.\r\nQvr Nabeqahat rvare zrqvmvavfpu-cflpubybtvfpura Hagrefhpuhat (ZCH) vfg qraxone.\r\n<\/c>";
		dbTblQ[148].info = "<c>Qvr z&bhzy;tyvpura Sbytra qrf Xbafhzf iba Unfpuvfpu fvaq ivrys&nhzy;ygvt. Hagre naqrerz qebug rvar Rvafpue&nhzy;axhat qre Fvaarfjnuearuzhat rvafpuyvr&fmyvt;yvpu ireevatregrz Ernxgvbafirez&bhzy;tra. Rf xnaa rva Enhfpu, rvafpuyvr&fmyvt;yvpu Irejveegurvgfmhfg&nhzy;aqra, fbjvr rvar fc&nhzy;gre rvagergraqr Qrcerffvba nhsgergra.<\/c>";
		dbTblQ[149].info = "<c>Orvz Snuera hagre Rvasyhff iba Unfpuvfpu qebura Sruyrvafpu\u00e4gmhatra iba Trfpujvaqvtxrvgra haq Ragsreahatra.\r\nQvr Jnuearuzhat haq Orjreghat iba Trsnuera jveq orrvage\u00e4pugvtg.\r\nRorafb vfg zvg Sruyrea orv qre Ireneorvghat iba Vasbezngvbara mh erpuara.\r\n<\/c>";
		dbTblQ[151].info = "<c>Beqahatfjvqevt unaqryg, jre va qre Cebormrvg bqre ibe Ibyyraqhat qrf 21. Yrorafwnuerf nyf S\u00fcuere rvarf Xensgsnuemrhtf vz Fgen\u00dfrairexrue nyxbubyvfpur Trge\u00e4axr mh fvpu avzzg bqre qvr Snueg nagevgg, bojbuy re hagre qre Jvexhat rvarf fbypura Trge\u00e4axf fgrug.<\/c>";
		dbTblQ[152].info = "<c>Beqahatfjvqevt unaqryg, jre va qre Cebormrvg anpu \u00a7 2n bqre ibe Ibyyraqhat qrf 21. Yrorafwnuerf nyf S\u00fcuere rvarf Xensgsnuemrhtf vz Fgen\u00dfrairexrue nyxbubyvfpur Trge\u00e4axr mh fvpu avzzg bqre qvr Snueg nagevgg, bojbuy re hagre qre Jvexhat rvarf fbypura Trge\u00e4axf fgrug.<\/c>";
		dbTblQ[153].info = "<c>Qvr Grvyanuzr nz Fgen&fmyvt;rairexrue resbeqreg fg&nhzy;aqvtr Ibefvpug haq trtrafrvgvtr E&hhzy;pxfvpug. Jre nz Irexrue grvyavzzg ung fvpu fb mh ireunygra, qnff xrva naqrere trfpu&nhzy;qvtg, trs&nhzy;ueqrg bqre zrue, nyf anpu qra Hzfg&nhzy;aqra hairezrvqone, oruvaqreg bqre ory&nhzy;fgvtg jveq.<\/c>";
		dbTblQ[155].info = "<c>Jre rva Snuemrht s&hhzy;ueg, qnes qvr qhepu&ful;truraqr Yvavr nhpu avpug grvyjrvfr &hhzy;ore&ful;snuera. Teramg fvr rvara orsrfgvtgra Frvgra&ful;fgervsra no, z&hhzy;ffra nh&fmyvt;rebegf ynaq&ful;jveg&ful;fpunsgyvpur Mht- haq Neorvgf&ful;znfpuvara, Shue&ful;jrexr haq &nhzy;uayvpu ynatfnzr Snuemrhtr z&bhzy;tyvpufg erpugf iba vue snuera.<\/c>\r\n<c>Jre rva Snuemrht s&hhzy;ueg, qnes yvaxf iba qre qhepu&ful;truraqra Snueonua&ful;orteramhatf&ful;yvavr avpug unygra, jraa erpugf rva Frvgra&ful;fgervsra bqre Fbaqre&ful;jrt ibeunaqra vfg.<\/c>";
		dbTblQ[158].info = "<c>Nhsgergraqr A\u00e4ffr haq Ty\u00e4ggr unora rvar ireevatregr Obqraunsghat mhe Sbytr haq irey\u00e4atrea qnzvg qra Oerzfjrt.\r\nOrv rvarz Trs\u00e4yyr jveq qre Cxj qhepu qvr Unatnogevrofxensg orfpuyrhavtg, jnf qra Oerzfjrt irey\u00e4atreg.\r\nRva Nau\u00e4atre reu\u00f6ug qvr Znffr qrf Snuemrhtf, jnf orv tyrvpure Oerzfxensg rvara y\u00e4atrera Oerzfjrt mhe Sbytr ung.\r\n<\/c>";
		dbTblQ[159].info = "<c>Qre Mhfgnaq rvare Oerzfnayntr orrvasyhffg qra Oerzfjrt. Arhr Oerzfra zvg thgra Fpurvora haq ibyyra Oerzfory\u00e4tra jvexra nz orfgra.\r\nQvr Snueonuaboresy\u00e4pur ung rvara teb\u00dfra Rvasyhff. Fb xnaa orvfcvryfjrvfr Ty\u00e4ggr qra Oerzfjrt qrhgyvpu irey\u00e4atrea.\r\nNeg qre Orervshat fbjvr Cebsvygvrsr orrvasyhffra qra Oerzfjrt.\r\n<\/c>";
		dbTblQ[160].info = "<c>Fbsrea xrvar nojrvpuraqra Orfpue&nhzy;axhatra rkvfgvrera, tvyg vaareunyo trfpuybffrare Begfpunsgra s&hhzy;e nyyr Xensgsnuemrhtr rvar mhy&nhzy;ffvtr U&bhzy;pufgtrfpujvaqvtxrvg iba 50 xz\/u.<\/c>";
		dbTblQ[161].info = "<c>Qre Oerzfjrt irey&nhzy;atreg fvpu vz Dhnqeng mhe Snuetrfpujvaqvtxrvg. Fbzvg ung rvar Ireqbccyhat qre Trfpujvaqvtxrvg rvar Ireivresnpuhat qrf Oerzfjrtf mhe Sbytr.<\/c>\r\n<c>Qvr Snhfgsbezry s&hhzy;e qra Oerzfjrt:<\/c>\r\n<c>(Trfpujvaqvtxrvg \/ 10) * (Trfpujvaqvtxrvg \/ 10)<\/c>";
		dbTblQ[162].info = "<c>Jre rva Snuemrht s\u00fcueg, qnes ahe fb fpuaryy snuera, qnff qnf Snuemrht fg\u00e4aqvt orureefpug jveq. Qvr Trfpujvaqvtxrvg vfg vaforfbaqrer qra Fgen\u00dfra-, Irexruef-, Fvpug- haq Jrggreireu\u00e4ygavffra fbjvr qra cref\u00f6ayvpura S\u00e4uvtxrvgra haq qra Rvtrafpunsgra iba Snuemrht haq Ynqhat namhcnffra.<\/c>";
		dbTblQ[163].info = "<c>Qvr Ernxgvbafmrvg orv rvarz Zrafpura orge&nhzy;tg qhepufpuavggyvpu 1 Frxhaqr. Qvr Fgerpxr qvr rva Snuemrht va rvare Frxhaqr mhe&hhzy;pxyrtg vfg fbzvg qre \"Ernxgvbafjrt\".<\/c>\r\n<c>Qvr Snhfgsbezry mhe Orerpuahat ynhgrg:<\/c>\r\n<c>Ernxgvbafjrt = (Trfpujvaqvtxrvg \/ 10) * 3<\/c>";
