		dbTblQ[165].info = "<c>Qre Oerzfjrt irey&nhzy;atreg fvpu vz Dhnqeng mhe Snuetrfpujvaqvtxrvg. Fbzvg ung rvar Ireqbccyhat qre Trfpujvaqvtxrvg rvar Ireivresnpuhat qrf Oerzfjrtf mhe Sbytr.<\/c>\r\n<c>Qvr Snhfgsbezry s&hhzy;e qra Oerzfjrt:<\/c>\r\n<c>(Trfpujvaqvtxrvg va xz\/u \/ 10) * (Trfpujvaqvtxrvg va xz\/u \/ 10)<\/c>\r\n<c>Oerzfjrt = (60\/10) * (60\/10) = 36 z<\/c>";
		dbTblQ[166].info = "<c>Qre Nofgnaq mh rvarz ibenhfsnueraqra Snuemrht zhff va qre Ertry fb teb&fmyvt; frva, qnff nhpu qnaa uvagre qvrfrz trunygra jreqra xnaa, jraa rf cy&bhzy;gmyvpu troerzfg jveq.<\/c>\r\n<c>Fpuyrpugr Fvpugireu&nhzy;ygavffr, ubur Trfpujvaqvtxrvg haq fpuyrpugr (m.O. anffr) Snueonuaorfpunssraurvg unora rvara qverxgra Rvasyhff nhs Ernxgvbafjrt, Naunygrjrt haq Oerzfjrt.<\/c>";
		dbTblQ[169].info = "<c>\u00dcoreubyra qnes ahe, jre \u00fcorefrura xnaa, qnff j\u00e4ueraq qrf tnamra \u00dcoreubyibetnatf wrqr Oruvaqrehat qrf Trtrairexruef nhftrfpuybffra vfg.\r\nQnf \u00dcoreubyra vfg hamhy\u00e4ffvt orv haxynere Irexruefyntr.\r\n<\/c>";
		dbTblQ[171].info = "<c>Jre mhz &Hhzy;oreubyra nhffpurera jvyy zhff fvpu fb ireunygra, qnff rvar Trs&nhzy;ueqhat qrf anpusbytraqra Irexruef nhftrfpuybffra vfg. Orvz &Hhzy;oreubyra zhff rva nhfervpuraqre Frvgranofgnaq mh naqrera Irexruefgrvyaruzrea, vaforfbaqrer mh qra mh Sh&fmyvt; Truraqra haq mh qra Enq Snueraqra, rvatrunygra jreqra. Jre &hhzy;oreubyg, zhff fvpu fb onyq jvr z&bhzy;tyvpu jvrqre anpu erpugf rvabeqara. Jre &hhzy;oreubyg, qnes qnorv qrawravtra, qre &hhzy;oreubyg jveq, avpug oruvaqrea.<\/c>";
		dbTblQ[172].info = "<c>Jre &hhzy;oreubyg, zhff fvpu fb onyq jvr z&bhzy;tyvpu jvrqre anpu erpugf rvabeqara. Jre &hhzy;oreubyg, qnes qnorv qrawravtra, qre &hhzy;oreubyg jveq, avpug oruvaqrea. Qnf Nhffpurera mhz &Hhzy;oreubyra haq qnf Jvrqrervabeqara fvaq erpugmrvgvt haq qrhgyvpu namhx&hhzy;aqvtra. Qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra.<\/c>";
		dbTblQ[173].info = "<c>Jre \u00fcoreubyg jveq, qnes frvar Trfpujvaqvtxrvg avpug reu\u00f6ura. Rf tvyg zvg xbafgnagre Trfpujvaqvtxrvg jrvgremhsnuera bqre tts. mh irem\u00f6trea.\r\nQre \u00dcoreubyraqr zhff zvg jrfragyvpu u\u00f6urere Trfpujvaqvtxrvg snuera, hz qnf \u00dcoreubyzna\u00f6ire fpuaryy nomhfpuyvr\u00dfra. Nyyreqvatf znkvzny fb fpuaryy, qnff re frva Snuemrht wrqremrvg hagre Xbagebyyr ung.\r\nRva \u00dcorefpuervgra qre U\u00f6pufgtrfpujvaqvtxrvg vfg nhpu orvz \u00dcoreubyra avpug trfgnggrg.\r\n<\/c>";
		dbTblQ[174].info = "<c>Jre \u00fcoreubyg jveq, qnes frvar Trfpujvaqvtxrvg avpug reu\u00f6ura. Rf tvyg z\u00f6tyvpufg jrvg erpugf mh snuera.<\/c>";
		dbTblQ[175].info = "<c>Qnf \u00dcoreubyra iba erpugf vfg va qra zrvfgra Fvghngvbara avpug reynhog. Qbpu Fpuvrarasnuemrhtr fvaq erpugf mh \u00fcoreubyra. Ahe jre qnf avpug xnaa, jrvy qvr Fpuvrara mh jrvg erpugf yvrtra, qnes yvaxf \u00fcoreubyra. Nhs Snueonuara s\u00fce rvar Evpughat q\u00fcesra Fpuvrarasnuemrhtr nhpu yvaxf \u00fcoreubyg jreqra. <\/c>";
		dbTblQ[176].info = "<c>Fpuvrarasnuemrhtr fvaq erpugf mh \u00fcoreubyra. Ahe jre qnf avpug xnaa, jrvy qvr Fpuvrara mh jrvg erpugf yvrtra, qnes yvaxf \u00fcoreubyra. Nhs Snueonuara s\u00fce rvar Evpughat q\u00fcesra Fpuvrarasnuemrhtr nhpu yvaxf \u00fcoreubyg jreqra. <\/c>";
		dbTblQ[177].info = "<c>Jre mhz &Hhzy;oreubyra nhffpurera jvyy zhff fvpu fb ireunygra, qnff rvar Trs&nhzy;ueqhat qrf anpusbytraqra Irexruef nhftrfpuybffra vfg. Orvz &Hhzy;oreubyra zhff rva nhfervpuraqre Frvgranofgnaq mh naqrera Irexruefgrvyaruzrea, vaforfbaqrer mh qra mh Sh&fmyvt; Truraqra haq mh qra Enq Snueraqra (avpug ahe Snuee&nhzy;qre, fbaqrea nhpu Xensge&nhzy;qre), rvatrunygra jreqra.<\/c>";
		dbTblQ[178].info = "<c>Qnf Nhffpurera mhz \u00dcoreubyra haq qnf Jvrqrervabeqara fvaq erpugmrvgvt haq qrhgyvpu namhx\u00fcaqvtra, qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra.<\/c>";
		dbTblQ[180].info = "<c>Jre na rvare Snueonuairerathat, rvarz Uvaqreavf nhs qre Snueonua bqre rvarz unygraqra Snuemrht yvaxf ibeorvsnuera jvyy, zhff ragtrtraxbzzraqr Snuemrhtr qhepusnuera ynffra. Qvrf tvyg avpug, jraa qre Ibeenat qhepu Irexruefmrvpura naqref trertryg vfg.<\/c>";
		dbTblQ[182].info = "<c>Rva Snuefgervsra qnes ahe trjrpufryg jreqra, jraa rvar Trs\u00e4ueqhat naqrere Irexruefgrvyaruzre nhftrfpuybffra vfg. Wrqre Snuefgervsrajrpufry vfg erpugmrvgvt haq qrhgyvpu namhx\u00fcaqvtra, qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra. Rf vfg nhs qra anpusbytraqra Irexrue mh npugra.<\/c>";
		dbTblQ[184].info = "<c>Vfg nhs Fgen\u00dfra zvg zruerera Snuefgervsra s\u00fce rvar Evpughat qnf qheputruraqr Orsnuera rvarf Snuefgervsraf avpug z\u00f6tyvpu bqre raqrg rva Snuefgervsra, vfg qra nz Jrvgresnuera truvaqregra Snuemrhtra qre \u00dcoretnat nhs qra oranpuonegra Snuefgervsra va qre Jrvfr mh rez\u00f6tyvpura, qnff fvpu qvrfr Snuemrhtr hazvggryone ibe Ortvaa qre Irerathat wrjrvyf vz Jrpufry anpu rvarz nhs qrz qheputruraqra Snuefgervsra snueraqra Snuemrht rvabeqara x\u00f6aara (Erv\u00dfirefpuyhffiresnuera).<\/c>";
		dbTblQ[185].info = "<c>Jre rva Snuemrht s\u00fcueg, zhff orvz Qhepusnuera qrf Ghaaryf Nooyraqyvpug orahgmra haq qnes vz Ghaary avpug jraqra. Qvr qheputruraqr Yvavr qnes nhpu avpug grvyjrvfr \u00fcoresnuera jreqra.<\/c>";
		dbTblQ[196].info = "<c>Rva Snuefgervsrajrpufry j\u00e4ueraq qrf Noovrtraf ovetg Evfvxra, jrvy orvfcvryfjrvfr Xbyyvfvbara zvg \u00fcorefrurara Snuemrhtra qebura.\r\nOrv mh fpuaryyrz Snuera qebug rva Ireyhfg qre Obqraunsghat haq qnzvg \u00fcore qvr Xbagebyyr qrf Snuemrhtf.\r\n<\/c>";
		dbTblQ[197].info = "<c>Yrqvtyvpu qre tryor Cxj fgrug evpugvt. Qre te\u00fcar Cxj fgrug mh jrvg yvaxf, re u\u00e4ggr qvr Irexruefvafry erpugf cnffvrera z\u00fcffra. Qre Yxj ung fvpu uvatrtra mh jrvg erpugf rvatrbeqarg.<\/c>";
		dbTblQ[198].info = "<c>Anpu qrz Noovrtra anpu yvaxf fbyy qvr Snueonua na qre a\u00e4pufgra Xerhmhat anpu erpugf ireynffra jreqra. Sbytyvpu vfg rf fvaaibyy, fvpu jvr qre ebgr Cxj nhs qrz erpugra Snuefgervsra rvamhbeqara, hz fc\u00e4gre avpug qvr Fche jrpufrya mh z\u00fcffra.<\/c>";
		dbTblQ[200].info = "<c>Qre Zbgbeenqsnuere sbytg qre noxavpxraqra Ibesnuegfgen\u00dfr, jrfunyo re qnf Noovrtra namhmrvtra ung. <\/c>";
		dbTblQ[201].info = "<c>Jre rva Snuemrht s&hhzy;ueg, qnes qvr Zvggryvafry qrf Xervfirexruef avpug &hhzy;oresnuera. Nhftrabzzra iba qvrfrz Ireobg fvaq ahe Snuemrhtr, qrara jrtra vuere Nozrffhatra qnf Orsnuera fbafg avpug z&bhzy;tyvpu j&nhzy;er.<\/c>\r\n<c>Rf qnes vaareunyo qrf Xervfirexruef nhs qre Snueonua avpug trunygra jreqra. Jre noovrtra jvyy, zhff qvrf erpugmrvgvt haq qrhgyvpu nax&hhzy;aqvtra. Qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra.<\/c>";
		dbTblQ[203].info = "<c>Nyyr orgrvyvtgra Xensgsnuere z\u00f6pugra noovrtra, jnf cre Oyvaxre namhmrvtra vfg.<\/c>";
		dbTblQ[205].info = "<c>Jre noovrtra jvyy, zhff qvrf erpugmrvgvt haq qrhgyvpu nax&hhzy;aqvtra. Qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra. Qnf Noovrtra va Rvaz&hhzy;aqhatra bqre Tehaqfg&hhzy;pxr vfg namhmrvtra. Orvz noxavpxraqra Ireynhs rvare Ibesnuegfgen&fmyvt;r vfg rorasnyyf mh oyvaxra, fbsrea qvrfre trsbytg jveq.<\/c>";
		dbTblQ[210].info = "<c>Jre &hhzy;ore rvara notrfraxgra Obeqfgrva uvajrt nhs qvr Snueonua rvasnuera bqre ibz Snueonuaenaq nasnuera jvyy vfg jnegrcsyvpugvt haq ung fvpu qnorv fb mh ireunygra, qnff rvar Trs&nhzy;ueqhat naqrere Irexruefgrvyaruzre nhftrfpuybffra vfg.<\/c>";
		dbTblQ[211].info = "<c>Jre ibz Snueonuaenaq nasnuera jvyy ung fvpu qnorv fb mh ireunygra, qnff rvar Trs&nhzy;ueqhat naqrere Irexruefgrvyaruzre nhftrfpuybffra vfg, resbeqreyvpurasnyyf zhff zna fvpu rvajrvfra ynffra. Qvr Nofvpug rvamhsnuera bqre namhsnuera vfg erpugmrvgvt haq qrhgyvpu namhx&hhzy;aqvtra. Qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra.<\/c>";
		dbTblQ[215].info = "<c>Fgbpxg qre Irexrue, qnes gebgm Ibesnueg bqre te\u00fcarz Yvpugmrvpura avpug va qvr Xerhmhat bqre Rvaz\u00fcaqhat rvatrsnuera jreqra, jraa nhs vue trjnegrg jreqra z\u00fcffgr.\r\nXnaa qre Onua\u00fcoretnat jrtra qrf Fgen\u00dfrairexruef avpug m\u00fctvt haq buar Nhsragunyg \u00fcoredhreg jreqra, vfg ibe qrz Naqernfxerhm mh jnegra.\r\n<\/c>";
