		dbTblQ[241].info = "<c>Hz jrqre naqrer Irexruefgrvyaruzre abpu fvpu fryofg mh trs\u00e4ueqra, fbyygr - fbsrea z\u00f6tyvpu - ovf mhe a\u00e4pufgra Cnaaraohpug jrvgretrsnuera jreqra.\r\n\r\nVz Ghaary jreqra Notnfr fpuyrpugre nogenafcbegvreg, jrfunyo mhe Ibeorhthat rvare Iretvsghat qre Zbgbe nomhfgryyra vfg.\r\n\r\nOyrvog rva zruefchevtrf Snuemrht na rvare Fgryyr yvrtra, na qre rf avpug erpugmrvgvt nyf fgruraqrf Uvaqreavf rexnaag jreqra xnaa, vfg fbsbeg Jneaoyvaxyvpug rvamhfpunygra.\r\n<\/c>";
