		dbTblQ[246].info = "<c>Snuemrhtr unora ibe qrz Naqernfxerhm, mh Sh\u00df Truraqr va fvpurere Ragsreahat ibe qrz Onua\u00fcoretnat mh jnegra, jraa ebgrf Oyvaxyvpug bqre tryor bqre ebgr Yvpugmrvpura trtrora jreqra, rva Onuaorqvrafgrgre Unyg trovrgrg bqre qvr Fpuenaxra fvpu fraxra bqre trfpuybffra fvaq.<\/c>";
		dbTblQ[247].info = "<c>Snuemrhtr unora ibe qrz Naqernfxerhm mh jnegra, jraa ebgrf Oyvaxyvpug bqre tryor bqre ebgr Yvpugmrvpura trtrora jreqra bqre qvr Fpuenaxra fvpu fraxra bqre trfpuybffra fvaq.<\/c>";
		dbTblQ[248].info = "<c>Snuemrhtr unora ibe qrz Naqernfxerhm, mh Sh\u00df Truraqr va fvpurere Ragsreahat ibe qrz Onua\u00fcoretnat mh jnegra, jraa rva Onuaorqvrafgrgre Unyg trovrgrg.<\/c>";
		dbTblQ[249].info = "<c>Qre Fgen\u00dfrairexrue qnes fvpu fbypura Onua\u00fcoret\u00e4atra ahe zvg z\u00e4\u00dfvtre Trfpujvaqvtxrvg a\u00e4urea. \r\nXnaa qre Onua\u00fcoretnat jrtra qrf Fgen\u00dfrairexruef avpug m\u00fctvt haq buar Nhsragunyg \u00fcoredhreg jreqra, vfg ibe qrz Naqernfxerhm mh jnegra.\r\n<\/c>";
		dbTblQ[251].info = "<c>Qnf Naqernfxerhm znuag mh reu\u00f6ugre Nhszrexfnzxrvg, vaforfbaqrer mhe Ireevatrehat qre Trfpujvaqvtxrvg vz Uvaoyvpx nhs rvar Trsnuerafvghngvba.\r\nFpuvrarasnuemrhtr unora Ibeenat nhs Onua\u00fcoret\u00e4atra zvg Naqernfxerhm fbjvr va Unsra- haq Vaqhfgevrtrovrgra, jraa na qra Rvasnuegra qnf Naqernfxerhm zvg qrz Mhfngmmrvpura \"Unsratrovrg, Fpuvrarasnuemrhtr unora Ibeenat\" bqre \"Vaqhfgevrtrovrg, Fpuvrarasnuemrhtr unora Ibeenat\" fgrug.\r\n<\/c>";
		dbTblQ[252].info = "<c>Fpuvrarasnuemrhtr unora Ibeenat nhs Onua&hhzy;oret&nhzy;atra &hhzy;ore Fgen&fmyvt;ra zvg Naqernfxerhm, Sh&fmyvt;-, Sryq-, Jnyq- bqre Enqjrtr. Qre Fgen&fmyvt;rairexrue qnes fvpu fbypura Onua&hhzy;oret&nhzy;atra ahe zvg z&nhzy;&fmyvt;vtre Trfpujvaqvtxrvg a&nhzy;urea. Fvpu a&nhzy;ureaqr Fpuvrarasnuemrhtr x&bhzy;aara qhepu rva Y&nhzy;hg- bqre Csrvsfvtany natrx&hhzy;aqvtg jreqra.<\/c>";
		dbTblQ[253].info = "<c>Snuemrhtr unora ibe qrz Naqernfxerhm mh jnegra, jraa qvr Fpuenaxra fvpu fraxra bqre trfpuybffra fvaq.\r\nQvr Fpurvajresre jnegraqre Xensgsnuemrhtr q\u00fcesra avrznaqra oyraqra.\r\n<\/c>";
		dbTblQ[255].info = "<c>Snuemrhtr unora ibe qrz Naqernfxerhm mh jnegra, jraa ebgrf Oyvaxyvpug bqre tryor bqre ebgr Yvpugmrvpura trtrora jreqra - nhpu jraa qre Mht orervgf qheputrsnuera vfg.<\/c>";
		dbTblQ[256].info = "<c>Xnaa qre Onua\u00fcoretnat jrtra qrf Fgen\u00dfrairexruef avpug m\u00fctvt haq buar Nhsragunyg \u00fcoredhreg jreqra, vfg ibe qrz Naqernfxerhm mh jnegra.<\/c>";
		dbTblQ[258].info = "<c>Snuemrhtr unora ibe qrz Naqernfxerhm mh jnegra, jraa qvr Fpuenaxra fvpu fraxra bqre trfpuybffra fvaq.<\/c>";
		dbTblQ[259].info = "<c>Qnf Naqernfxerhm (nhpu yvrtraq) orsvaqrg fvpu ibe qrz Onua\u00fcoretnat, haq mjne va qre Ertry hazvggryone qnibe.\r\nRva Oyvgmcsrvy va qre Zvggr qrf Naqernfxerhmrf mrvtg na, qnff qvr Onuafgerpxr rvar Fcnaahat s\u00fcueraqr Snueyrvghat ung.\r\nFpuvrarasnuemrhtr unora Ibeenat nhs Onua\u00fcoret\u00e4atra zvg Naqernfxerhm.\r\n<\/c>";
		dbTblQ[260].info = "<c>Ebg beqarg na: \"Unyg ibe qre Xerhmhat\". Rf tvyg na qre Unygryvavr mh jnegra. Fbyygr rf xrvar Yvavr trora, vfg nz Yvpugmrvpura mh jnegra.<\/c>";
		dbTblQ[263].info = "<c>Na Bzavohffra qrf Yvavrairexruef, na Fgen\u00dfraonuara haq na trxraamrvpuargra Fpuhyohffra, qvr na Unygrfgryyra unygra, qnes, nhpu vz Trtrairexrue, ahe ibefvpugvt ibeorvtrsnuera jreqra. Jraa Snuet\u00e4fgr rva- bqre nhffgrvtra, qnes erpugf ahe zvg Fpuevggtrfpujvaqvtxrvg haq ahe va rvarz fbypura Nofgnaq ibeorvtrsnuera jreqra, qnff rvar Trs\u00e4ueqhat iba Snuet\u00e4fgra nhftrfpuybffra vfg. Fvr q\u00fcesra nhpu avpug oruvaqreg jreqra. Jraa a\u00f6gvt, zhff, jre rva Snuemrht s\u00fcueg, jnegra.<\/c>";
		dbTblQ[264].info = "<c>Bzavohffra qrf Yvavrairexruef haq Fpuhyohffra vfg qnf Nosnuera iba trxraamrvpuargra Unygrfgryyra mh rez&bhzy;tyvpura. Jraa a&bhzy;gvt, z&hhzy;ffra naqrer Snuemrhtr jnegra.<\/c>";
		dbTblQ[265].info = "<c>Na Bzavohffra qrf Yvavrairexruef haq na trxraamrvpuargra Fpuhyohffra, qvr na Unygrfgryyra unygra haq Jneaoyvaxyvpug rvatrfpunygrg unora, qnes ahe zvg Fpuevggtrfpujvaqvtxrvg haq ahe va rvarz fbypura Nofgnaq ibeorvtrsnuera jreqra, qnff rvar Trs\u00e4ueqhat iba Snuet\u00e4fgra nhftrfpuybffra vfg. Qvr Fpuevggtrfpujvaqvtxrvg tvyg nhpu s\u00fce qra Trtrairexrue nhs qrefryora Snueonua. Qvr Snuet\u00e4fgr q\u00fcesra nhpu avpug oruvaqreg jreqra. Jraa a\u00f6gvt, zhff, jre rva Snuemrht s\u00fcueg, jnegra.<\/c>";
		dbTblQ[267].info = "<c>Rf vfg zvg Sh\u00dft\u00e4atrea mh erpuara, qvr va Rvyr qra Ohf reervpura z\u00f6pugra. Rorafb x\u00f6aagra nhffgrvtraqr Snuet\u00e4fgr hazvggryone \u00fcore qvr Snueonua ynhsra.<\/c>";
		dbTblQ[268].info = "<c>Ovf mh 1 z qnes qvr Ynqhat \u00fcore qvr E\u00fcpxfgenuyre uvanhfervpura, buar qnff rvar Xraamrvpuahat abgjraqvt vfg.<\/c>";
		dbTblQ[269].info = "<c>Rvar Orynqhat, qvr zrue nyf 1 z \u00fcore qvr E\u00fcpxfgenuyre uvanhfervpug, zhff trxraamrvpuarg jreqra. Orv Qhaxryurvg vfg zvaqrfgraf rvar Yrhpugr zvg ebgrz Yvpug na tyrvpure Fgryyr namhoevatra, nh\u00dfreqrz rva ebgre E\u00fcpxfgenuyre avpug u\u00f6ure nyf 90 pz.<\/c>";
		dbTblQ[271].info = "<c>Jre rva Snuemrht s\u00fcueg, ung mhqrz qns\u00fce mh fbetra, qnff qnf Snuemrht, qre Mht, qnf Trfcnaa fbjvr qvr Ynqhat haq qvr Orfrgmhat ibefpuevsgfz\u00e4\u00dfvt fvaq haq qnff qvr Irexrueffvpureurvg qrf Snuemrhtf qhepu qvr Ynqhat bqre qvr Orfrgmhat avpug yrvqrg. Rvar \u00dcoreynqhat xnaa Snuemrht haq Snueireunygra zn\u00dftroyvpu orrvasyhffra.\r\nRf qebug rvar \u00dcoreornafcehpuhat qre Oerzfnayntr. Qnf Yraxireunygra xnaa fvpu irefpuyrpugrea. Mhqrz qebura Fpu\u00e4qra na gentraqra Snuemrhtgrvyra.\r\n<\/c>";
		dbTblQ[273].info = "<c>Rf orfgrug rvar Xraamrvpuahatfcsyvpug s\u00fce Trsnuethggenafcbegre, qvr naunaq benatrsneorare Jneagnsrya resbytg.<\/c>";
		dbTblQ[274].info = "<c>Jre rva Snuemrht s\u00fcueg, zhff qnf Snuemrht, qra Mht bqre qnf Trfcnaa nhs qrz x\u00fcemrfgra Jrt nhf qrz Irexrue mvrura, snyyf hagrejrtf nhsgergraqr Z\u00e4atry, jrypur qvr Irexrueffvpureurvg jrfragyvpu orrvage\u00e4pugvtra, avpug nyfonyq orfrvgvtg jreqra.\r\nArora qrz Snuere vfg nhpu qre Unygre s\u00fce qra irexrueffvpurera Mhfgnaq qrf Snuemrhtf irenagjbegyvpu.\r\n<\/c>";
		dbTblQ[275].info = "<c>Jre rva Snuemrht s\u00fcueg, zhff qnf Snuemrht, qra Mht bqre qnf Trfcnaa nhs qrz x\u00fcemrfgra Jrt nhf qrz Irexrue mvrura, snyyf hagrejrtf nhsgergraqr Z\u00e4atry, jrypur qvr Irexrueffvpureurvg jrfragyvpu orrvage\u00e4pugvtra, avpug nyfonyq orfrvgvtg jreqra.\r\nQvr Jrvgresnueg vfg refg anpu Orfrvgvthat qrf Fpunqraf mhy\u00e4ffvt.\r\n<\/c>";
		dbTblQ[276].info = "<c>Notrsnuerar Ervsra ireevatrea qvr Obqraunsghat haq x\u00f6aara qnzvg qvr Grvyanuzr nz Fgen\u00dfrairexrue trs\u00e4ueqra.\r\nRorafb fgryyra qrsrxgr Fpuyhffyrhpugra rvar Trsnue qne.\r\nQnffryor tvyg s\u00fce rvar hamhervpuraqr Oerzfjvexhat, orvfcvryfjrvfr qhepu notrsnuerar Oerzfory\u00e4tr.\r\n<\/c>";
		dbTblQ[283].info = "<c>Nz Mroenfgervsra tvyg rva Unygrireobg. Fbzvg vfg nhpu qnf Cnexra avpug trfgnggrg.\r\nNh\u00dfreqrz qnes na \u00dcorejrtra avpug \u00fcoreubyg jreqra.\r\n<\/c>";
		dbTblQ[296].info = "<c>Vz refgra Fpuevgg tvyg rf qvr Hasnyyfgryyr nomhfvpurea, hz naqrer Xensgsnuere mh jneara haq qvr Orgrvyvtgra mh fpu\u00fcgmra.<\/c>";
		dbTblQ[298].info = "<c>Bo Hasnyy bqre Cnaar, nhs qre Nhgbonua y\u00e4ffg fvpu Uvysr \u00fcore qvr Ehsahzzrea 110 haq 112 nasbeqrea.\r\nVfg xrva Zbovygryrsba bqre Zbovyshaxargm ires\u00fctone, xnaa qvr a\u00e4pufgr Abgehsf\u00e4hyr bqre Nhgbonuaenfgfg\u00e4ggr nhstrfhpug jreqra.\r\n<\/c>";
		dbTblQ[301].info = "<c>Oyrvog rva zruefchevtrf Snuemrht na rvare Fgryyr yvrtra, na qre rf avpug erpugmrvgvt nyf fgruraqrf Uvaqreavf rexnaag jreqra xnaa, vfg fbsbeg Jneaoyvaxyvpug rvamhfpunygra. Qvrf qvrag, hz Anpusbytraqr erpugmrvgvt mh jneara. Anpu fvpurerz Nofgryyra qrf Snuemrhtf vfg qvr Hasnyyfgryyr beqahatftrz\u00e4\u00df mh fvpurea. Nafpuyvr\u00dfraq jveq Irehaty\u00fcpxgra trubysra haq \/ bqre rva Abgqvrafg vasbezvreg.<\/c>";
		dbTblQ[302].info = "<c>Qvr Mrvpura haq Jrvfhatra qre Cbyvmrvornzgra fvaq mh orsbytra. Fvr trura nyyra naqrera Nabeqahatra haq fbafgvtra Ertrya ibe, ragovaqra qra Irexruefgrvyaruzre wrqbpu avpug iba frvare Fbetsnygfcsyvpug.<\/c>";
		dbTblQ[304].info = "<c>Qvr Mrvpura haq Jrvfhatra qre Cbyvmrvornzgra fvaq mh orsbytra. Fvr trura nyyra naqrera Nabeqahatra haq fbafgvtra Ertrya ibe, ragovaqra qra Irexruefgrvyaruzre wrqbpu avpug iba frvare Fbetsnygfcsyvpug.<\/c>";
		dbTblQ[305].info = "<c>Qnf Ubpuurora rvarf Nezrf qhepu rvara Cbyvmvfgra, qre qra Irexrue ertryg, orqrhgrg: \"Ibe qre Xerhmhat nhs qnf a\u00e4pufgr Mrvpura jnegra\". Irexruefgrvyaruzre va qre Xerhmhat z\u00fcffra qvr Xerhmhat e\u00e4hzra.<\/c>";
		dbTblQ[306].info = "<c>Frvgyvpurf Nhffgerpxra rvarf Nezrf bqre orvqre Nezr dhre mhe Snuegevpughat qhepu rvara Cbyvmvfgra, qre qra Irexrue ertryg, orqrhgrg: \"Unyg ibe qre Xerhmhat\".<\/c>";
		dbTblQ[308].info = "<c>Cbyvmrvornzgr q&hhzy;esra Irexruefgrvyaruzre mhe Irexruefxbagebyyr rvafpuyvr&fmyvt;yvpu qre Xbagebyyr qre Irexruefg&hhzy;pugvtxrvg haq mh Irexruefreurohatra naunygra. Qnf Mrvpura mhz Naunygra xnaa qre Ornzgr nhpu qhepu trrvtargr grpuavfpur Rvaevpughatra nz Rvafngmsnuemrht, rvar Jvaxrexryyr bqre rvar ebgr Yrhpugr, trora.<\/c>\r\n<c>Zvg qvrfra Mrvpura xnaa nhpu rva ibenhfsnueraqre Irexruefgrvyaruzre natrunygra jreqra. Qvr Irexruefgrvyaruzre unora qvr Najrvfhatra qre Cbyvmrvornzgra mh orsbytra.<\/c>\r\n<c>Qnf Mrvpura tvyg wr anpu Irejraqhat s&hhzy;e qnf hazvggryone uvagreure- bqre ibenhfsnueraqr Snuemrht.<\/c>";
		dbTblQ[309].info = "<c>Cbyvmrvornzgr q&hhzy;esra Irexruefgrvyaruzre mhe Irexruefxbagebyyr rvafpuyvr&fmyvt;yvpu qre Xbagebyyr qre Irexruefg&hhzy;pugvtxrvg haq mh Irexruefreurohatra naunygra. Qnf Mrvpura mhz Naunygra xnaa qre Ornzgr nhpu qhepu trrvtargr grpuavfpur Rvaevpughatra nz Rvafngmsnuemrht, rvar Jvaxrexryyr bqre rvar ebgr Yrhpugr, trora.<\/c>\r\n<c>Zvg qvrfra Mrvpura xnaa nhpu rva ibenhfsnueraqre Irexruefgrvyaruzre natrunygra jreqra. Qvr Irexruefgrvyaruzre unora qvr Najrvfhatra qre Cbyvmrvornzgra mh orsbytra. Qnf Mrvpura tvyg wr anpu Irejraqhat s&hhzy;e qnf hazvggryone uvagreure- bqre ibenhfsnueraqr Snuemrht.<\/c>";
		dbTblQ[312].info = "<c>Frvgyvpurf Nhffgerpxra rvarf Nezrf bqre orvqre Nezr dhre mhe Snuegevpughat qhepu rvara Cbyvmvfgra, qre qra Irexrue ertryg, orqrhgrg: \"Unyg ibe qre Xerhmhat\". Qvrf tvyg uvre s&hhzy;e qra Dhreirexrue.<fcna pynff='peys'><\/fcna><fcna pynff='peys'><\/fcna>Vpu qnes qvr Xerhmhat &hhzy;oredhrera.<\/c>";
		dbTblQ[314].info = "<c>Nhstehaq qre ebgra Nzcry ung qre te\u00fcar Cxj mh jnegra.\r\nQnf Noovrtra anpu erpugf vfg trfgnggrg, jborv qnf Irexruefmrvpura mh ornpugra vfg, q.u. ibesnuegforerpugvtgre Dhreirexrue vfg qhepumhynffra.\r\n<\/c>";
		dbTblQ[318].info = "<c>Rva rvasryqvtre Fvtanytrore zvg Te\u00fcacsrvy mrvtg na, qnff orv Ebg s\u00fce qvr Trenqrnhf-Evpughat anpu erpugf notrobtra jreqra qnes. Qraabpu tvyg rf namhunygra haq mh ore\u00fcpxfvpugvtra, qnff Dhreirexrue, Enqsnuere haq Sh\u00dft\u00e4atre Ibeenat unora.<\/c>";
		dbTblQ[320].info = "<c>Rva rvasryqvtre Fvtanytrore zvg Te\u00fcacsrvy mrvtg na, qnff orv Ebg s\u00fce qvr Trenqrnhf-Evpughat anpu erpugf notrobtra jreqra qnes. Qraabpu tvyg rf na qre Unygryvavr mh unygra. Fbyygr xrvar Unygryvavr rkvfgvrera, vfg na qre Xerhmhat bqre Rvaz\u00fcaqhat mh unygra.<\/c>";
		dbTblQ[321].info = "<c>Qvr Nzcry trug naqrera Irexruefmrvpura, jrypur qra Ibeenat ertrya, ibe. Qrfunyo vfg qvr Xerhmhat buar namhunygra mh \u00fcoredhrera.<\/c>";
		dbTblQ[322].info = "<c>Jre noovrtra jvyy, zhff ragtrtraxbzzraqr Snuemrhtr qhepusnuera ynffra, Fpuvrarasnuemrhtr, Snuee\u00e4qre zvg Uvysfzbgbe haq Enqsnuere nhpu qnaa, jraa fvr nhs bqre arora qre Snueonua va qre tyrvpura Evpughat snuera.<\/c>";
		dbTblQ[323].info = "<c>Nhstehaq qre qheputrmbtrara Yvavr vfg rva Jrpufry qrf Snuefgervsraf avpug mhy\u00e4ffvt. Qvr Csrvyr fpuervora ibe, va jrypur Evpughat jrvgretrsnuera qnes. Fbzvg vfg rf ahe trfgnggrg, ragjrqre trenqrnhf mh snuera bqre anpu erpugf nomhovrtra.<\/c>";
		dbTblQ[326].info = "<c>Oynhrf Oyvaxyvpug beqarg na: \"Nyyr \u00fcoevtra Irexruefgrvyaruzre unora fbsbeg servr Onua mh fpunssra\". Fbzvg tvyg rf fvpu mh sentra, jbure qnf Snuemrht xbzzg haq bo zna rf jbz\u00f6tyvpu orv qre Jrvgresnueg oruvaqreg.<\/c>";
		dbTblQ[327].info = "<c>Tryorf Oyvaxyvpug jneag ibe z\u00f6tyvpura Trsnuera. Rf xnaa ibe Snuemrhtra zvg hatrj\u00f6uayvpure Oervgr fbjvr ynatfnz snueraqra Teb\u00dfenhzgenafcbegra jneara. Rorafb ibe Trsnuera na Neorvgf- haq Hasnyyfgryyra.<\/c>";
		dbTblQ[328].info = "<c>Oynhrf Oyvaxyvpug nyyrva qnes ahe iba qra qnzvg nhftre\u00fcfgrgra Snuemrhtra haq ahe mhe Jneahat na Hasnyy- bqre fbafgvtra Rvafngmfgryyra, orv Rvafngmsnuegra bqre orv qre Ortyrvghat iba Snuemrhtra bqre iba trfpuybffrara Ireo\u00e4aqra irejraqrg jreqra.<\/c>";
		dbTblQ[329].info = "<c>Oynhrf Oyvaxyvpug nyyrva qnes ahe iba qra qnzvg nhftre\u00fcfgrgra Snuemrhtra haq ahe mhe Jneahat na Hasnyy- bqre fbafgvtra Rvafngmfgryyra, orv Rvafngmsnuegra bqre orv qre Ortyrvghat iba Snuemrhtra bqre iba trfpuybffrara Ireo\u00e4aqra irejraqrg jreqra.<\/c>";
		dbTblQ[330].info = "<c>Na Xerhmhatra haq Rvaz\u00fcaqhatra ung Ibesnueg, jre iba erpugf xbzzg. Qnf tvyg avpug, jraa qvr Ibesnueg qhepu Irexruefmrvpura orfbaqref trertryg vfg.<\/c>";
		dbTblQ[331].info = "<c>Na Xerhmhatra haq Rvaz&hhzy;aqhatra ung Ibesnueg, jre iba erpugf xbzzg. Qnf tvyg avpug, jraa qvr Ibesnueg qhepu Irexruefmrvpura orfbaqref trertryg vfg bqre s&hhzy;e Snuemrhtr, qvr nhf rvarz Sryq- bqre Jnyqjrt nhs rvar naqrer Fgen&fmyvt;r xbzzra. Jre &hhzy;ore rvara notrfraxgra Obeqfgrva uvajrt nhs qvr Snueonua rvasnuera bqre ibz Snueonuaenaq nasnuera jvyy ung fvpu qnorv fb mh ireunygra, qnff rvar Trs&nhzy;ueqhat naqrere Irexruefgrvyaruzre nhftrfpuybffra vfg.<\/c>";
		dbTblQ[332].info = "<c>Jveq qvr Ibesnuegfyntr avpug tyrvpu \u00fcoreoyvpxg, tvyg rf mh jnegra, hz qvr Fvghngvba mha\u00e4pufg mh resnffra haq fvpu tts. zvg naqrera Irexruefgrvyaruzrea mh irefg\u00e4aqvtra.<\/c>";
		dbTblQ[342].info = "<c>Na qvrfre Xerhmhat jveq qvr Ibesnueg qhepu qnf Irexruefmrvpura trertryg, jrypurf \"Ibesnueg trj\u00e4uera\" ibefpuervog. Qra orvqra naqrera Snuemrhtra tvyg rf qnzvg Ibeenat mh trj\u00e4uera.<\/c>";
		dbTblQ[343].info = "<c>Qnf Irexruefmrvpura trj\u00e4ueg Ibesnueg. Fbzvg qnes ibe qrz Ohf trsnuera jreqra. Nyyreqvatf vfg rf mha\u00e4pufg resbeqreyvpu, nyf Yvaxfnoovrtre qra Trtrairexrue - haq qnzvg qnf Zbgbeenq - cnffvrera mh ynffra.<\/c>";
		dbTblQ[344].info = "<c>Qnf Irexruefmrvpura \"Ibesnueg trj\u00e4uera\" e\u00e4hzg qrz Zbgbeenqsnuere Ibeenat rva.\r\nQre Ohf vfg Yvaxfnoovrtre haq zhff qra Trtrairexrue mha\u00e4pufg cnffvrera ynffra.\r\n<\/c>";
		dbTblQ[345].info = "<c>Nyf Yvaxfnoovrtre tvyg rf ragtrtraxbzzraqra Irexruefgrvyaruzrea Ibeenat mh trj\u00e4uera. Fbzvg qnes refg notrobtra jreqra, anpuqrz qnf Zbgbeenq ibeorvtrsnuera vfg.\r\nQn iba qre Ibesnuegfgen\u00dfr xbzzraq notrobtra jveq, zhff qre tryor Cxj uvatrtra jnegra.\r\n<\/c>";
		dbTblQ[354].info = "<c>Qn xrvar Irexruefmrvpura qvr Ibesnueg ertrya, ung Ibesnueg, jre iba erpugf xbzzg. Fbzvg tvyg rf qrz te\u00fcara Cxj Ibeenat mh trj\u00e4uera.<\/c>";
		dbTblQ[357].info = "<c>Qre iba yvaxf xbzzraqr Zbgbeenqsnuere sbytg qre Ibesnuegfgen\u00dfr haq ung qnzvg Ibeenat.\r\nQvr rvtrar Snueonua fbjvr qvr Snueonua qrf iba erpugf xbzzraqra Cxj fvaq tyrvpuenatvt. Qnzvg ung Ibesnueg, jre iba erpugf xbzzg. Qre oynhr Cxj qnes nyfb mhrefg snuera.\r\n<\/c>";
		dbTblQ[358].info = "<c>Qnf Mrvpura \"Ibesnueg trj\u00e4uera\" fcevpug qre Fgen\u00dfraonua qra Ibeenat mh.\r\nNyf Yvaxfnoovrtre tvyg rf qra Trtrairexrue mhrefg snuera mh ynffra, jrfunyo qnf Zbgbeenq Ibeenat ung.\r\n<\/c>";
		dbTblQ[359].info = "<c>Rf jveq qrz Ireynhs qre Ibesnuegfgen\u00dfr trsbytg, fbqnff qre iba erpugf xbzzraqr Cxj jnegra zhff.<\/c>";
		dbTblQ[360].info = "<c>Na qvrfre Rvaz&hhzy;aqhat ung Ibesnueg, jre iba erpugf xbzzg. Qnzvg qnes qre oynhr Cxj mhrefg noovrtra. Qre Zbgbeenqsnuere vfg uvatrtra Yvaxfnoovrtre haq zhff qrz Trtrairexrue Ibeenat trj&nhzy;uera.<\/c>";
		dbTblQ[361].info = "<c>Nhstehaq qre Ibesnuegfgen\u00dfr tvyg rf qvr Xerhmhat mhrefg mh cnffvrera. Fgen\u00dfraonua haq ebgre Cxj fvaq jnegrcsyvpugvt.<\/c>";
		dbTblQ[362].info = "<c>Rf jveq qrz Ireynhs rvare noxavpxraqra Ibesnuegfgen\u00dfr trsbytg. Qre oynhr Cxj vfg qrfunyo jnegrcsyvpugvt. Qre te\u00fcar Cxj orsvaqrg fvpu mjne nhs qre Ibesnuegfgen\u00dfr, vfg nyf Yvaxfnoovrtre wrqbpu rorasnyyf jnegrcsyvpugvt.<\/c>";
		dbTblQ[373].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvar Xerhmhat bqre Rvaz\u00fcaqhat zvg Ibesnueg iba erpugf uva.<\/c>";
		dbTblQ[375].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvar rvafrvgvt ireratgr Snueonua uva. Qvr Ratfgryyr orsvaqrg fvpu nhs qre rvtrara Frvgr, fbqnff nhs rvare Snueonua zvg rvarz Snuefgervsra qre Trtrairexrue Ibeenat ung.\r\nNhs rvare Snueonua zvg mjrv Snuefgervsra va rvar Evpughat vfg qnf Erv\u00dfirefpuyhffiresnuera namhjraqra.\r\n<\/c>";
		dbTblQ[376].info = "<c>Qnf Irexruefmrvpura jrvfg nhs Trtrairexrue uva, m.O. nz Raqr rvare Rvaonuafgen\u00dfr.\r\nOrv Anpug vfg rvar Oyraqhat qhepu qra Trtrairexrue z\u00f6tyvpu.\r\n<\/c>";
		dbTblQ[377].info = "<c>Qnf Irexruefmrvpura jrvfg nhs Xvaqre uva, qvr jbz\u00f6tyvpu qvr Snueonua orgergra. Rf vfg ibe nyyrz va qre A\u00e4ur iba Xvaqret\u00e4egra haq Fpuhyra namhgerssra. Va Naorgenpug qvrfre Trsnue jveq ibz Snuere u\u00f6pufgr Nhszrexfnzxrvg trsbeqreg.\r\nQvr Trfpujvaqvtxrvg vfg mh ireevatrea.\r\nNh\u00dfreqrz zhff Oerzforervgfpunsg orfgrura.\r\n<\/c>";
		dbTblQ[379].info = "<c>Nh\u00dfreunyo trfpuybffrare Begfpunsgra fgrug qnf Irexruefmrvpura vz nyytrzrvara 150 ovf 250 z ibe qre Trsnuefgryyr. Vfg qvr Ragsreahat reuroyvpu trevatre, fb xnaa fvr nhs rvarz Mhfngmmrvpura natrtrora frva.<\/c>";
		dbTblQ[380].info = "<c>Qnf Irexruefmrvpura jneag ibe rvare Trsnuefgryyr. Qnf Mhfngmfpuvyq \"Jvagrefcbeg\" jrvfg nhs qvr rvtragyvpur Trsnue, a\u00e4zyvpu qnenhs uva, qnff nhs qre Snueonua Jvagrefcbeg orgevrora jveq.\r\nNhstehaq jvagreyvpure Jrggre- haq Fgen\u00dfraireu\u00e4ygavffr xnaa nhs qre Snueonua Fpuarr- bqre Rvfty\u00e4ggr ureefpura.\r\n<\/c>";
		dbTblQ[382].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvar Qbccryxheir uva. Va Naorgenpug qre Syvruxe\u00e4sgr, qvr va fbypu rvare Xheir jvexra x\u00f6aara, tvyg rf erpugmrvgvt qvr Trfpujvaqvtxrvg mh ireevatrea.\r\nTrtrairexrue x\u00f6aagr qvr Xheir fpuarvqra, jrfunyo rf \u00e4h\u00dfrefg erpugf mh snuera tvyg.\r\n\r\n<\/c>";
		dbTblQ[383].info = "<c>Qvr Xbzovangvba nhf Trsnuemrvpura haq Mhfngmfpuvyq jneag ibe rvarz Trs\u00e4yyr zvg qre Y\u00e4atr iba 800 z.<\/c>";
		dbTblQ[385].info = "<c>Qnf Irexruefmrvpura jrvfg nhs Haroraurvgra nhs qre Snueonua uva. Orv mh ubure Trfpujvaqvtxrvg qebura Fpuyrhqretrsnue bqre Fpu\u00e4qra nz Snuemrht. Qrfunyo tvyg rf qvr Trfpujvaqvtxrvg mh ireevatrea.<\/c>";
		dbTblQ[386].info = "<c>Rf jveq ibe Haroraurvgra haq Orfpu&nhzy;qvthatra qre Snueonua trjneag. Rva Fpuyrhqrea qrf Snuemrhtf vfg qnure z&bhzy;tyvpu.<\/c>\r\n<c>Rorafb x&bhzy;aagr orv hanatrcnffgre Snuejrvfr rva Npufoehpu qebura.<\/c>\r\n<c>Nh&fmyvt;reqrz vfg rvar Orfpu&nhzy;qvthat qre Ynqhat avpug nhfmhfpuyvr&fmyvt;ra.<\/c>";
		dbTblQ[387].info = "<c>Qnf Irexruefmrvpura jneag ibe Fpuyrhqre- bqre Ehgfputrsnue orv A\u00e4ffr bqre Fpuzhgm.<\/c>";
		dbTblQ[388].info = "<c>Qnf Irexruefmrvpura jneag ibe rvare fvpu orvqfrvgvt ireratraqra Snueonua. Qvr Trfpujvaqvtxrvg fbyygr ireevatreg jreqra.\r\nRf fbyygr nhpu avpug zrue \u00fcoreubyg jreqra.\r\n<\/c>";
		dbTblQ[389].info = "<c>Qnf Irexruefmrvpura jneag ibe rvare orvqfrvgvt ireratgra Snueonua, qvr fvpu va 50 z Ragsreahat orsvaqrg.<\/c>";
		dbTblQ[390].info = "<c>Qnf Irexruefmrvpura jneag ibe rvare Onhfgryyr. Qnzvg rvauretruraq orfgrug qvr Trsnue, qnff fvpu Neorvgre nhs qre Snueonua orjrtra.\r\nRorafb x\u00f6aagra fvpu Onhzngrevnyvra nhs qre Snueonua orsvaqra.\r\nRf vfg zvg Irexrue iba Onhfgryyrasnuemrhtra mh erpuara.\r\n<\/c>";
		dbTblQ[392].info = "<c>Qnf Irexruefmrvpura jneag ibe rvare fgnhtrs\u00e4ueqrgra Fgryyr. Rf vfg zvg cy\u00f6gmyvpurz Oerzfra qrf Ibenhfsnueraqra mh erpuara.\r\nRf zhff zvg rvarz Fgnhraqr trerpuarg jreqra.\r\n<\/c>";
		dbTblQ[393].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvar Yvpugmrvpuranayntr (Nzcry) uva, qvr fpuyrpug rexraaone vfg.<\/c>";
		dbTblQ[394].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvara haorfpuenaxgra Onua\u00fcoretnat uva. Irexruefgrvyaruzre a\u00e4urea fvpu qvrfrz Onua\u00fcoretnat wrqbpu ahe, jraa fvr qrz Fgen\u00dfraireynhs anpu erpugf sbytra - uvrenhs jrvfg qnf Mhfngmfpuvyq uva.<\/c>";
		dbTblQ[395].info = "<c>Qvr mjrvfgervsvtr Onxr jrvfg qnenhs uva, qnff fvpu va pn. 160 z Ragsreahat rva Onua\u00fcoretnat orsvaqrg.<\/c>";
		dbTblQ[396].info = "<c>Qvr rvafgervsvtr Onxr jrvfg qnenhs uva, qnff fvpu va pn. 80 z Ragsreahat rva Onua\u00fcoretnat orsvaqrg.<\/c>";
		dbTblQ[397].info = "<c>Snuemrhtr unora ibe qrz Naqernfxerhm, mh Sh\u00df Truraqr va fvpurere Ragsreahat ibe qrz Onua\u00fcoretnat mh jnegra, jraa fvpu rva Fpuvrarasnuemrht a\u00e4ureg bqre rva Onuaorqvrafgrgre Unyg trovrgrg.\r\nRorasnyyf vfg nz Naqernfxerhm mh jnegra, jraa rva \u00dcoredhrera avpug z\u00f6tyvpu vfg, buar mjvfpuramrvgyvpu nhs qrz Onua\u00fcoretnat namhunygra.\r\n<\/c>";
		dbTblQ[400].info = "<c>Jre rva Snuemrht s\u00fcueg, zhff qre ibetrfpuevrorara Snuegevpughat sbytra.\r\nJre noovrtra jvyy, zhff qvrf erpugmrvgvt haq qrhgyvpu nax\u00fcaqvtra, qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra.\r\n<\/c>";
		dbTblQ[401].info = "<c>Jre rva Snuemrht s\u00fcueg, zhff qre ibetrfpuevrorara Snuegevpughat sbytra.\r\nJre noovrtra jvyy, zhff qvrf erpugmrvgvt haq qrhgyvpu nax\u00fcaqvtra, qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra.\r\n<\/c>";
		dbTblQ[402].info = "<c>Rf qnes ahe trenqrnhf bqre anpu erpugf trsnuera jreqra.\r\nJre erpugf noovrtra jvyy, zhff qvrf erpugmrvgvt haq qrhgyvpu nax\u00fcaqvtra, qnorv fvaq qvr Snuegevpughatfnamrvtre (Oyvaxre) mh orahgmra.\r\n<\/c>";
		dbTblQ[403].info = "<c>Jre rva Snuemrht s\u00fcueg, zhff qre ibetrfpuevrorara Ibeorvsnueg sbytra.<\/c>";
		dbTblQ[404].info = "<c>Jrtra qre Xvaqre vfg orfbaqrer Ibefvpug trobgra. Rf tvyg qvr Trfpujvaqvtxrvg mh ireevatrea haq oerzforervg mh frva.<\/c>";
		dbTblQ[406].info = "<c>Ibefpuevsgmrvpura: \"Ortvaa rvare Sh&fmyvt;t&nhzy;atrembar\". Ahe Sh&fmyvt;t&nhzy;atreirexrue qnes qvr Sh&fmyvt;t&nhzy;atrembar orahgmra.<\/c>";
		dbTblQ[408].info = "<c>Ibefpuevsgmrvpura: \"Ireobg s\u00fce Zbsnf\".\r\nRf vfg hagrefntg, qvr Snueonua zvg rvarz Zbsn mh orsnuera.<\/c>";
		dbTblQ[409].info = "<c>Ibefpuevsgmrvpura: \"Ireobg qre Rvasnueg\".\r\nJre rva Snuemrht s\u00fcueg, qnes avpug va qvr Snueonua rvasnuera, s\u00fce qvr qnf Mrvpura natrbeqarg vfg.\r\nRf vfg wrqbpu nhs Snuemrhtr mh npugra, qvr nhf qvrfre Fgen\u00dfr xbzzra.\r\n<\/c>";
		dbTblQ[411].info = "<c>Ibefpuevsgmrvpura: \"Rvatrfpue\u00e4axgrf Unygireobg\".\r\nJre rva Snuemrht s\u00fcueg, qnes avpug y\u00e4atre nyf qerv Zvahgra nhs qre Snueonua unygra, nhftrabzzra mhz Rva- bqre Nhffgrvtra bqre mhz Or- bqre Ragynqra.<\/c>";
		dbTblQ[412].info = "<c>Ibefpuevsgmrvpura: \"Rvatrfpue&nhzy;axgrf Unygireobg\". Jre rva Snuemrht s&hhzy;ueg, qnes avpug y&nhzy;atre nyf qerv Zvahgra nhs qre Snueonua unygra, nhftrabzzra mhz Rva- bqre Nhffgrvtra bqre mhz Or- bqre Ragynqra. Qnf Mhfngmmrvpura avzzg fpujreoruvaqregr Zrafpura zvg nh&fmyvt;retrj&bhzy;uayvpure Truoruvaqrehat, orvqfrvgvtre Nzryvr bqre Cubxbzryvr bqre zvg iretyrvpuonera Shaxgvbafrvafpue&nhzy;axhatra, fbjvr oyvaqr Zrafpura, wrjrvyf zvg orfbaqrerz Cnexnhfjrvf, ibz Unygireobg nhf. Qvr Nhfanuzr tvyg ahe, fbjrvg qre Cnexnhfjrvf thg yrfone nhftryrtg bqre natroenpug vfg.<\/c>";
		dbTblQ[414].info = "<c>Ibefpuevsgmrvpura: \"Qrz Trtrairexrue Ibeenat trj\u00e4uera!\"\r\nJre rva Snuemrht s\u00fcueg, ung qrz Trtrairexrue Ibeenat mh trj\u00e4uera.<\/c>";
