		dbTblQ[421].info = "<c>Ibefpuevsgmrvpura: \"Fgen&fmyvt;raonuara bqre Yvavraohffr\". Qnf Mhfngmfpuvyq xraamrvpuarg rvar Fpuhyohfunygrfgryyr. Rf zhff qnzvg trerpuarg jreqra, qnff vaforfbaqrer Xvaqre hanpugfnz fvaq haq enfpu qvr Fgen&fmyvt;r &hhzy;oredhrera, hz erpugmrvgvt qra Ohf mh reervpura. Xvaqre z&hhzy;ffra qnorv avpug mjnatfy&nhzy;hsvt qra x&hhzy;emrfgra Jrt j&nhzy;uyra.<\/c>";
		dbTblQ[426].info = "<c>Ibefpuevsgmrvpura: \"Sh&fmyvt;t&nhzy;atre\". Naqrere nyf Sh&fmyvt;t&nhzy;atreirexrue qnes qra Trujrt avpug ahgmra. Rvar Nhfanuzr fgryyg qre Yvrsreirexrue qne, qre qhepu qnf Mhfngmfpuvyq nhftrabzzra vfg.<\/c>";
		dbTblQ[427].info = "<c>Ibefpuevsgmrvpura: \"Yvavrabzavohffr\".\r\nNaqrere Snueirexrue nyf Bzavohffr qrf Yvavrairexruef fbjvr anpu qrz Crefbaraors\u00f6eqrehatferpug zvg qrz Fpuhyohf-Fpuvyq mh xraamrvpuaraqr Snuemrhtr qrf Fpu\u00fcyre- haq Oruvaqregrairexruef q\u00fcesra Ohffbaqresnuefgervsra avpug orahgmra.<\/c>";
		dbTblQ[428].info = "<c>Ibefpuevsgmrvpura: \"Ireobg s&hhzy;e Snuemrhtr nyyre Neg\". Rf orfgrug rva Ireobg s&hhzy;e Snuemrhtr nyyre Neg. Qnf Mhfngmfpuvyq reynhog Nayvrtrea, va qvrfr Fgen&fmyvt;r rvamhsnuera. Nyf Nayvrtre trygra Orjbuare haq Orfhpure qre Orjbuare.<\/c>";
		dbTblQ[430].info = "<c>Ibefpuevsgmrvpura: \"Ireobg s\u00fce Xensgjntra\".\r\nRf orfgrug rva Ireobg s\u00fce Xensgjntra haq fbafgvtr zruefchevtr Xensgsnuemrhtr.<\/c>";
		dbTblQ[431].info = "<c>Ibefpuevsgmrvpura: \"Ireobg s&hhzy;e Enqirexrue\".<\/c>\r\n<c>Qnf Ibefpuevsgmrvpura ireovrgrg rvar Ahgmhat qre Snueonua zvg Snuee&nhzy;qrea.<\/c>";
