		dbTblQ[446].info = "<c>Qnf Unygra nhs qre Snueonua vfg ireobgra. Qnf Mhfngmmrvpura jrvgrg qnf Unygrireobg nhs qra Frvgrafgervsra nhf.<\/c>";
		dbTblQ[447].info = "<c>Jre rva Snuemrht s\u00fcueg, qnes vaareunyo qre trxraamrvpuargra Mbar avpug y\u00e4atre nyf qerv Zvahgra unygra, nhftrabzzra mhz Rva- bqre Nhffgrvtra bqre mhz Or- bqre Ragynqra.<\/c>";
		dbTblQ[448].info = "<c>Qnf Irexruefmrvpura jrvfg nhs qnf Raqr rvarf rvatrfpue&nhzy;axgra Unygireobgf s&hhzy;e rvar Mbar uva.<\/c>";
		dbTblQ[452].info = "<c>Jre noovrtra jvyy, zhff qvrf erpugmrvgvt haq qrhgyvpu nax\u00fcaqvtra, qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra - nhpu orvz Ireynffra rvarf Xervfirexruef. Orv qre Rvasnueg va rvara fbypura Xervfirexrue vfg qvr Orahgmhat qrf Snuegevpughatfnamrvtref uvatrtra hamhy\u00e4ffvt. <\/c>";
		dbTblQ[453].info = "<c>Vfg na qre Rvaz\u00fcaqhat va rvara Xervfirexrue \"Ibesnueg trj\u00e4uera!\" natrbeqarg, ung qre Irexrue nhs qre Xervfsnueonua Ibesnueg.\r\nJre noovrtra jvyy, zhff qvrf erpugmrvgvt haq qrhgyvpu nax\u00fcaqvtra, qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra.\r\n<\/c>";
		dbTblQ[454].info = "<c>Rf qnes vaareunyo qrf Xervfirexruef nhs qre Snueonua avpug trunygra jreqra.<\/c>";
		dbTblQ[455].info = "<c>Vfg na qre Rvaz\u00fcaqhat va rvara Xervfirexrue \"Ibesnueg trj\u00e4uera!\" natrbeqarg, ung qre Irexrue nhs qre Xervfsnueonua Ibesnueg.\r\nJre noovrtra jvyy, zhff qvrf erpugmrvgvt haq qrhgyvpu nax\u00fcaqvtra, qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra. \r\n<\/c>";
		dbTblQ[456].info = "<c>Vfg na qre Rvaz\u00fcaqhat va rvara Xervfirexrue \"Ibesnueg trj\u00e4uera!\" natrbeqarg, ung qre Irexrue nhs qre Xervfsnueonua Ibesnueg.\r\nJre noovrtra jvyy, zhff qvrf erpugmrvgvt haq qrhgyvpu nax\u00fcaqvtra, qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra. \r\n<\/c>";
		dbTblQ[457].info = "<c>Qnf Irexruefmrvpura mrvtg na, qnff na qre a\u00e4pufgra Xerhmhat bqre Rvaz\u00fcaqhat Ibesnueg orfgrug.<\/c>";
		dbTblQ[460].info = "<c>Evpugmrvpura: \"Nhgbonua\".\r\nNo qvrfrz Mrvpura trygra qvr Ertrya s\u00fce qra Irexrue nhs Nhgbonuara.<\/c>";
		dbTblQ[463].info = "<c>Qnf Irexruefmrvpura Ahzzre 1 mrvtg na, qnff na qre a&nhzy;pufgra Xerhmhat bqre Rvaz&hhzy;aqhat Ibesnueg orfgrug. Ahzzre 2: \"Raqr qre Ibesnuegfgen&fmyvt;r\", Ahzzre 3: \"Ibeenat ibe qrz Trtrairexrue va rvare Ratfgryyr\".<\/c>";
		dbTblQ[464].info = "<c>Qnf Mrvpura Ae. 2 mrvtg na, qnff na qre a\u00e4pufgra Xerhmhat bqre Rvaz\u00fcaqhat Ibesnueg orfgrug.<\/c>";
		dbTblQ[466].info = "<c>Mhz Cnexra vfg qre erpugr Frvgrafgervsra, qnmh tru\u00f6era nhpu ragynat qre Snueonua natryrtgr Cnexfgervsra, mh orahgmra, jraa re qnmh nhfervpuraq orsrfgvtg vfg, fbafg vfg na qra erpugra Snueonuaenaq urenamhsnuera. Qnf tvyg va qre Ertry nhpu, jraa zna ahe unygra jvyy.<\/c>";
		dbTblQ[468].info = "<c>Qnf Irexruefmrvpura jrvfg nhs qnf Raqr qre Ibesnuegfgen\u00dfr uva.<\/c>";
		dbTblQ[469].info = "<c>Rf orfgrug Ibeenat ibe qrz Trtrairexrue. Gebgmqrz x&bhzy;aagr rf frva, qnff orervgf Trtrairexrue qvr Ratfgryyr cnffvreg. Ragfcerpuraq zhff qvr Ratfgryyr serv frva, hz fvr cnffvrera mh x&bhzy;aara. Jrtra qrf Trtrairexruef xnaa rf abgjraqvt frva, gebgm Ibeenat namhunygra.<\/c>";
		dbTblQ[471].info = "<c>Ahe Orjbuare zvg ragfcerpuraq ahzzrevregrz Cnexnhfjrvf q\u00fcesra uvre cnexra.<\/c>";
		dbTblQ[472].info = "<c>Qhepu qnf Mhfngmmrvpura zvg Ebyyfghuysnuerefvaaovyq vfg qvr Cnexreynhoavf orfpue\u00e4axg nhs fpujreoruvaqregr Zrafpura zvg nh\u00dfretrj\u00f6uayvpure Truoruvaqrehat, orvqfrvgvtre Nzryvr bqre Cubxbzryvr bqre zvg iretyrvpuonera Shaxgvbafrvafpue\u00e4axhatra, nhs oyvaqr Zrafpura fbjvr nhs qrera Ortyrvgcrefbara.<\/c>";
		dbTblQ[473].info = "<c>Qnf Cnexra vfg ahe zvg Cnexfpurva reynhog. Re zhff thg yrfone nhftryrtg frva.\r\nRf vfg avpug trfgnggrg, qvr nhs qrz Fpurva natrtrorar Cnexqnhre mh \u00fcorefpuervgra.\r\n<\/c>";
		dbTblQ[474].info = "<c>Jre rva Snuemrht s\u00fcueg, qnes nhs Trujrtra zvg Snuemrhtra zvg rvare mhy\u00e4ffvtra Trfnzgznffr \u00fcore 2,8 g avpug cnexra.\r\nQvr mhy\u00e4ffvtr Trfnzgznffr rvarf Zbgbeenqf yvrtg qnehagre, fbqnff nhpu qvrfrf trcnexg jreqra qnes.\r\n<\/c>";
		dbTblQ[475].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvar Xensgsnuefgen\u00dfr uva. Nhgbonuara haq Xensgsnuefgen\u00dfra q\u00fcesra ahe zvg Xensgsnuemrhtra orahgmg jreqra, qrera qhepu qvr Onhneg orfgvzzgr U\u00f6pufgtrfpujvaqvtxrvg zrue nyf 60 xz\/u orge\u00e4tg.<\/c>";
		dbTblQ[478].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvar Fnpxtnffr uva.<\/c>";
		dbTblQ[479].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvar Refgr-Uvysr-Fgngvba uva.<\/c>";
		dbTblQ[481].info = "<c>Qre Yngrearaevat xraamrvpuarg vaareunyo trfpuybffrare Begfpunsgra Yngreara, qvr avpug qvr tnamr Anpug yrhpugra. Va qrz ebgra Sryq xnaa va jrv\u00dfre Fpuevsg natrtrora frva, jnaa qvr Yngrear reyvfpug.<\/c>";
		dbTblQ[482].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvar Ohaqrffgen&fmyvt;r uva, qvr Mnuy tvog qvr Ahzzre qre Ohaqrffgen&fmyvt;r jvqre.<\/c>";
		dbTblQ[483].info = "<c>Qnf Mrvpura xraamrvpuarg Nygreangvifgerpxra nhs Nhgbonuara, qrera Orahgmhat vz Orqnesfsnyy rzcsbuyra jveq (Fgerpxrarzcsruyhat).<\/c>";
		dbTblQ[484].info = "<c>Jre rva Snuemrht s\u00fcueg, zhff orvz Qhepusnuera qrf Ghaaryf Nooyraqyvpug orahgmra.<\/c>";
		dbTblQ[486].info = "<c>Jre rva Snuemrht s\u00fcueg, zhff orvz Qhepusnuera qrf Ghaaryf Nooyraqyvpug orahgmra. Fbsrea rvar Fbaaraoevyyr trgentra jveq, tvyg rf qvrfr nomharuzra.<\/c>";
		dbTblQ[487].info = "<c>Nhpu jraa qre Ghaary uryy oryrhpugrg vfg: Jre rva Snuemrht s\u00fcueg, zhff orvz Qhepusnuera qrf Ghaaryf Nooyraqyvpug orahgmra.<\/c>";
		dbTblQ[488].info = "<c>Qnf Irexruefmrvpura jrvfg nhs qnf Raqr rvarf irexrueforehuvtgra Orervpuf uva.<\/c>";
		dbTblQ[489].info = "<c>Cnexjneagnsrya x\u00f6aara nhs Nau\u00e4atre uvajrvfra, qvr nhs qre Snueonua vaareunyo trfpuybffrare Begfpunsgra notrfgryyg fvaq.\r\nRorafb qvrara fvr mhe Xraamrvpuahat iba Snuemrhtra zvg \u00dcoreoervgr.\r\n<\/c>";
		dbTblQ[493].info = "<c>Rva mh trevatre Ervsraqehpx reu\u00f6ug qra Xensgfgbssireoenhpu.\r\nRorafb s\u00fcueg re mh rvarz u\u00f6urera Ervsranoevro.\r\n<\/c>";
		dbTblQ[494].info = "<c>Orv y\u00e4atrera Fgnaqmrvgra rzcsvruyg rf fvpu, qra Zbgbe nomhfpunygra. Qvrf gevssg u\u00e4hsvt s\u00fce qnf Jnegra na Onua\u00fcoret\u00e4atra mh.\r\nRorafb s\u00fce y\u00e4atrerf Jnegra vz Irexrueffgnh.\r\n<\/c>";
		dbTblQ[495].info = "<c>Zbgbera\u00f6yr haq \u00e4uayvpur Fpuzvrefgbssr fvaq jnffretrs\u00e4ueqraq. Rva Gebcsra xnaa pn. 600 Yvgre Jnffre hatravr\u00dfone znpura.<\/c>";
		dbTblQ[496].info = "<c>Orvz Gnaxra fbyygra xrvar Xensgfgbssq\u00e4zcsr rvatrngzrg jreqra.\r\nAvpug anpugnaxra, jraa qre Gnax ynhg Mncscvfgbyr ibyy vfg. Qre trgnaxgr Xensgfgbss vfg a\u00e4zyvpu x\u00fcuy haq x\u00f6aagr fvpu nhfqruara.\r\n<\/c>";
		dbTblQ[506].info = "<c>Rvar ibenhffpunhraqr Snuejrvfr ge\u00e4tg mh rvarz trevatra Xensgfgbssireoenhpu orv haq tvyg qrfunyo nyf hzjrygorjhffg. Fvr uvysg, haa\u00f6gvtrf Orfpuyrhavtra haq Nooerzfra mh irezrvqra.<\/c>";
		dbTblQ[509].info = "<c>Qvr Ore\u00fcpxfvpugvthat qrf Xensgfgbssireoenhpuf orvz Nhgbxnhs ge\u00e4tg mh rvare ireevatregra Hzjrygorynfghat orv.\r\nRvar ibenhffpunhraqr Snuejrvfr ge\u00e4tg mh rvarz ireevatregra Xensgfgbssireoenhpu orv.\r\nQhepu Ahgmhat \u00f6ssragyvpure Irexruefzvggry jveq qvr Hzjryg ragynfgrg.\r\n<\/c>";
		dbTblQ[510].info = "<c>Qnf Zrvqra iba Snuegra fpubag qvr Hzjryg. Qvrf tvyg orfbaqref s\u00fce Snuegra va \u00fcores\u00fcyygr Fg\u00e4qgr, Xhemfgerpxrasnuegra fbjvr Snuegra zvg Ibyytnf.<\/c>";
		dbTblQ[513].info = "<c>Wr u\u00f6ure qvr Trfpujvaqvtxrvg va qre Xheir, qrfgb u\u00f6ure qvr nhsgergraqr Syvruxensg.\r\nWr xyrvare qre Xheiraenqvhf, qrfgb u\u00f6ure qvr nhsgergraqr Syvruxensg.\r\n<\/c>";
		dbTblQ[517].info = "<c>Qrsrxgr Fgb\u00dfq\u00e4zcsre x\u00f6aara qvr Arvthat qrf Snuemrhtf hat\u00fcafgvt orrvasyhffra haq qnqhepu qvr Snuefgnovyvg\u00e4g irefpuyrpugrea. Qnf Fpuyrhqrea va Xheira jveq ort\u00fcafgvtg. \r\nRva mh avrqevtre bqre hagrefpuvrqyvpure Ervsraqehpx jvexg fvpu hat\u00fcafgvt nhs Obqraunsghat haq Snuefgnovyvg\u00e4g nhf.\r\n<\/c>";
		dbTblQ[520].info = "<c>Qnf Fpuarvqra iba Xheira vfg trs&nhzy;ueyvpu, jrvy rva Mhfnzzrafgb&fmyvt; zvg qrz Trtrairexrue qebug.<\/c>\r\n<c>Fc&nhzy;grf Nooyraqra xnaa qra Trtrairexrue oyraqra, qre qnqhepu jbz&bhzy;tyvpu qvr Snueyvavr xerhmg bqre iba qre Snueonua noxbzzg.<\/c>";
		dbTblQ[523].info = "<c>Qnf U\u00f6era ynhgre Zhfvx vfg rvar Noyraxhat, jrypur qvr Nhszrexfnzxrvg qrf Snueref orrvage\u00e4pugvtg.\r\nOyvaqr Sh\u00dft\u00e4atre x\u00f6aara qhepu qvr ynhgr Zhfvx va vuere Bevragvrehat trfg\u00f6eg jreqra.\r\n<\/c>";
		dbTblQ[525].info = "<c>Nhstehaq qre fpuaryyra Naa&nhzy;urehat orfgrug qnf Evfvxb, mh fc&nhzy;g iba naqrera Irexruefgrvyaruzrea rexnaag mh jreqra, fbqnff qvrfr orervgf mhz &Hhzy;oreubyra nhftrfpureg unora.<\/c>\r\n<c>Wr u&bhzy;ure qvr Trfpujvaqvtxrvg, qrfgb te&bhzy;&fmyvt;re fvaq qvr Nhfjvexhatra iba Frvgrajvaq nhs qvr Snuefgnovyvg&nhzy;g.<\/c>";
		dbTblQ[527].info = "<c>Ertra anpu y&nhzy;atrere Gebpxraurvg xnaa nhs qre Snueonua rvara Fpuzvresvyz remrhtra. Trynatg Fcevgmjnffre nhs Uryzivfvre bqre Fpuhgmoevyyr, qebug rvar reuroyvpu irefpuyrpugregr Fvpug.<\/c>";
		dbTblQ[529].info = "<c>Orv anurz Snuera na qre Zvggryyvavr j&nhzy;ueraq rvare Yvaxfxheir qebug qre X&bhzy;ecre va qvr Fche qrf Trtrairexruef mh entra.<\/c>\r\n<c>Snuera nhs qre Snueonuaznexvrehat xnaa rvar fpuyrpugrer Obqraunsghat mhe Sbytr unora, qnf Zbgbeenq qebug nomhehgfpura.<\/c>";
		dbTblQ[531].info = "<c>Xbcsfgrvacsynfgre ovrgrg xrvar orfbaqref thgr Obqraunsghat, qvr fvpu orv A&nhzy;ffr mhf&nhzy;gmyvpu irefpuyrpugreg. Fbzvg qebug rvar reu&bhzy;ugr Oybpxvrearvthat qre Oerzfra.<\/c>\r\n<c>Rf orfgrug rvar reu&bhzy;ugr Fghemtrsnue.<\/c>\r\n<c>Nh&fmyvt;reqrz xnaa qnf Uvagreenq qhepuqerura bqre jrtehgfpura, jraa orfpuyrhavtg jveq.<\/c>";
		dbTblQ[533].info = "<c>Fbjbuy qhepu Ertra nyf nhpu Fcevgmjnffre xnaa fvpu qvr Fvpug qhepu Ivfvre bqre Fpuhgmoevyyr zrexyvpu irefpuyrpugrea.<\/c>\r\n<c>Fgen&fmyvt;rafpu&nhzy;qra jreqra bsg fc&nhzy;gre rexnaag bqre fvaq trareryy fpuyrpugre rexraaone.<\/c>\r\n<c>Qnf Fcevgmjnffre naqrere Snuemrhtr orrvage&nhzy;pugvtg qvr Fvpug mhf&nhzy;gmyvpu.<\/c>";
		dbTblQ[535].info = "<c>Qnzvg Ervsra avpug jrtehgfpura bqre fvpu irexrvyra, jreqra Fpuvrara ibemhtfjrvfr zvg rvarz teb&fmyvt;ra Jvaxry (nz orfgra fraxerpug) &hhzy;oredhreg.<\/c>\r\n<c>Nhs qra Fpuvrara rvare Fgen&fmyvt;raonua orfgrug vzzre rvar reu&bhzy;ugr Ehgfpu- haq qnzvg nhpu Fghemtrsnue.<\/c>";
		dbTblQ[536].info = "<c>&Bhzy;y nhs qre Snueonua xnaa qvr Obqraunsghat zn&fmyvt;troyvpu irefpuyrpugrea haq qnzvg qvr Fghemtrsnue reu&bhzy;ura.<\/c>\r\n<c>Orvz &Hhzy;oresnuera iba Snueonuaznexvrehatra qebug rorasnyyf rvar irefpuyrpugregr Obqraunsghat.<\/c>";
		dbTblQ[537].info = "<c>Qvr orfgr Obqraunsghat irefcevpug rva qverxgre Xbagnxg mjvfpura Snueonuaorynt haq Ervsra. Ynho haq Fnaq irefpuyrpugrea qvr Obqraunsghat.<\/c>\r\n<c>Rorafb x&bhzy;aara Fpunpugqrpxry qvr Obqraunsghat orrvage&nhzy;pugvtra.<\/c>";
		dbTblQ[538].info = "<c>Orv rvafrgmraqrz Ertra jreqra Oerzffpurvora haq Oerzfory&nhzy;tr srhpug, jbqhepu fvpu qrera Rvtrafpunsgra ire&nhzy;aqrea. Qnaa tvyg rf oruhgfnz mh oerzfra.<\/c>\r\n<c>Qnffryor tvyg orvz Snuera nhs Xbcsfgrvacsynfgre, jrvy qbeg rvar iretyrvpufjrvfr fpuyrpugr Obqraunsghat trobgra jveq.<\/c>";
		dbTblQ[539].info = "<c>Notrsnuerar Ervsra unora rvar fpuyrpugr Jnffreireqe\u00e4athat, qvr jvrqrehz Ndhncynavat ort\u00fcafgvtg.\r\nVa Fcheevyyra fnzzryg fvpu irezrueg Jnffre, jnf qvr Trsnue reu\u00f6ug.\r\nWr u\u00f6ure qvr Trfpujvaqvtxrvg, qrfgb fpuyrpugre jveq Jnffre \u00fcore qnf Ervsracebsvy notryrvgrg.\r\n<\/c>";
		dbTblQ[541].info = "<c>Qre \u00dcoreubyfgrvsra vfg iba Fpuarrzngfpu orqrpxg, jrypure qvr Obqraunsghat fgnex orrvage\u00e4pugvtra xnaa.\r\nMhf\u00e4gmyvpu orfgrug qvr Trsnue, qnff qvr Snueonua hagre qrz Fpuarrzngfpu abpu irervfg vfg.\r\nQvr mh \u00fcoreubyraqra Snuemrhtr x\u00f6aara Fpuarrzngfpu haq Jnffre ubpufpuyrhqrea, jnf qvr Fvpug orrvage\u00e4pugvtg.\r\n<\/c>";
		dbTblQ[542].info = "<c>Orv fgnexrz Frvgrajvaq uvysg Trtrayraxra, hz qnf Snuemrht va qre Fche mh unygra.\r\nRvar Ireevatrehat qre Trfpujvaqvtxrvg uvysg qnorv, qnf Snuemrht gebgm fgnexrz Frvgrajvaq hagre Xbagebyyr mh orunygra.\r\n<\/c>";
		dbTblQ[544].info = "<c>Qvr Jvaqsnuar fvtanyvfvreg rvara Frvgrajvaq iba erpugf, sbytyvpu jveq qre rvtrar Cxj anpu yvaxf trqe\u00fcpxg.\r\n\r\nOrvz Rvasnuera va qra Jvaqfpunggra qrf Yxj jvexg qre Frvgrajvaq avpug zrue fb fgnex, jbqhepu qre rvtrar Cxj anpu erpugf mvrug.\r\n<\/c>";
		dbTblQ[546].info = "<c>Fgnexre Ertra orrvage\u00e4pugvtg qvr Fvpug haq resbeqreg qrfunyo rvar Nacnffhat qre Trfpujvaqvtxrvg.\r\nMhtyrvpu qebug qvr Ragfgruhat iba Ndhncynavat.\r\nQre Oerzfjrt jveq qhepu qvr fgnexr A\u00e4ffr irey\u00e4atreg.\r\n<\/c>";
		dbTblQ[548].info = "<c>Qhepu rvar Irefpuyrpugrehat qrf Snueonuamhfgnaqrf qebug Fpuyrhqre- haq Ehgfputrsnue, m.O. qhepu Fpuynty\u00f6pure bqre rvar ireevatregr Obqraunsghat, qvr nhs qra Snueonuaorynt mhe\u00fcpxmhs\u00fcuera vfg.\r\nRvar fpuyrpugr Snueonua remrhtg bsgznyf ynhgr Ervsratre\u00e4hfpur.\r\n<\/c>";
		dbTblQ[550].info = "<c>Zrexzny iba Nyyrra fvaq qvr mnuyervpura O\u00e4hzr. Qvrfr unora bsg ratr Xheira mhe Sbytr haq x\u00f6aara qvr Fvpug orrvage\u00e4pugvtra.\r\nQvr Snueonua xnaa fpuzny haq trj\u00f6yog frva, jnf vaforfbaqrer orv Trtrairexrue reu\u00f6ugr Ibefvpug resbeqreg.\r\n<\/c>";
		dbTblQ[551].info = "<c>Va Fcheevaara xnaa fvpu Jnffre fnzzrya, jbqhepu Ndhncynavat ort\u00fcafgvtg jveq.\r\nSnueonuafraxra x\u00f6aara \u00fcore qvrfryor Rvtrafpunsg ires\u00fctra.\r\n<\/c>";
		dbTblQ[553].info = "<c>Fgnho haq naqrer Fpuzhgmcnegvxry, qvr fvpu nhs qre Jvaqfpuhgmfpurvor orsvaqra, x\u00f6aara rvara fpuzvrevtra Svyz ovyqra haq qnqhepu qvr Fvpug refpujrera.\r\nRva \u00e4uayvpure Svyz xnaa fvpu nhpu nhs qre Snueonua ovyqra, jbqhepu rvar irefpuyrpugregr Obqraunsghat qebug.\r\n<\/c>";
		dbTblQ[554].info = "<c>Orv rvagergraqrz Ertra xnaa fvpu nhs qre Snueonua rva Fpuzvresvyz ovyqra, jrypure qvr Obqraunsghat irefpuyrpugreg.\r\nFgnho haq naqrer Fpuzhgmcnegvxry, qvr fvpu nhs qre Jvaqfpuhgmfpurvor orsvaqra, x\u00f6aara rvara fpuzvrevtra Svyz ovyqra haq qnqhepu qvr Fvpug refpujrera.\r\n<\/c>";
		dbTblQ[555].info = "<c>Qnf \u00dcoresnuera qre Yrvgyvavr znt mjne qnf Evfvxb ireevatrea, iba qre Snueonua nomhxbzzra, qbpu rf reu\u00f6ug qnf Evfvxb rvare Xbyyvfvba zvg qrz Trtrairexrue. Qrfunyo vfg rf avpug reynhog, qvr Snueonua ragfcerpuraq mh ahgmra.<\/c>";
		dbTblQ[556].info = "<c>Qvr Trfpujvaqvtxrvg vfg vaforfbaqrer qra Fgen\u00dfra-, Irexruef-, Fvpug- haq Jrggreireu\u00e4ygavffra fbjvr qra cref\u00f6ayvpura S\u00e4uvtxrvgra haq qra Rvtrafpunsgra iba Snuemrht haq Ynqhat namhcnffra. Orge\u00e4tg qvr Fvpugjrvgr qhepu Arory, Fpuarrsnyy bqre Ertra jravtre nyf 50 z, qnes avpug fpuaryyre nyf 50 xz\/u trsnuera jreqra, jraa avpug rvar trevatrer Trfpujvaqvtxrvg trobgra vfg. Rf qnes ahe fb fpuaryy trsnuera jreqra, qnff vaareunyo qre \u00fcorefruonera Fgerpxr trunygra jreqra xnaa. Orv cy\u00f6gmyvpu nhsgergraqrz Arory irefpuyrpugreg fvpu qvr Fvpug, jrfunyo qvr Trfpujvaqvtxrvg hazvggryone na qvr arhra Fvpugorqvathatra namhcnffra vfg.\r\nQnf Rvafpunygra qrf Nooyraqyvpugf vfg abgjraqvt, hz iba naqrera Irexruefgrvyaruzrea orffre trfrura mh jreqra.\r\n<\/c>";
		dbTblQ[557].info = "<c>Zvg qre Mrvg x\u00f6aara fvpu xyrvar Arorygebcsra nhs qre Jvaqfpuhgmfpurvor noyntrea haq qvr Fvpug orrvage\u00e4pugvtra. Rvar orqnesftrerpugr Ahgmhat qre Fpurvorajvfpure uvysg, rvar thgr Fvpug mh orunygra.\r\nVaforfbaqrer Yxj x\u00f6aara teb\u00dfr Zratra Fpuarrzngfpu nhs qvr Jvaqfpuhgmfpurvor ors\u00f6eqrea, jnf qvr Fvpug nhs Snueonua haq Irexrueftrfpurura fbsbeg rvafpue\u00e4axg. Ibeurevtrf Rvafpunygra qre Fpurvorajvfpure orhtg qvrfrz Evfvxb ibe.\r\n<\/c>";
		dbTblQ[560].info = "<c>Jreqra Jvyqgvrer qhepu Sreayvpug troyraqrg, oyrvora fvr u\u00e4hsvt vz Yvpugxrtry fgrura. Qrfunyo tvyg rf fbsbeg nomhoyraqra.\r\nMhf\u00e4gmyvpurf Uhcra xnaa qnf Gvre nhs qvr fvpu a\u00e4ureaqr Trsnue nhszrexfnz znpura. Nh\u00dfreqrz vfg mh oerzfra, hz rvare Xbyyvfvba ibemhorhtra.\r\n<\/c>";
		dbTblQ[564].info = "<c>Orv Qhaxryurvg xnaa rvar anffr Snueonua qvr Jvexhat fvpu a\u00e4ureaqra Trtrayvpugf irefg\u00e4exra, jbqhepu qvr Fpurvajresre oyraqra.\r\nNh\u00dfreqrz fvaq orv Qhaxryurvg Fpuyvrera nhs qre Jvaqfpuhgmfpurvor fg\u00e4exre fvpugone haq x\u00f6aara qvr Fvpug qrhgyvpu orrvage\u00e4pugvtra.\r\n<\/c>";
		dbTblQ[565].info = "<c>Orv y\u00e4atrerz Snuera zvg ubure Trfpujvaqvtxrvg \u00e4aqreg fvpu qvr Jnuearuzhat, Snuere fpu\u00e4gmra qvr Trfpujvaqvtxrvg bsg mh avrqevt rva.\r\nQn fpuaryyrf Snuera rva uburf Zn\u00df na Xbamragengvba resbeqreg, avzzg qvr Xbamragengvbafs\u00e4uvtxrvg zvg qre Mrvg no.\r\n<\/c>";
		dbTblQ[566].info = "<c>Orv y\u00e4atrerz Snuera zvg ubure Trfpujvaqvtxrvg \u00e4aqreg fvpu qvr Jnuearuzhat, Snuere fpu\u00e4gmra qvr Trfpujvaqvtxrvg bsg mh avrqevt rva.\r\nNhstehaq qre orrvasyhffgra Jnuearuzhat arvtra Xensgsnuere mh anurz Nhssnuera.\r\n<\/c>";
		dbTblQ[569].info = "<c>Orv oervgre haq thg nhftronhgre Fgen&fmyvt;r jveq qvr Trfpujvaqvtxrvg trear mh avrqevt rvatrfpu&nhzy;gmg. Y&nhzy;atrerf Snuera zvg ubure Trfpujvaqvtxrvg ung rvara &nhzy;uayvpura Rssrxg.<\/c>";
		dbTblQ[572].info = "<c>Nyyrra fvaq iba O\u00e4hzra rvatrsnffg haq unora bsg rvar fpuznyr Snueonua. Hzfb jvpugvtre vfg rf, qra frvgyvpura Nofgnaq tyrvpu qbccryg mh ore\u00fcpxfvpugvtra, a\u00e4zyvpu mhz Trtrairexrue haq qra O\u00e4hzra.\r\nFbyygr rva ragtrtraxbzzraqrf Snuemrht frue oervg frva, vfg rf tts. resbeqreyvpu namhunygra, hz fvpure narvanaqre ibeorvsnuera mh x\u00f6aara.\r\n<\/c>";
		dbTblQ[574].info = "<c>Jre nyf Yrgmgre rvare Xbybaar &hhzy;oreubyg, zhff qra y&nhzy;atfgra &Hhzy;oreubyjrt mhe&hhzy;pxyrtra haq vfg fbzvg orfbaqref ynatr nhs qre Snueonua qrf Trtrairexruef hagrejrtf. Mhtyrvpu vfg qnzvg mh erpuara, qnff naqrer Snuere nhf qre Xbybaar rorasnyyf nhffpurera. Fbyygr rf resbeqreyvpu frva, jvrqre va qvr Xbybaar rvamhfpurera, x&bhzy;aagr rf mhz Hasnyy xbzzra.<\/c>";
		dbTblQ[576].info = "<c>Rf vfg yvaxf mh \u00fcoreubyra. S\u00fce qnf \u00dcoreubyra iba erpugf tvog rf xrvara Tehaq, vaforfbaqrer jrvy fvpu yvaxf xrvar Snuemrhtfpuynatr orsvaqrg.<\/c>";
