		dbTblQ[1181].info = "<c>Fgnexrf Oerzfra xnaa va qre Xheir mhz Jrtehgfpura qrf Zbsnf s&hhzy;uera. Qnffryor Evfvxb orfgrug orv ireevatregre Obqraunsghat qhepu rvar anffr bqre irervfgr Snueonua. Fnaq bqre Ebyyfcyvgg x&bhzy;aara qvr Obqraunsghat rorasnyyf ireevatrea.<\/c>";
		dbTblQ[1182].info = "<c>Vz Trs&nhzy;yyr irey&nhzy;atreg fvpu qre Oerzfjrt. Qvr Zvganuzr iba fpujrerz Trc&nhzy;px reu&bhzy;ug qvr Znffr qrf Snuemrhtf, jnf qra Oerzfjrt rorasnyyf irey&nhzy;atreg.<\/c>";
		dbTblQ[1183].info = "<c>Qvr A\u00e4ffr jvexg fvpu nhs qnf Ireunygra qre Fpurvoraoerzfra artngvi nhf, qvr Oerzfjvexhat gevgg fc\u00e4gre rva.<\/c>";
		dbTblQ[1185].info = "<c>Qre Ervsrayhsgqehpx fbyygr, jraa z\u00f6tyvpu, zvg xnygra Ervsra trce\u00fcsg jreqra, qn re iba qre Grzcrenghe orrvasyhffg jveq.\r\nQvr Orynqhat \/ Orfrgmhat qrf Snuemrhtf jvexg fvpu rorasnyyf nhf, wr u\u00f6ure qvr Mhynqhat, qrfgb u\u00f6ure fbyygr qre Ervsraqehpx rvatrfgryyg jreqra.\r\n<\/c>";
		dbTblQ[1186].info = "<c>Orv Ireqbccyhat qre Trfpujvaqvtxrvg reu&bhzy;ug fvpu qvr Syvruxensg hz qnf Ivresnpur.<\/c>\r\n<c>Qvr Sbezry mhe Orerpuahat ynhgrg:<\/c>\r\n<c>S = z * ((i*i) \/ e)<\/c>\r\n<c>(S = Syvruxensg; z = Snuemrhtznffr; i = Trfpujvaqvtxrvg; e = Xheiraenqvhf)<\/c>";
		dbTblQ[1187].info = "<c>Jvr fgnex qvr Syvruxensg nhsgevgg, u\u00e4atg mhz rvara iba qre Trfpujvaqvtxrvg no. Wr u\u00f6ure qvr Trfpujvaqvtxrvg, qrfgb te\u00f6\u00dfre qvr nhsgergraqr Syvruxensg.\r\nMhz naqrera ibz Xheiraenqvhf. Wr ratre qvr Xheir, qrfgb u\u00f6ure qvr Syvruxensg.\r\n<\/c>";
		dbTblQ[1188].info = "<c>Zvg zbagvregrz Orvjntra fbyy va Erpugfxheira z&nhzy;&fmyvt;vt Tnf trtrora jreqra, jrvy qnf Zbgbeenq vz Iretyrvpu mhz Orvjntra qvr y&nhzy;atrer Fgerpxr mhe&hhzy;pxyrtra zhff. Va Yvaxfxheira vfg qvr Fvghngvba tranh hztrxrueg, fbqnff yrvpugrf Irem&bhzy;trea abgjraqvt vfg.<\/c>";
		dbTblQ[1189].info = "<c>Orv Snuegra zvg qrz Trfcnaa fbyygr fvpu qre Zvgsnuere fgrgf vz Orvjntra orsvaqra. Uvreqhepu jveq qnf Trfcnaa fgnovyvfvreg haq qvr Xvcctrsnue ireevatreg.<\/c>";
		dbTblQ[1190].info = "<c>Urog qre Orvjntra va rvare Erpugfxheir no, fbyygr qnf Grzcb ireevatreg haq qnf X&bhzy;ecretrjvpug va Evpughat Orvjntra ireyntreg jreqra. Rorafb fbyygr irefhpug jreqra, rvara te&bhzy;&fmyvt;rera Obtra mh snuera.<\/c>";
		dbTblQ[1191].info = "<c>Va Xheira jvexg qvr Syvruxensg fgrgf anpu nh&fmyvt;ra. Qrzragfcerpuraq qebug rva erpugffrvgvt zbagvregre Orvjntra va rvare mh fpuaryy trsnuerara Erpugfxheir mhz Nourora.<\/c>";
		dbTblQ[1192].info = "<c>Qnf Snuera zvg Orvjntra resbeqreg rvar Nacnffhat. Orvz Orfpuyrhavtra mvrug qnf Trfcnaa anpu erpugf, jrvy fvpu qre Orvjntra ge&nhzy;tre nyf qnf Zbgbeenq ireu&nhzy;yg.<\/c>\r\n<c>Orv Xheirasnuegra vfg rf avpug z&bhzy;tyvpu, Fpue&nhzy;tyntr rvamharuzra. Fbzvg vfg qre Nhftyrvpu &hhzy;ore qvr Yraxhat ibemharuzra.<\/c>";
		dbTblQ[1193].info = "<c>Qnf Snuera zvg Orvjntra resbeqreg rvar Nacnffhat. Orvz Oerzfra mvrug qnf Trfcnaa anpu yvaxf, jrvy fvpu qre Orvjntra ge&nhzy;tre nyf qnf Zbgbeenq ireu&nhzy;yg.<\/c>\r\n<c>Va Xheira jvexg qvr Syvruxensg fgrgf anpu nh&fmyvt;ra. Qrzragfcerpuraq qebug rva erpugffrvgvt zbagvregre Orvjntra va rvare mh fpuaryy trsnuerara Erpugfxheir mhz Nourora.<\/c>";
		dbTblQ[1194].info = "<c>Jbuanau\u00e4atre erntvrera nhs unfgvtrf Yraxra haq qebura nhfmhoerpura.\r\nNhstehaq qre Y\u00e4atr qrf Mhtf irey\u00e4atreg fvpu qre \u00dcoreubyjrt. Qnf mhf\u00e4gmyvpur Trjvpug haq qre reu\u00f6ugr Yhsgjvqrefgnaq x\u00f6aara qra \u00dcoreubyjrt mhf\u00e4gmyvpu irey\u00e4atrea.\r\n<\/c>";
		dbTblQ[1195].info = "<c>Qre Nau\u00e4atre s\u00fcueg mh rvarz u\u00f6urera Trfnzgtrjvpug haq reu\u00f6ug qra Yhsgjvqrefgnaq, jbqhepu fvpu qnf Orfpuyrhavthatfirez\u00f6tra ireevatreg.\r\nQhepu qvr irete\u00f6\u00dfregr Y\u00e4atr jveq va Xheira haq qnzvg nhpu orvz Noovrtra zrue Cyngm ora\u00f6gvtg, h.n. mhz Nhfubyra.\r\n<\/c>";
		dbTblQ[1196].info = "<c>Qre Nau&nhzy;atre s&hhzy;ueg mh rvarz u&bhzy;urera Trfnzgtrjvpug haq reu&bhzy;ug qra Yhsgjvqrefgnaq, jbqhepu fvpu qnf Orfpuyrhavthatfirez&bhzy;tra ireevatreg.<\/c>\r\n<c>Qhepu qvr irete&bhzy;&fmyvt;regr Y&nhzy;atr jveq va Xheira haq qnzvg nhpu orvz Noovrtra zrue Cyngm ora&bhzy;gvtg, h.n. nhpu mhz Nhfubyra.<\/c>\r\n<c>Rorafb qnhreg rf y&nhzy;atre, hz qvr Snueyvavr qrf Trtrairexruef mh &hhzy;oredhrera.<\/c>";
		dbTblQ[1197].info = "<c>Vz Trs\u00e4yyr xnaa qre Nau\u00e4atre rvar Fpuhojvexhat ragjvpxrya, fvr vfg qrfunyo mh ore\u00fcpxfvpugvtra. \r\nRvar natrcnffgr Trfpujvaqvtxrvg haq rva avrqevtrere Tnat urysra qre Fpuhojvexhat mh ragtrtara.\r\n<\/c>";
		dbTblQ[1199].info = "<c>Ibe Snuegortvaa vfg mh xbagebyyvrera, bo f\u00e4zgyvpur Yrhpugra qrf Jbuanau\u00e4atref shaxgvbavrera.\r\nFbyygra qvr Fcvrtry xrvar nhfervpuraqr Fvpug ovrgra, fvaq Mhfngmfcvrtry mh zbagvrera.\r\n<\/c>";
		dbTblQ[1200].info = "<c>Qhepu qvr mhf\u00e4gmyvpur Znffr fbetg qre Nau\u00e4atre s\u00fce rvar Fpuhojvexhat, jrypur qra Oerzfjrt irey\u00e4atreg.<\/c>";
		dbTblQ[1201].info = "<c>Ibe qrz Naxbccrya rvarf (Jbua-)Nau\u00e4atref vfg mh ce\u00fcsra, bo qvr mhy\u00e4ffvtr Npuf- haq Fg\u00fcgmynfg avpug \u00fcorefpuevggra jveq.\r\nQre Jbuajntra x\u00f6aagr qvr Fvpug qhepu qvr Fcvrtry rvafpue\u00e4axra. Fbyygr qvrf qre Snyy frva, fvaq Mhfngmfcvrtry mh zbagvrera.\r\n<\/c>";
		dbTblQ[1202].info = "<c>Xnhz vfg qvr Snuefghsr rvatryrtg, j\u00fceqr qnf Snuemrht ybfsnuera. Qrfunyo y\u00e4ffg fvpu orv qra zrvfgra Nhgbzngvxsnuemrhtra qre J\u00e4uyurory ahe org\u00e4gvtra, jraa qvr Oerzfr org\u00e4gvtg jveq.<\/c>";
		dbTblQ[1203].info = "<c>Qnzvg avpug zvg mh uburz bqre mh avrqevtrz Ervsraqehpx trsnuera jveq, vfg re ertryz\u00e4\u00dfvt mh xbagebyyvrera - rvafpuyvr\u00dfyvpu qrf Qehpxf ibz Refngmenq.\r\nRvar ubur Mhynqhat resbeqreg rvara u\u00f6urera Ervsraqehpx. Re vfg anpu Ibetnor qrf Snuemrhturefgryyref namhcnffra.\r\n<\/c>";
		dbTblQ[1204].info = "<c>Nhstehaq vuere Xbafgehxgvbafjrvfr q\u00fcesra qvr zrvfgra Abge\u00e4qre ahe ovf 80 xz\/u trsnuera jreqra.\r\nQnf Abgenq fgryyg xrvara qnhreunsgra Refngm qne. Rf qnes ahe fbjrvg trsnuera jreqra, jvr haorqvatg resbeqreyvpu.\r\n<\/c>";
