		dbTblQ[1212].info = "<c>Rva ibyyfg&nhzy;aqvtrf Nhsfrgmra vfg harey&nhzy;ffyvpu, qnzvg rvar fvpurer Ireovaqhat mjvfpura Nau&nhzy;atre haq Snuemrht orfgrug. Mh rexraara vfg fbypu rvar Ireovaqhat qnena, qnff qvr Xhtry vz Xhtryxbcs rvatrenfgrg vfg. Mhqrz zhff rvar ryrxgevfpur Ireovaqhat uretrfgryyg jreqra. Ahe jraa qnf Xnory qrf Nau&nhzy;atref rvatrfgrpxg vfg, x&bhzy;aara qvr Fvtanyyrhpugra shaxgvbavrera.<\/c>";
		dbTblQ[1213].info = "<c>Anpu qrz Naxhccrya vfg qnf Noerv\u00dffrvy zvg qre Nau\u00e4atrexhccyhat mh ireovaqra, qnzvg rf vz Reafgsnyy qvr Oerzfr nz Nau\u00e4atre nhfy\u00f6fg.\r\nQvr Shaxgvba qre Oerzfr nz Nau\u00e4atre vfg mh ce\u00fcsra, hz fvpure nz Fgen\u00dfrairexrue grvyaruzra mh x\u00f6aara.\r\nQnf Fg\u00fcgmenq tru\u00f6eg va qvr borefgr Fgryyhat troenpug.\r\n<\/c>";
