		dbTblQ[1296].info = "<c>Rvar qheputrebfgrgr Nhfchssnayntr remrhtg haa\u00f6gvtra Y\u00e4ez, qre naqrer Zrafpura ory\u00e4fgvtg.\r\nRf orfgrug qnf Evfvxb, qnff fvpu Grvyr qre Nhfchssnayntr y\u00f6fra haq m.O. j\u00e4ueraq qre Snueg nhs qvr Fgen\u00dfr snyyra haq qnzvg naqrer Irexruefgrvyaruzre trs\u00e4ueqra.\r\n<\/c>";
