		dbTblQ[2089].info = "<c>Mjvfpura qra Snuemrhtra x&bhzy;aagra wrqremrvg Xvaqre nhsgnhpura - qnf Irexruefmrvpura jneag fbtne rkcyvmvg ibe qvrfre Trsnue. Nh&fmyvt;re qra Xvaqrea x&bhzy;aagra rorafb Rejnpufraqr nhs qvr Snueonua ynhsra.<\/c>\r\n<c>Nhstehaq qre qvpug cnexraqra Snuemrhtr fvaq Sh&fmyvt;t&nhzy;atre haq naqrer Irexruefgrvyaruzre jbz&bhzy;tyvpu refg fc&nhzy;g mh rexraara, fbqnff wrqremrvg fgnexrf Oerzfra abgjraqvt frva xnaa.<\/c>";
