		dbTblQ[2091].info = "<c>Va Jbuatrovrgra zvg trevatrz Irexrue orfgrug rvar reu&bhzy;ugr Jnuefpurvayvpuxrvg, qnff Irexruefgrvyaruzre qvr Evfvxra hagrefpu&nhzy;gmra.<\/c>\r\n<c>Enqsnuere haq naqrer Irexruefgrvyaruzre x&bhzy;aara qrfunyo hanhszrexfnz frva.<\/c>\r\n<c>Rf vfg avpug nhfmhfpuyvr&fmyvt;ra, qnff Xvaqre va A&nhzy;ur qre Snueonua fcvryra haq qvrfr tts. orgergra.<\/c>";
		dbTblQ[2092].info = "<c>Qnf Ireunygra iba Sh&fmyvt;t&nhzy;atrea vfg fpujre ibeurefruone. Naqref nyf Xensgsnuere x&bhzy;aara fvr ivry yrvpugre nhs unyorz Jrtr hzqerura.<\/c>\r\n<c>Rvavtr Sh&fmyvt;t&nhzy;atre ireynffra fvpu nhffpuyvr&fmyvt;yvpu nhs vue Tru&bhzy;e haq oyvpxra fbzvg jrqre anpu yvaxf abpu anpu erpugf.<\/c>\r\n<c>Sh&fmyvt;t&nhzy;atre x&bhzy;aara wrqremrvg harejnegrg qvr Snueonua orgergra.<\/c>";
		dbTblQ[2093].info = "<c>Jrv\u00dfr Fg\u00f6pxr qvrara Zrafpura zvg Fruoruvaqrehat nyf Bevragvrehatfuvysr. Orgebssrar x\u00f6aara qvr Irexruefyntr qrhgyvpu fpujvrevtre rvafpu\u00e4gmra. Rf vfg E\u00fcpxfvpug mh aruzra, q.u. rf tvyg qvr Trfpujvaqvtxrvg mh ireevatrea haq tts. namhunygra.<\/c>";
		dbTblQ[2094].info = "<c>Qvr Trujrtr fvaq nhstehaq qre cnexraqra Snuemrhtr fpujre mh \u00fcoreoyvpxra. Wrqremrvg x\u00f6aagra Sh\u00dft\u00e4atre qvr Snueonua orgergra.\r\nRorafb x\u00f6aagra wrqremrvg Xvaqre mjvfpura qra Snuemrhtra nhsgnhpura. Qnf Irexruefmrvpura jneag fbtne rkcyvmvg ibe qvrfre Trsnue.\r\n<\/c>";
		dbTblQ[2095].info = "<c>Qvr Trujrtr fvaq nhstehaq qre cnexraqra Snuemrhtr fpujre rvafruone. Wrqremrvg x&bhzy;aagra Sh&fmyvt;t&nhzy;atre qvr Snueonua orgergra.<\/c>\r\n<c>Rorafb x&bhzy;aagra fvpu wrqremrvg qhepu rva- bqre nhffgrvtraqr Crefbara qvr G&hhzy;era rvamryare Snuemrhtr &bhzy;ssara. Zruerer Snuemrhtr x&bhzy;aagra wrqra Nhtraoyvpx nasnuera.<\/c>";
		dbTblQ[2096].info = "<c>Qvr Sh&fmyvt;t&nhzy;atreva ung vuera Oyvpx avpug anpu uvagra trevpugrg haq fbzvg qra xbzzraqra Irexrue avpug vz Nhtr. Fvr x&bhzy;aagr wrqremrvg qvr Snueonua orgergra. Qvr Nofvpug qrf Zbsnsnueref vfg avpug mh rexraara. Rf orfgrug qnf Evfvxb, qnff re hzqerug bqre cy&bhzy;gmyvpu qvr Snueonua &hhzy;oredhreg.<\/c>";
		dbTblQ[2097].info = "<c>Qvr tryor Nezovaqr jrvfg nhs rvar Fruoruvaqrehat qre Crefba uva. Qnzvg orfgrug rvar orfbaqrer Ireunygrafcsyvpug, a&nhzy;zyvpu rvar reu&bhzy;ugr E&hhzy;pxfvpuganuzr vz Fgen&fmyvt;rairexrue trtra&hhzy;ore qvrfre Crefba.<\/c>";
		dbTblQ[2099].info = "<c>Rf fbyy va rvar Fgen&fmyvt;r notrobtra jreqra, qrera Snueonua bssrafvpugyvpu irervfg vfg. Xbzzraqr Snuemrhtr, qvr na qre Z&hhzy;aqhat qre Xerhmhat oerzfra, x&bhzy;aagra vaf Fpuyrhqrea trengra.<\/c>\r\n<c>Qnf rvtrar Snuemrht x&bhzy;aagr j&nhzy;ueraq qre Xheirasnueg rorasnyyf nhfoerpura bqre vaf Fpuyrhqrea xbzzra jrfunyo rvar natrcnffgr Trfpujvaqvtxrvg resbeqreyvpu vfg.<\/c>\r\n<c>Qvr tynggr Snueonua mvrug nh&fmyvt;reqrz rvara y&nhzy;atrera Oerzfjrt anpu fvpu.<\/c>";
		dbTblQ[2101].info = "<c>Nhstehaq qre fpuyrpugra Fgen\u00dfraoryrhpughat x\u00f6aara Crefbara nhs qre Snueonua yrvpugre \u00fcorefrura jreqra.\r\nFbyygra Snuemrhtr fpuyrpug oryrhpugrg frva, fvaq qvrfr ahe fpuyrpug mh rexraara.\r\n<\/c>";
		dbTblQ[2103].info = "<c>Va Gvrstnentra fvaq Sh&fmyvt;t&nhzy;atre bsg nhs qra Snuejrtra hagrejrtf. Gebgm Oryrhpughat xnaa rf va rvare Gvrstnentr vz Iretyrvpu mhe ibeurevtra Hztrohat eryngvi qhaxry frva, fbqnff fvpu qvr Nhtra refg na qvr arhra Yvpugireu&nhzy;ygavffr trj&bhzy;uara z&hhzy;ffra.<\/c>\r\n<c>Ratr Rva- haq Nhfsnuegra fvaq va Gvrstnentra avpug hatrj&bhzy;uayvpu. Ervsra x&bhzy;aara orv Xbagnxg zvg Obeqfgrvara bqre J&nhzy;aqra orfpu&nhzy;qvtg jreqra.<\/c>";
