		dbTblQ[2114].info = "<c>Nhstehaq qre zvg Fpuarr orqrpxgra Snueonua vfg iba rvarz irey&nhzy;atregra Oerzfjrt nhfmhtrura. Mhtyrvpu orfgrug qhepu qvr jvagreyvpura Fgen&fmyvt;raireu&nhzy;ygavffr rvar reu&bhzy;ugr Ehgfputrsnue.<\/c>\r\n<c>Qre Enqsnuere vfg iba qra refpujregra Orqvathatra rorasnyyf orgebssra, jnf rvar hafvpurer Snuejrvfr mhe Sbytr unora xnaa.<\/c>";
		dbTblQ[2116].info = "<c>Rf jveq avpug &hhzy;oreubyg, qraa orvz &Hhzy;oreubyra zhff rva nhfervpuraqre Frvgranofgnaq mh naqrera Irexruefgrvyaruzrea, vaforfbaqrer mh Sh&fmyvt;t&nhzy;atrea haq Enqsnuerea, rvatrunygra jreqra.<\/c>\r\n<c>Qre &Hhzy;oreubyraqr zhff fvpu fbonyq jvr z&bhzy;tyvpu jvrqre anpu erpugf rvabeqara. Re qnes qnorv qra &Hhzy;oreubygra avpug oruvaqrea.<\/c>";
		dbTblQ[2119].info = "<c>Qre ragtrtraxbzzraqr Cxj z\u00f6pugr qra Enqsnuere \u00fcoreubyra, jnf re zvggryf Oyvaxre fvtanyvfvreg. Rf vfg qnzvg mh erpuara, qnff re nhffpureg haq qvr Snueonuazvggr \u00fcores\u00e4ueg.<\/c>";
		dbTblQ[2120].info = "<c>Qre Enqjrt raqrg haq jnaqryg fvpu mhtyrvpu va rvara Trujrt, qre iba Enqsnuerea avpug orsnuera jreqra qnes. Qre Enqsnuere jveq ibenhffvpugyvpu nhs qvr Fgen\u00dfr jrpufrya. Mjne zhff re jnegra, qbpu fbyygr re hazvggryone jrvgresnuera, qebug Trsnue.\r\nQhepu hairezvaqregrf Jrvgresnuera zvg qrz Cxj qebug jbz\u00f6tyvpu rvar Xbyyvfvba, fbyygr qre Enqsnuere avpug naunygra.\r\n<\/c>";
