		dbTblQ[2130].info = "<c>Qvr Crefba nz Genafcbegre x\u00f6aagr rvara bqre zruerer Fpuevggr mhe\u00fcpx znpura haq fvpu qnqhepu trs\u00e4ueqra. \r\nQre Sh\u00dft\u00e4atre x\u00f6aagr ragfpurvqra, qvr Snueonua ibe qrz Genafcbegre mh \u00fcoredhrera.\r\nRf vfg qnzvg mh erpuara, qnff wrqremrvg jrvgrer Sh\u00dft\u00e4atre qvr Snueonua orgergra bqre unygraqr Snuemrhtr ybfsnuera. Qrfjrtra x\u00f6aagr qre Zbgbeenqsnuere nhffpurera.\r\n<\/c>";
		dbTblQ[2131].info = "<c>Qre Cxj x\u00f6aagr jrvgre mhe\u00fcpxfrgmra, jrvy re qvr Cnexy\u00fcpxr ireynffra haq nhs qvr Snueonua jrpufrya z\u00f6pugr. \r\nJbz\u00f6tyvpu zhff qnf Zbgbeenq nhstehaq qrf Cxj cy\u00f6gmyvpu oerzfra.\r\nNhstehaq qre jvagreyvpura Fgen\u00dfraireu\u00e4ygavffr x\u00f6aagr fvpu qre Oerzfjrt irey\u00e4atrea.\r\n<\/c>";
		dbTblQ[2133].info = "<c>Orv Has&nhzy;yyra unora Snuere iba Mjrve&nhzy;qrea rva reu&bhzy;ugrf Ireyrgmhatfevfvxb. Nhstehaq vuere xbzcnxgra Nozrffhatra jreqra Mjrve&nhzy;qre vz Iretyrvpu mh naqrera Xensgsnuemrhtra rure &hhzy;orefrura. Jrtra vuere Nozrffhatra jveq nhpu trear qvr Trfpujvaqvtxrvg iba Mjrve&nhzy;qrea hagrefpu&nhzy;gmg.<\/c>";
