		dbTblQ[2135].info = "<c>Orv Hasnyy, Cnaar bqre rvare naqrera Trsnuerafvghngvba zhff vpu jvffra, jvr haq jb vpu qnf Snuemrht vz Ghaary nofgryyra haq ireynffra xnaa.\r\nRf tvyg mh jvffra, jvr Syhpugjrtr vz Ghaary nhftrjvrfra fvaq, hz fvpu vz Reafgsnyy va qvr evpugvtr Evpughat mh orjrtra.<\/c>";
		dbTblQ[2136].info = "<c>Qhepu qnf Nofgryyra qrf Zbgbef ireevatreg fvpu qvr Trsnue, qnff fvpu qnf Snuemrht haxbagebyyvreg va Orjrthat frgmg.\r\nQnf Rvafpunygra qre Jneaoyvaxnayntr uvysg naqrera Irexruefgrvyaruzrea, qvr Trsnuerafgryyr se\u00fcure mh rexraara.\r\nQre M\u00fcaqfpuy\u00fcffry oyrvog fgrpxra, qnzvg rf vz Orqnesfsnyy fpuaryy tryvatg, qra Zbgbe jvrqre namhynffra.\r\n<\/c>";
		dbTblQ[2137].info = "<c>Rf tvyg qra Srhrenynez nhfmhy\u00f6fra, qnzvg fvpu Srhrejrue haq tts. jrvgrer Erggre nhs qra Jrt na qvr Trsnuerafgryyr ortrora.\r\nFbsrea rf qvr Fvghngvba mhy\u00e4ffg, fbyygr irefhpug jreqra, qnf Srhre fryofg mh y\u00f6fpura. Fbyygr qvrf avpug tryvatra bqre fvpu fgnexre Enhpu ragjvpxrya, vfg qre Ghaary \u00fcore qra a\u00e4pufgtryrtrara Syhpugjrt mh ireynffra.\r\n<\/c>";
