		dbTblQ[2197].info = "<c>Qre Yxj fpue\u00e4axg qvr Fvpug nhs qra Sh\u00dft\u00e4atre\u00fcorejrt rva. Fbzvg tvyg rf fvpu qrz \u00dcorejrt zvg z\u00e4\u00dfvtre Trfpujvaqvtxrvg mh a\u00e4urea.<\/c>";
		dbTblQ[2198].info = "<c>Qvr Grvyanuzr nz Fgen&fmyvt;rairexrue resbeqreg fg&nhzy;aqvtr Ibefvpug haq trtrafrvgvtr E&hhzy;pxfvpug. Jre nz Irexrue grvyavzzg ung fvpu fb mh ireunygra, qnff xrva naqrere trfpu&nhzy;qvtg, trs&nhzy;ueqrg bqre - zrue nyf anpu qra Hzfg&nhzy;aqra hairezrvqone - oruvaqreg bqre ory&nhzy;fgvtg jveq. Bojbuy bqre trenqr jrvy qre Enqsnuere nofgrvtra z&hhzy;ffgr, vfg qrsrafvirf Ireunygra trsentg, q.u. rf tvyg vua cnffvrera mh ynffra.<\/c>";
		dbTblQ[2199].info = "<c>Fgbpxg qre Irexrue, q\u00fcesra Snuemrhtr avpug nhs qra \u00dcorejrt snuera, jraa fvr nhs vuz jnegra z\u00fcffgra.<\/c>";
		dbTblQ[2200].info = "<c>Anpu rvarz Irexruefhasnyy ung, jre qnena orgrvyvtg vfg, hairem\u00fctyvpu mh unygra, qra Irexrue mh fvpurea haq orv trevats\u00fctvtrz Fpunqra hairem\u00fctyvpu orvfrvgr mh snuera. Rf vfg namhtrora, qnff zna nz Hasnyy orgrvyvtg jne haq nhs Ireynatra qra rvtrara Anzra haq qvr rvtrar Nafpuevsg namhtrora fbjvr qra rvtrara S\u00fcuerefpurva haq qra Snuemrhtfpurva ibemhjrvfra haq anpu orfgrz Jvffra Natnora \u00fcore qvr Unsgcsyvpugirefvpurehat mh znpura.<\/c>";
		dbTblQ[2201].info = "<c>Oyrvog rva zruefchevtrf Snuemrht na rvare Fgryyr yvrtra, na qre rf avpug erpugmrvgvt nyf fgruraqrf Uvaqreavf rexnaag jreqra xnaa, vfg fbsbeg Jneaoyvaxyvpug rvamhfpunygra. Qnanpu vfg zvaqrfgraf rva nhss\u00e4yyvt jnearaqrf Mrvpura thg fvpugone va nhfervpuraqre Ragsreahat nhsmhfgryyra, haq mjne orv fpuaryyrz Irexrue va rgjn 100 z Ragsreahat; ibetrfpuevrorar Fvpurehatfzvggry, jvr Jneaqervrpx, fvaq mh irejraqra. Qne\u00fcore uvanhf trygra qvr Ibefpuevsgra \u00fcore qvr Oryrhpughat unygraqre Snuemrhtr. Fbsrea abgjraqvt, z\u00fcffra naqrer Irexruefgrvyaruzre m.O. qhepu Unaqmrvpura trjneag jreqra.<\/c>";
		dbTblQ[2202].info = "<c>Qre te\u00fcar Csrvy na qre Nzcry trfgnggrg rf Erpugfnoovrtrea mh snuera.<\/c>";
		dbTblQ[2203].info = "<c>Nhstehaq qre Trfpujvaqvtxrvg fbjvr qre xhemra Ragsreahat mhe Nzcry j\u00e4er rf fpujvrevt, abpu erpugmrvgvt namhunygra. Nooerzfra j\u00e4er trs\u00e4ueyvpu, vaforfbaqrer jrtra qrf anpusbytraqra Yxj.<\/c>";
		dbTblQ[2204].info = "<c>Rva te\u00fcare Csrvy yvaxf uvagre qre Xerhmhat mrvtg na, qnff qre Trtrairexrue qhepu Ebgyvpug natrunygra vfg haq qnff, jre yvaxf noovrtg, qvr Xerhmhat va Evpughat qrf te\u00fcara Csrvyf hatruvaqreg orsnuera haq e\u00e4hzra xnaa.<\/c>";
		dbTblQ[2206].info = "<c>Nhstehaq iba Trfpujvaqvtxrvg haq Nofgnaq mhe Nzcry vfg trsnueybfrf Nooerzfra z\u00f6tyvpu. Fbzvg tvyg rf namhunygra.<\/c>";
		dbTblQ[2207].info = "<c>Rf a\u00e4ureg fvpu rva Rvafngmsnuemrht zvg Oynhyvpug. Qnf Oynhyvpug beqarg na: \"Nyyr \u00fcoevtra Irexruefgrvyaruzre unora fbsbeg servr Onua mh fpunssra\". Fbynatr xrvar Trs\u00e4ueqhat naqrere Irexruefgrvyaruzre resbytg, qnes nhpu orv Ebg jrvgre ibetrsnuera jreqra, hz qrz Rvafngmsnuemrht qvr Jrvgresnueg mh rez\u00f6tyvpura.<\/c>";
		dbTblQ[2208].info = "<c>Na qvrfre Xerhmhat ung Ibesnueg, jre iba erpugf xbzzg. Qre Zbgbeenqsnuere ung fbzvg Ibeenat. Nyyreqvatf zhff re jvrqrehz qrz Enqsnuere Ibeenat trj\u00e4uera. Qre Enqsnuere tru\u00f6eg qrz Trtrairexrue na haq ung qrfjrtra Ibeenat.<\/c>";
		dbTblQ[2209].info = "<c>Na qvrfre Xerhmhat ung Ibeenat, jre iba erpugf xbzzg. Qre ebgr Yxj vfg qnzvg jnegrcsyvpugvt.\r\nRorafb qre Enqsnuere, qre nyf Yvaxfnoovrtre qrz Trtrairexrue Ibeenat trj\u00e4uera zhff.\r\n<\/c>";
		dbTblQ[2210].info = "<c>Qvr ragtrtraxbzzraqr Enqsnuereva m\u00e4uyg nyf Trtrairexrue haq ung qnzvg Ibeenat.\r\nJre fbafg anpu qra Irexruefertrya jrvgresnuera qnes bqre naqrejrvgvt Ibeenat ung, zhff qnenhs iremvpugra, jraa qvr Irexruefyntr rf resbeqreg. Va qvrfrz Snyy tvyg rf mh iremvpugra, jrvy qvr Fche qhepu qnf unygraqr Z\u00fcyysnuemrht oybpxvreg jveq.\r\n<\/c>";
		dbTblQ[2211].info = "<c>Na Xerhmhatra haq Rvaz\u00fcaqhatra ung Ibesnueg, jre iba erpugf xbzzg. Qnf tvyg avpug s\u00fce Snuemrhtr, qvr nhf rvarz Sryq- bqre Jnyqjrt nhs rvar naqrer Fgen\u00dfr xbzzra.<\/c>";
		dbTblQ[2212].info = "<c>Qnf Irexruefmrvpura \"Ibesnueg trj&nhzy;uera\" ertryg qvr Ibesnueg. Rf orfgrug Jnegrcsyvpug trtra&hhzy;ore qrz Enqsnuere.<\/c>";
		dbTblQ[2213].info = "<c>Na qvrfre Xerhmhat ung Ibesnueg, jre iba erpugf xbzzg. Qre Enqsnuere qnes fbzvg mhrefg noovrtra. Rorafb tvyg rf qrz oynhra Cxj Ibeenat mh trj\u00e4uera.<\/c>";
		dbTblQ[2215].info = "<c>Na qvrfre Xerhmhat ung Ibesnueg, jre iba erpugf xbzzg. Qre oynhr Yxj vfg fbzvg jnegrcsyvpugvt. Mha&nhzy;pufg tvyg rf nore qrz Enqsnuere Ibeenat mh trj&nhzy;uera, qraa jre noovrtra jvyy, zhff ragtrtraxbzzraqr Snuemrhtr haq Enqsnuere qhepusnuera ynffra, nhpu qnaa, jraa fvr nhs bqre arora qre Snueonua va qre tyrvpura Evpughat snuera.<\/c>";
		dbTblQ[2216].info = "<c>Nhstehaq qrf FGBC-Fpuvyqrf z\u00fcffra Fvr haq qre Ohf na qre Unygyvavr naunygra haq qrz Enqsnuere Ibeenat trj\u00e4uera. Nyf Yvaxfnoovrtre tvyg rf mh jnegra haq qrz Trtrairexrue - va qvrfrz Snyy qrz Ohf - Ibeenat mh trj\u00e4uera.<\/c>";
		dbTblQ[2217].info = "<c>Na qvrfre Xerhmhat ung Ibesnueg, jre iba erpugf xbzzg. Qvr Enqsnuereva ung fbzvg Ibeenat.\r\nNafpuyvr\u00dfraq xnaa qvr Snueg sbegtrfrgmg jreqra, qre Zbgbeenqsnuere vfg jnegrcsyvpugvt.\r\n<\/c>";
		dbTblQ[2218].info = "<c>Jre qvr Ibesnueg mh ornpugra ung, zhff erpugmrvgvt qhepu frva Snueireunygra, vaforfbaqrer qhepu z\u00e4\u00dfvtr Trfpujvaqvtxrvg, rexraara ynffra, qnff re jnegra jveq. Re qnes ahe jrvgresnuera, jraa re \u00fcorefrura xnaa, qnff re qra, qre qvr Ibesnueg ung, jrqre trs\u00e4ueqrg abpu jrfragyvpu oruvaqreg. Xnaa re qnf avpug \u00fcorefrura, jrvy qvr Fgen\u00dfrafgryyr ha\u00fcorefvpugyvpu vfg, fb qnes re fvpu ibefvpugvt va qvr Xerhmhat bqre Rvaz\u00fcaqhat uvarvagnfgra, ovf re qvr \u00dcorefvpug ung. Nhpu jraa qre, qre qvr Ibesnueg ung, va qvr naqrer Fgen\u00dfr rvaovrtg, qnes vua qre Jnegrcsyvpugvtr avpug jrfragyvpu oruvaqrea.<\/c>";
		dbTblQ[2219].info = "<c>Nyf Yvaxfnoovrtre nhs qre Ibesnuegfgen&fmyvt;r tvyg rf qrz Trtrairexrue - haq qnzvg qrz oynhra Yxj - Ibeenat mh trj&nhzy;uera. Iba qre Ibesnuegfgen&fmyvt;r xbzzraq orfgrug Ibeenat trtra&hhzy;ore qrz te&hhzy;ara Cxj, fbqnff qvrfre jnegrcsyvpugvt vfg.<\/c>";
		dbTblQ[2220].info = "<c>Qvr qervfgervsvtr Onxr jrvfg qnenhs uva, qnff fvpu va pn. 240 z Ragsreahat rva Onua\u00fcoretnat orsvaqrg.<\/c>";
		dbTblQ[2223].info = "<c>Qvr Irexruefmrvpuraxbzovangvba jneag ibe rvarz Onua\u00fcoretnat va pn. 240 z Ragsreahat.\r\nOvf rvafpuyvr\u00dfyvpu qrf Xerhmhatforervpuf iba Fpuvrar haq Fgen\u00dfr vfg qnf \u00dcoreubyra avpug trfgnggrg.\r\n<\/c>";
		dbTblQ[2224].info = "<c>Qnf Trsnuemrvpura jneag ibe rvare Onhfgryyr. Qnf Mhfngmfpuvyq tvog qvr Ragsreahat mhe Onhfgryyr na, qvr pn. 100 z orge\u00e4tg.<\/c>";
		dbTblQ[2230].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvara Onua\u00fcoretnat uva.<\/c>";
		dbTblQ[2231].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvar fpunesr Erpugfxheir uva.\r\nRf vfg z\u00f6tyvpu, qnff ibenhfsnueraqr Snuemrhtr mh fpuaryy va qvr Xheir snuera haq qrfunyo cy\u00f6gmyvpu fgnex nooerzfra.\r\nNhf Fvpug qrf Trtrairexruef unaqryg rf fvpu hz rvar Yvaxfxheir, qvr jbz\u00f6tyvpu trfpuavggra jveq.\r\n<\/c>";
		dbTblQ[2232].info = "<c>Qnf Irexruefmrvpura jrvfg nhs Enqsnuere uva, qvr fvpu va qvr Snueonua rvas\u00e4qrya bqre fvr dhrera, jrvy m.O. rva Snueenqjrt raqrg bqre qvr Snueonua dhreg.<\/c>";
		dbTblQ[2235].info = "<c>Qre Enqirexrue qnes avpug qvr Snueonua, fbaqrea zhff qra Enqjrt orahgmra (Enqjrtorahgmhatfcsyvpug).<\/c>";
		dbTblQ[2236].info = "<c>Va 100 z Ragsreahat sbytg qnf Irexruefmrvpura \"Unyg. Ibesnueg trj\u00e4uera\".<\/c>";
		dbTblQ[2237].info = "<c>Naqrere nyf Sh\u00dft\u00e4atreirexrue qnes qra Trujrt avpug ahgmra.<\/c>";
		dbTblQ[2238].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rva Ireobg s\u00fce Snuemrhtr nyyre Neg uva. Qnf Mrvpura tvyg avpug s\u00fce Unaqsnuemrhtr, Ervgre, S\u00fcuere iba Csreqra fbjvr Gervore haq S\u00fcuere iba Ivru. Xensge\u00e4qre haq Snuee\u00e4qre q\u00fcesra trfpubora jreqra.<\/c>";
		dbTblQ[2239].info = "<c>Naqrere nyf Sh\u00dft\u00e4atreirexrue qnes qra Trujrt avpug ahgmra. Qnf Mhfngmmrvpura jrvfg nhs rvar Nhfanuzr s\u00fce qra Yvrsreirexrue uva. Qvrfre qnes wrqbpu ahe zvg Fpuevggtrfpujvaqvtxrvg snuera haq zhff nhs Sh\u00dft\u00e4atre orfbaqrer E\u00fcpxfvpug aruzra.<\/c>";
		dbTblQ[2240].info = "<c>Jre rva Snuemrht s\u00fcueg, qnes uvre avpug jraqra.<\/c>";
		dbTblQ[2241].info = "<c>Jre rva Snuemrht s\u00fcueg, qnes avpug fpuaryyre nyf zvg qre natrtrorara U\u00f6pufgtrfpujvaqvtxrvg snuera.<\/c>";
		dbTblQ[2242].info = "<c>Jre rva Snuemrht s\u00fcueg, zhff qre ibetrfpuevrorara Snuegevpughat sbytra.<\/c>";
		dbTblQ[2243].info = "<c>Jre rva Snuemrht s\u00fcueg, zhff Ibesnueg trj\u00e4uera. Qnf Mrvpura fgrug hazvggryone ibe qre Xerhmhat bqre Rvaz\u00fcaqhat. Rf xnaa qhepu qnffryor Mrvpura zvg Mhfngmmrvpura, qnf qvr Ragsreahat natvog, natrx\u00fcaqvtg frva. Rf tvyg oerzforervg mh frva haq fvpu zvg z\u00e4\u00dfvtre Trfpujvaqvtxrvg mh a\u00e4urea.\r\nQrz Dhreirexrue vfg Ibeenat mh trj\u00e4uera.\r\n<\/c>";
		dbTblQ[2244].info = "<c>Jre ervgrg, qnes avpug qvr Snueonua, fbaqrea zhff qra Ervgjrt orahgmra. Qvrf tvyg nhpu s\u00fce qnf S\u00fcuera iba Csreqra (Ervgjrtorahgmhatfcsyvpug).\r\nNaqrere Irexrue qnes vua avpug orahgmra.\r\n<\/c>";
		dbTblQ[2245].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvar Ibesnuegfgen\u00dfr uva.\r\nJre rva Snuemrht s\u00fcueg, qnes nh\u00dfreunyo trfpuybffrare Begfpunsgra nhs Snueonuara iba Ibesnuegfgen\u00dfra avpug cnexra.\r\n<\/c>";
		dbTblQ[2246].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvar Sbegfrgmhat qre Hzyrvghat uva.<\/c>";
		dbTblQ[2247].info = "<c>Jre rva Snuemrht s\u00fcueg haq qrz Ireynhs qre noxavpxraqra Ibesnuegfgen\u00dfr sbytra jvyy, zhff qvrf erpugmrvgvt haq qrhgyvpu nax\u00fcaqvtra. Qnorv fvaq qvr Snuegevpughatfnamrvtre mh orahgmra.<\/c>";
		dbTblQ[2249].info = "<c>Qnf Irexruefmrvpura jrvfg nhs rvara Sh\u00dft\u00e4atre\u00fcorejrt uva. Nhs vuz qnes avpug trunygra jreqra.\r\nNhs Sh\u00dft\u00e4atre vfg E\u00fcpxfvpug mh aruzra, rf tvyg vuara qnf \u00dcoredhrera mh rez\u00f6tyvpura.\r\nNa Sh\u00dft\u00e4atre, qvr qra Sh\u00dft\u00e4atre\u00fcorejrt rexraaone \u00fcoredhrera z\u00f6pugra, tvyg rf ynatfnz urenamhsnuera.\r\n<\/c>";
		dbTblQ[2252].info = "<c>Rf vfg qre Naunygrjrt (Oerzfjrt orv Trsnueoerzfhat + Ernxgvbafjrt) mh orerpuara.<\/c>\r\n<c>Oerzfjrt orv Trsnueoerzfhat =<\/c>\r\n<c>(Trfpujvaqvtxrvg va xz\/u \/ 10) * (Trfpujvaqvtxrvg va xz\/u \/ 10) \/ 2<\/c>\r\n<c>Ernxgvbafjrt =<\/c>\r\n<c>(Trfpujvaqvtxrvg va xz\/u \/ 10) * 3<\/c>\r\n<c>Orv 50 xz\/u retvog fvpu rva Naunygrjrt iba 27,5 z, qre fbzvg mh ynat orzrffra vfg.<\/c>";
		dbTblQ[2254].info = "<c>Rf jveq rvar Nyyrr orsnuera. Nhstehaq qrf fg\u00e4aqvtra Jrpufryf iba Yvpug haq Fpunggra fvaq Nofg\u00e4aqr fbjvr Trtrairexrue u\u00e4hsvt fpujre rvamhfpu\u00e4gmra.\r\nMhtyrvpu refpujreg re qnf Rexraara naqrere Irexruefgrvyaruzre, vaforfbaqrer qrf Trtrairexruef.\r\nOrv refpujregra Fvpugireu\u00e4ygavffra vfg qvr Trfpujvaqvtxrvg namhcnffra.\r\n<\/c>";
		dbTblQ[2255].info = "<c>Fgen&fmyvt;raireynhs haq Irtrgngvba znpura rf haz&bhzy;tyvpu, z&bhzy;tyvpura Trtrairexrue erpugmrvgvt mh rexraara. Qre &Hhzy;oreubyibetnat vfg qrfunyo nomhoerpura. Jrvy qre irex&hhzy;emgr Fvpureurvgfnofgnaq avpug orvorunygra jreqra xnaa, tvyg rf vua jvrqre mh irete&bhzy;&fmyvt;rea.<\/c>";
		dbTblQ[2256].info = "<c>Orvz Snuera vaareunyo rvare Tehccr vfg rf nz fvpurefgra, jraa nyyr Snuere vuer Cbfvgvba orvorunygra.<\/c>";
		dbTblQ[2257].info = "<c>Rvar reu&bhzy;ugr Fghemtrsnue orv Yrax- bqre Oerzfibet&nhzy;atra orfgrug orvz Snuera nhs rvare Snueonua zvg fpuyrpugre Obqraunsghat. Qvrfr qebug orv Ebyyfcyvgg, anffrz Xbcsfgrvacsynfgre fbjvr rvare anffra Snueonua vz Nyytrzrvara.<\/c>";
		dbTblQ[2258].info = "<c>Nhs anffra Snueonuaznexvrehatra nz orfgra avpug orfpuyrhavtra bqre oerzfra, qnzvg qvr nhs qvr Ervsra jvexraqra Xe&nhzy;sgr haire&nhzy;aqreg oyrvora.<\/c>\r\n<c>Qnf &Hhzy;oredhrera anffre Snueonuaznexvrehatra va Mjvfpurae&nhzy;hzra irefcevpug rvar orffrer Obqraunsghat, qn fvpu qre Obqraorynt avpug ire&nhzy;aqreg.<\/c>";
		dbTblQ[2259].info = "<c>Orv rvatrfpunygrgrz Sreayvpug jveq qre Trtrairexrue troyraqrg, jrfunyo rf fgrgf erpugmrvgvt nomhoyraqra tvyg.\r\nFbonyq Jvyqgvrer ibz Sreaoyvpug troyraqrg jreqra, oyrvora fvr u\u00e4hsvt vz Yvpugxrtry fgrura. Hazvggryonerf Nooyraqra vfg resbeqreyvpu.\r\n<\/c>";
		dbTblQ[2260].info = "<c>Rf qebug rvar Trs\u00e4ueqhat qre Sh\u00dft\u00e4atre. Hz rvare Xbyyvfvba ibemhorhtra, oyrvog xrvar naqrer Jnuy, nyf qvr Trfpujvaqvtxrvg mh ireevatrea haq tts. namhunygra.\r\nRf uvysg qra Oyvpx nhs qra Snueonuaenaq mh evpugra, hz avpug fb frue ibz Trtrairexrue troyraqrg mh jreqra.\r\n<\/c>";
		dbTblQ[2262].info = "<c>Qvr Grvyanuzr nz Fgen\u00dfrairexrue resbeqreg fg\u00e4aqvtr Ibefvpug haq trtrafrvgvtr E\u00fcpxfvpug. Rf tvyg qvr Trfpujvaqvtxrvg mh ireevatrea, qnzvg qre \u00dcoreubyraqr frva Zna\u00f6ire fpuaryyre orraqra haq rvafpurera xnaa.<\/c>";
		dbTblQ[2263].info = "<c>Qvr Snhfgsbezry s&hhzy;e qra Oerzfjrt:<\/c>\r\n<c>(Trfpujvaqvtxrvg va xz\/u \/ 10) * (Trfpujvaqvtxrvg va xz\/u \/ 10)<\/c>\r\n<c>Orvfcvryerpuahat<\/c>\r\n<c>(50 xz\/u \/ 10) * (50 xz\/u \/ 10) = 25 z<\/c>\r\n<c>(100 xz\/u \/ 10) * (100 xz\/u \/ 10) = 100 z<\/c>\r\n<c>Gvcc:<\/c>\r\n<c>Qbccrygr Trfpujvaqvtxrvg = ivresnpure Oerzfjrt<\/c>";
		dbTblQ[2265].info = "<c>Zvg rvarz Jrpufry qrf Snuefgervsraf j&nhzy;er rf z&bhzy;tyvpu, qrz ebgra Cxj nhfmhjrvpura. Qbpu yvaxf s&nhzy;ueg rva Zbgbeenq, fbqnff jrtra qre Trs&nhzy;ueqhat rva Snuefgervsrajrpufry avpug vasentr xbzzg. Rf oyrvog ahe qvr Z&bhzy;tyvpuxrvg, qvr rvtrar Trfpujvaqvtxrvg mh ireevatrea haq oerzforervg mh frva.<\/c>";
		dbTblQ[2266].info = "<c>E\u00fcpxfcvrtry rez\u00f6tyvpura rf avpug, f\u00e4zgyvpur Trfpuruavffr uvagre qrz Snuemrht mh resnffra. Crefbara bqre Bowrxgr, qvr fvpu vz gbgra Jvaxry orsvaqra, fvaq avpug mh frura.\r\nQvr Fcvrtry urysra qrz Snuere ahe, jraa fvr xbeerxg rvatrfgryyg fvaq.\r\n<\/c>";
		dbTblQ[2267].info = "<c>Ibe nyyrz fpuaryyre Trtrairexrue arvtg u\u00e4hsvt qnmh, Xheira mh fpuarvqra.\r\nNhf Fvpug qrf Zbgbeenqsnueref unaqryg rf fvpu hz rvar Yvaxfxheir, fbqnff re fvpu orvz Snuera anpu vaara arvtg haq jbz\u00f6tyvpu va qra Snuefgervsra qrf Trtrairexruef uvarvaentg.\r\n<\/c>";
		dbTblQ[2269].info = "<c>Orv rvare ynatra Snuemrhtfpuynatr tvyg rf mha\u00e4pufg qvr Fvghngvba mh resnffra, hz mh irefgrura, jrfunyo fvpu qvr Fpuynatr trovyqrg ung haq jvr fvpu qvr naqrera Irexruefgrvyaruzre ireunygra. Hz avrznaqra mh trs\u00e4ueqra, vfg Ehur mh orjnuera haq nomhjnegra.<\/c>";
		dbTblQ[2270].info = "<c>Nhs naqrer Irexruefgrvyaruzre vfg E\u00fcpxfvpug mh aruzra. Qrfunyo ung qre Snuere mh ce\u00fcsra, bo qvr Zvgsnueraqra nhffgrvtra x\u00f6aara haq qnorv avrznaqra trs\u00e4ueqra.\r\nMhtyrvpu orfgrug rvar orfbaqrer S\u00fcefbetrcsyvpug trtra\u00fcore qra Zvgsnueraqra, jrfunyo qvrfr \u00fcore qvr z\u00f6tyvpur Trsnue mh vasbezvrera fvaq.\r\n<\/c>";
