		dbTblQ[2984].info = "<c>Qnf Zbgbeenq, uvagre qrz ragtrtraxbzzraqrz Snuemrht, ung Ibesnueg haq Fvr z&hhzy;ffra jnegra.<fcna pynff='peys'><\/fcna><fcna pynff='peys'><\/fcna>Qn Fvr ibe qrz ragtrtraxbzzraqra Snuemrht noovrtra z&hhzy;ffra Fvr avpug jrtra qvrfrz Snuemrht jnegra.<fcna pynff='peys'><\/fcna><fcna pynff='peys'><\/fcna>\"Rvanaqre ragtrtraxbzzraqr Snuemrhtr, qvr wrjrvyf anpu yvaxf noovrtra jbyyra, z&hhzy;ffra ibervanaqre noovrtra, ....\" (&frpg; 9 Nof. 4 Fngm 2 FgIB)<fcna pynff='peys'><\/fcna><fcna pynff='peys'><\/fcna>Qn Fvr fvpu nhs rvare Ibesnuegffgen&fmyvt;r orsvaqra, unora Fvr Ibesnueg ibe qrz iba erpugf xbzzraqrz Irexrue.<\/c>";
		dbTblQ[2985].info = "<c>S&hhzy;e qra YXJ vfg qvr Fvpug mhe Frvgr haq anpu uvagra bsg fgnex rvatrfpue&nhzy;axg haq qre gbgr Jvaxry teb&fmyvt;.<\/c>\r\n<c>Qn qre YXJ erpugf noovrtra z&bhzy;pugr, vfg qvr Trsnue s&hhzy;e Fvr &hhzy;orefrura mh jreqra erpug teb&fmyvt;.<\/c>\r\n<c>Hz rvara Mhfnzzrafgb&fmyvt; mh irezrvqra, unygra Fvr erpugf uvagre qrz YXJ.<\/c>";
		dbTblQ[2986].info = "<c>Va orfgvzzgra Fvghngvbara vfg qnf Jneaoyvaxyvpug rvamhfpunygra. Oyrvog rva zruefchevtrf Snuemrht na rvare Fgryyr yvrtra, na qre rf avpug erpugmrvgvt nyf fgruraqrf Uvaqreavf rexnaag jreqra xnaa, vfg fbsbeg Jneaoyvaxyvpug rvamhfpunygra. J&nhzy;ueraq qrf Nofpuyrccraf unora orvqr Snuemrhtr Jneaoyvaxyvpug rvamhfpunygra. Jre rvara Bzavohf qrf Yvavrairexruef bqre rvara trxraamrvpuargra Fpuhyohf s&hhzy;ueg, zhff Jneaoyvaxyvpug rvafpunygra, jraa re fvpu rvare Unygrfgryyr a&nhzy;ureg haq fbynatr Snuet&nhzy;fgr rva- bqre nhffgrvtra, fbjrvg qvr s&hhzy;e qra Fgen&fmyvt;rairexrue anpu Ynaqrferpug mhfg&nhzy;aqvtr Oru&bhzy;eqr (Fgen&fmyvt;rairexrueforu&bhzy;eqr) s&hhzy;e orfgvzzgr Unygrfgryyra rva fbypurf Ireunygra natrbeqarg ung.<\/c>";
		dbTblQ[2987].info = "<c>Snyfpu rvatrfrgmgr Ty&hhzy;uynzcra fbjvr mh ubpu rvatrfgryygr Fpurvajresre x&bhzy;aara qra Trtrairexrue oyraqra. Rorafb xnaa rvar snyfpur, urpxynfgvtr Orynqhat qvr Oryrhpughat orrvasyhffra haq rvara Oyraqrssrxg qrf Trtrairexruef mhe Sbytr unora.<\/c>";
		dbTblQ[2988].info = "<c>Fvr oyrvora uvagre qre Fgen&fmyvt;raonua, hz rvar Trs&nhzy;ueqhat qre rvafgrvtraqra haq nhffgrvtraqra Snuet&nhzy;fgr nhfmhfpuyvr&fmyvt;ra.<\/c>\r\n<c>Qn Fvr fvpu xhem ibe rvare Xerhmhat orsvaqra haq qvrfr haq qra Trtrairexrue avpug rvafrura x&bhzy;aara, q&hhzy;esra Fvr qvr Fgen&fmyvt;raonua avpug yvaxf &hhzy;oreubyra.<\/c>";
		dbTblQ[2989].info = "<c>Zna zhff fgrgf qniba nhftrura, qnff S&hhzy;&fmyvt;t&nhzy;atre fvpu avpug vzzre evpugvt ireunygra.<\/c>\r\n<c>Nhs qrz Ovyq rexraag zna, qnff Sh&fmyvt;t&nhzy;atre haq qre Enqsnuere qnorv fvaq qvr Fgen&fmyvt;r mh &hhzy;oredhrera. Qvr Irexruefvafry haq qre notrfratgr Obeqfgrva, x&bhzy;aara qnmh orvgentra, qnff Sh&fmyvt;t&nhzy;atre haq qre Enqsnuere zrvara fvr u&nhzy;ggra Ibeenat.<\/c>";
		dbTblQ[2990].info = "<c>Frvgyvpurf Nhffgerpxra rvarf Nezrf bqre orvqre Nezr dhre mhe Snuegevpughat qhepu rvara Cbyvmvfgra, qre qra Irexrue ertryg, orqrhgrg: \"Unyg ibe qre Xerhmhat\". Qvrf tvyg uvre s&hhzy;e qnf Snuemrht, qnf iba erpugf xbzzg.<\/c>\r\n<c>Mhtyrvpu vfg qre Dhreirexrue servtrtrora, fbqnff vpu qvr Xerhmhat ibefvpugvt &hhzy;oredhrer.<\/c>";
		dbTblQ[2991].info = "<c>Orv rvare tryo oyvaxraqra Nzcry fvaq qvr Irexruefmrvpura mh ornpugra.<\/c>\r\n<c>Uvre mrvtg qnf Irexrueffpuvyq \"Ibesnueg trj&nhzy;uera!\" qrz Irexruefgrvyaruzre na, qnff re na qre Xerhmhat qrz z&bhzy;tyvpura Dhreirexrue qvr Ibesnueg trj&nhzy;uera zhff.<\/c>";
