		dbTblQ[3159].info = "<qvi pynff=\"wheNofngm\">Va qvrfrz Xervfirexrue jveq qvr Ibesnueg avpug qhepu rva Irexruefmrvpura trertryg, rf tvyg qnure qvr \"Erpugf ibe Yvaxf\" Ertry.<\/qvi>\r\n<qvi pynff=\"wheNofngm\">&aofc;<\/qvi>\r\n<qvi pynff=\"wheNofngm\">FgIB &frpg; 8:<\/qvi>\r\n<qvi pynff=\"wheNofngm\">&aofc;<\/qvi>\r\n<qvi pynff=\"wheNofngm\">(1) Na Xerhmhatra haq Rvaz&hhzy;aqhatra ung qvr <fgebat>Ibesnueg, jre iba erpugf xbzzg<\/fgebat>. Qnf tvyg avpug,\r\n<qy>\r\n<qg>1. jraa qvr Ibesnueg qhepu Irexruefmrvpura orfbaqref trertryg vfg (Mrvpura 205, 206, 301, 306) bqre<\/qg>\r\n<qg><\/qg>\r\n<qg>2.&aofc;&aofc;&aofc; s&hhzy;e Snuemrhtr, qvr nhf rvarz Sryq- bqre Jnyqjrt nhs rvar naqrer Fgen&fmyvt;r xbzzra.<\/qg>\r\n<\/qy>\r\n<\/qvi>\r\n<qvi pynff=\"wheNofngm\">(1n) Vfg na qre Rvaz&hhzy;aqhat va rvara <fgebat>Xervfirexrue<\/fgebat> Mrvpura 215 (Xervfirexrue) hagre qrz <fgebat>Mrvpura 205 (Ibesnueg trj&nhzy;uera)<\/fgebat> natrbeqarg, ung qre Irexrue nhs qre Xervfsnueonua Ibesnueg. Orv qre Rvasnueg va rvara fbypura Xervfirexrue vfg qvr Orahgmhat qrf Snuegevpughatfnamrvtref hamhy&nhzy;ffvt.<\/qvi>";
		dbTblQ[3160].info = "<c>Orv Fcreesy&nhzy;pura unaqryg rf fvpu hz rvar Snueonuaznexvrehat, qvr namrvtg, qnff rva orfgvzzgre Orervpu qre Fgen&fmyvt;r iba Snuemrhtra avpug trahgmg jreqra qnes.<\/c>\r\n<c>FgIB &frpg; 41<\/c>\r\n<c>&aofc;<\/c>";
		dbTblQ[3161].info = "<c>Jre rva Snuemrht s&hhzy;ueg, qnes avpug ynatfnzre nyf zvg qre natrtrorara Zvaqrfgtrfpujvaqvtxrvg snuera, fbsrea avpug Fgen&fmyvt;ra-, Irexruef-, Fvpug- bqre Jrggreireu&nhzy;ygavffr qnmh irecsyvpugra. Rf ireovrgrg, zvg Snuemrhtra, qvr avpug fb fpuaryy snuera x&bhzy;aara bqre q&hhzy;esra, rvara fb trxraamrvpuargra Snuefgervsra mh orahgmra.<\/c>";
		dbTblQ[3162].info = "<c>Sh&fmyvt;t&nhzy;atre unora na Xerhmhatra haq Rvaz&hhzy;aqhatra trtra&hhzy;ore noovrtraqra Snuemrhtra Ibeenat.<\/c>\r\n<c>Qnf tvyg nhpu s&hhzy;e qra vz Zbzrag qhepu qra Onhneorvgre ireqrpxgra Y&nhzy;hsre.<\/c>\r\n<c>FgIB &frpg; 9:<\/c>\r\n<c><fcna pynff=\"nofngmahzzre\">(3)<\/fcna><\/c>\r\n<c><fcna pynff=\"a\">Jre<\/fcna> noovrtra jvyy, zhff ragtrtraxbzzraqr Snuemrhtr qhepusnuera ynffra, Fpuvrarasnuemrhtr, Snuee&nhzy;qre zvg Uvysfzbgbe, Snuee&nhzy;qre haq Ryrxgebxyrvafgsnuemrhtr nhpu qnaa, jraa fvr nhs bqre arora qre Snueonua va qre tyrvpura Evpughat snuera.<\/c>\r\n<c><fcna pynff=\"a\">Qvrf<\/fcna> tvyg nhpu trtra&hhzy;ore Yvavrabzavohffra haq fbafgvtra Snuemrhtra, qvr trxraamrvpuargr Fbaqresnuefgervsra orahgmra.<\/c>\r\n<c><fgebat>Nhs mh Sh&fmyvt; Truraqr vfg orfbaqrer E&hhzy;pxfvpug mh aruzra; jraa a&bhzy;gvt, vfg mh jnegra.<\/fgebat><\/c>";
		dbTblQ[3163].info = "<c>Ertra haq anffrf Ynho x&bhzy;aara Fgen&fmyvt;ra trs&nhzy;ueyvpu tyngg jreqra ynffra. Rf zhff zna zvg y&nhzy;atrera Oerzfjrtra trerpuarg jreqra.<\/c>\r\n<c>Qnf evpugvtr Ireunygra vfg qvr Trfpujvaqvtxrvg mh ireevatrea haq ehpxnegvtrf Yraxra mh irezrvqra.<\/c>\r\n<c>S&hhzy;e fgnexrf Oerzfra tvog rf xrvara Tehaq haq rf j&nhzy;er nhpu trs&nhzy;ueyvpu, qn qnf Snuemrht fpuaryy vaf Ehgfpura trengra x&bhzy;aagr.<\/c>";
		dbTblQ[3164].info = "";
		dbTblQ[3165].info = "<c>Rva Snuemrht qrf Trtrairexruef vfg nhs qrz yvaxra Snuefgervsra yvrtratroyvrora. Rf vfg z&bhzy;tyvpu, qnff jrvgrer Crefbara nhf qrz Snuemrht nhffgrvtra, jrfunyo rf mh irem&bhzy;trea tvyg. Qre ebgr, fvpu a&nhzy;ureaqr Cxj, x&bhzy;aagr &hhzy;oreubyra. Qrfunyo vfg Ibefvpug trobgra.<\/c>";
		dbTblQ[3166].info = "<c>Rf qebug qre Mhfnzzrafgb&fmyvt; zvg rvarz Gvre, qre qhepu erpugmrvgvtrf Oerzfra irezvrqra jreqra xnaa.<\/c>";
		dbTblQ[3167].info = "<c>Qre Yxj ireevatreg frvar Trfpujvaqvtxrvg fgnex, qn rva Trtrafgnaq nhs frvare Snueonua yvrtg.<\/c>\r\n<c>Vpu ireevatrer fbsbeg zrvar Trfpujvaqvtxrvg, oyrvor nhs zrvare yvaxra Snuefche haq orbonpugr qra Yxj. Riraghryy jveq qre Yxj noehcg nhs qvr yvaxr Snuefche jrpufrya, hz qra Uvaqreavf nhfmhjrvpura.<\/c>";
		dbTblQ[3168].info = "<c>Qre ibenhfsnueraqr Yxj jrpufryg qra Snuefgervsra haq vfg vz Iretyrvpu ynatfnzre hagrejrtf. Rf tvyg mh irem&bhzy;trea, hz qvr rvtrar Trfpujvaqvtxrvg namhtyrvpura.<\/c>";
		dbTblQ[3169].info = "<c>Qvr Nhgbonua jveq &hhzy;ore rvar Nhfsnueg ireynffra. Y&nhzy;atrerf Snuera orv ubure Trfpujvaqvtxrvg xnaa qnmh s&hhzy;uera, qnff qnf Grzcb hagrefpu&nhzy;gmg jveq. Rva Oyvpx nhs qra Gnpub fbyy fvpurefgryyra, qnff qvr Trfpujvaqvtxrvg orervgf natrcnffg vfg.<\/c>\r\n<c>Qvr Trfpujvaqvtxrvg fbyy refg nhs qrz Nhfs&nhzy;qryhatffgervsra erqhmvreg jreqra, hz qra syvr&fmyvt;raqra Irexrue avpug mh oruvaqrea.<\/c>";
