		dbTblQ[3172].info = "<c>Rf qnes ahe fb fpuaryy trsnuera jreqra, qnff vaareunyo qre &hhzy;orefruonera Fgerpxr trunygra jreqra xnaa. Fbsrea xrvar naqrera Rvasy&hhzy;ffr (m.O. qnf Jrggre) qvr Fvpugjrvgr orrvage&nhzy;pugvtra, jveq qvrfr qhepu qnf Fpurvajresreyvpug ibetrtrora.<\/c>";
