		dbTblQ[3178].info = "<c>Jrvy qnf Snuemrht jrvgreuva nhs qre Snueonua fgrug, fgryyg rf rvar Trsnue s&hhzy;e naqrer Irexruefgrvyaruzre qne. Qvrfr tvyg rf cre Jneaoyvaxyvpug ibe qre Trsnue mh jneara. Rf orfgrug qvr Irecsyvpughat, va nhfervpuraqrz Nofgnaq rva Jneamrvpura nhsmhfgryyra, hz qra fvpu a&nhzy;ureaqra Irexrue se&hhzy;umrvgvt ibe qre Trsnue mh jneara. Evpugjregr fvaq:<\/c>\r\n<hy>\r\n<yv>vaarebegf: 50 Zrgre<\/yv>\r\n<yv>Ynaqfgen&fmyvt;r: 100 Zrgre<\/yv>\r\n<yv>Nhgbonua: 150 ovf 400 Zrgre<\/yv>\r\n<\/hy>\r\n<c>Qnf Gentra qre Jneajrfgr vfg rvar Zn&fmyvt;anuzr, hz iba naqrera Irexruefgrvyaruzrea orffre trfrura mh jreqra.<\/c>";
		dbTblQ[3179].info = "<c>Oyrvog rva zruefchevtrf Snuemrht na rvare Fgryyr yvrtra, na qre rf avpug erpugmrvgvt nyf fgruraqrf Uvaqreavf rexnaag jreqra xnaa, vfg fbsbeg Jneaoyvaxyvpug rvamhfpunygra. Qnf tvyg nhpu s&hhzy;e Snuemrhtr qvr notrfpuyrccg jreqra.<\/c>\r\n<c>Qnf Jneaoyvaxyvpug fbyy fvpurefgryyra, qnff qnf Snuemrht erpugmrvgvt iba naqrera Irexruefgrvyaruzrea nyf Uvaqreavf rexnaag jveq.<\/c>";
