		dbTblQ[35].info = "<c>Gur puvyqera ner cynlvat naq znl abg abgvpr gur iruvpyr va gvzr. Rira nsgre gurl unir yrsg gur ebnq, vg vf cbffvoyr gung bar be zber puvyqera pbhyq ghea onpx gb trg gur onyy.<\/c>";
		dbTblQ[36].info = "<c>Vg vf abg pregnva jurgure gur puvyqera unir abgvprq gur genssvp naq jvyy orunir nccebcevngryl. Gurersber, lbh zhfg erqhpr lbhe fcrrq naq or ernql gb oenxr.<\/c>";
		dbTblQ[37].info = "<c>Nygubhtu abobql pna or frra, n puvyq pbhyq vanggragviryl pebff gur ebnq gb trg gur onyy ng nal gvzr. Gurersber, lbh zhfg erqhpr lbhe fcrrq naq or ernql gb oenxr.<\/c>";
		dbTblQ[48].info = "<c>Fpurqhyrq ohfrf naq znexrq fpubby ohfrf fgbccrq ng ohf fgbcf jvgu unmneq jneavat yvtugf ghearq ba znl bayl or biregnxra ng jnyxvat fcrrq naq ng fhpu n qvfgnapr gung cnffratref ner abg raqnatrerq.<\/c>\r\n<c>Jnyxvat fcrrq nyfb nccyvrf gb bapbzvat genssvp ba gur fnzr ebnq. Ohf cnffratref zhfg abg or bofgehpgrq. Vs arprffnel, nalbar qevivat n iruvpyr zhfg jnvg.<\/c>";
		dbTblQ[50].info = "<c>Fpurqhyrq ohfrf naq znexrq fpubby ohfrf fgbccrq ng ohf fgbcf jvgu unmneq jneavat yvtugf ghearq ba znl bayl or biregnxra ng jnyxvat fcrrq naq ng fhpu n qvfgnapr gung cnffratref ner abg raqnatrerq.<\/c>\r\n<c>Jnyxvat fcrrq nyfb nccyvrf gb bapbzvat genssvp ba gur fnzr ebnq. Ohf cnffratref zhfg abg or bofgehpgrq. Vs arprffnel, nalbar qevivat n iruvpyr zhfg jnvg.<\/c>";
		dbTblQ[53].info = "<c>N puvyq pbhyq ragre gur ebnq ng nal gvzr jvgubhg xrrcvat na rlr ba gur genssvp. Gurersber, lbh zhfg erqhpr lbhe fcrrq naq or ernql gb oenxr.<\/c>";
		dbTblQ[54].info = "<c>Fpurqhyrq ohfrf, genzf naq znexrq fpubby ohfrf fgbccvat ng ohf fgbcf znl bayl or biregnxra pnershyyl, rira vs gurl ner bapbzvat genssvp.<\/c>\r\n<c>Jura cnffratref ner obneqvat be qvfrzonexvat, gurl znl bayl or cnffrq ba gur evtug ng jnyxvat fcrrq naq bayl ng fhpu n qvfgnapr gung gurer vf ab qnatre gb cnffratref.<\/c>\r\n<c>Gurl zhfg abg or bofgehpgrq rvgure. Vs arprffnel, nalbar qevivat n iruvpyr zhfg jnvg.<\/c>";
		dbTblQ[55].info = "<c>Ntevphygheny znpuvarel pna qvfpunetr fbvy, pynl naq bgure qveg cnegvpyrf bagb gur ebnqjnl, juvpu vf jul gurer vf na vapernfrq evfx bs fyvccvat ng gur whapgvbaf bs qveg ebnqf.<\/c>\r\n<c>Gur fnzr nccyvrf gb whapgvbaf bs pbafgehpgvba fvgrf. Gurer vf n evfx bs cbyyhgvba sebz pbafgehpgvba fvgr genssvp.<\/c>";
		dbTblQ[56].info = "<c>Zbvfgher vapernfrf gur evfx bs ebnq genssvp nppvqragf va znal jnlf. Iruvpyrf va sebag pna fcynfu jngre, juvpu vzcnvef ivfvovyvgl.<\/c>\r\n<c>Gur zbvfgher orgjrra gur ebnq fhesnpr naq gur glerf erqhprf gur tevc bs gur glerf, juvpu erfhygf va n ybatre oenxvat qvfgnapr.<\/c>";
		dbTblQ[57].info = "<c>Jvaq naq n ynpx bs fhofbvy pnhfr gur ebnq fhesnpr ba oevqtrf gb pbby qbja zber dhvpxyl, guerngravat rneyvre vpvat bs gur ebnq.<\/c>\r\n<c>Gur fnzr nccyvrf gb sberfgf, jurer uhzvqvgl vf bsgra uvture naq yrff be ab qverpg fhayvtug ernpurf gur ebnqjnl.<\/c>";
		dbTblQ[59].info = "<c>Qvssrerag ebnq fhesnprf pna unir qvssrerag tevc naq guhf vasyhrapr gur qevivat fgnovyvgl. Rfcrpvnyyl ba genpxf, gurer vf n evfx bs cbbere genpgvba. Plpyvfgf zhfg or cnegvphyneyl pnershy jura pebffvat gur genpxf fb gung gurl qb abg ybfr genpgvba.<\/c>\r\n<c>Ng gur fnzr gvzr, gur genpxf zrna gung n genz pna nccrne sebz rvgure qverpgvba ng nal gvzr. Va cnegvphyne, zbgbevfgf nobhg gb ghea yrsg zhfg xrrc n pybfr rlr ba envy genssvp.<\/c>";
		dbTblQ[61].info = "<c>Ba vpl ebnq frpgvbaf, tevc vf erqhprq. Fgrrevat zbirzragf, oenxvat naq nppryrengvba guerngra gur qevivat fgnovyvgl bs gur iruvpyr.<\/c>\r\n<c>Nf fbba nf gur ebnq fhesnpr vf ab ybatre vpl, fhpu vagreiragvbaf pna unir na noehcg rssrpg naq guhf fvtavsvpnagyl punatr gur orunivbhe bs gur iruvpyr.<\/c>";
		dbTblQ[62].info = "<c>Vs n ebnq vf fhfcrpgrq gb or vpl, n grfg fubhyq nyjnlf or pneevrq bhg jvgu rkgerzr pnhgvba gb cerirag gur iruvpyr sebz fjreivat be fxvqqvat.<\/c>\r\n<c>Sbe guvf checbfr, vg vf cbffvoyr gb oenxr va n pbagebyyrq znaare ng n fybj fcrrq nsgre ybbxvat vagb gur erne-ivrj zveebe.<\/c>";
		dbTblQ[65].info = "<c>Gur vapbeerpgyl cnexrq pne znxrf vg qvssvphyg gb frr vagb naq nebhaq gur oraq. Va nqqvgvba, vg erdhverf n ynar punatr juvyr qevivat guebhtu n aneebj ynar ng gur fnzr gvzr.<\/c>\r\n<c>Gur fabj cebivqrf yrff tevc, juvpu znxrf fgrrevat zber qvssvphyg naq vapernfrf oenxvat qvfgnapr.<\/c>";
		dbTblQ[66].info = "<c>Gur fhqqra nccrnenapr bs sbt vf cbffvoyr nyzbfg rireljurer. Ohg va cynprf arne obqvrf bs jngre, fhpu nf eviref, zbbef naq ynxrf, gur cebonovyvgl sbe sbt gb nccrne vf cnegvphyneyl uvtu.<\/c>";
		dbTblQ[67].info = "<c>Va qvssvphyg ivfvovyvgl pbaqvgvbaf, fbheprf bs qnatre ner vqragvsvrq yngre guna va abezny ivfvovyvgl pbaqvgvbaf. Vg vf guhf arprffnel gb erqhpr lbhe fcrrq va beqre gb nqncg gb gur arj ivfvovyvgl pbaqvgvbaf.<\/c>\r\n<c>Vs ivfvovyvgl qhr gb sbt, fabj be enva vf yrff guna 50 z, gur fcrrq zhfg abg rkprrq 50 xz\/u hayrff n ybjre fcrrq vf erdhverq. Lbhe iruvpyr znl bayl or qevira ng fhpu n fcrrq gung vg pna or fgbccrq jvguva n pyrne qvfgnapr.<\/c>\r\n<c>Gur qvfgnapr orgjrra lbhe iruvpyr naq gur iruvpyr va sebag bs lbh fubhyq or nqwhfgrq fb gung lbhe iruvpyr pna fgbc va gvzr.<\/c>";
		dbTblQ[68].info = "<c>Gur pbzovangvba bs pheir naq qrafr irtrgngvba ng gur rqtr bs gur ebnq znxrf gur pbhefr bs gur ebnq hapyrne. Ng gur fnzr gvzr, gur oraq vf rybatngrq, juvpu vapernfrf gur evfx bs bapbzvat genssvp qevivat va gur zvqqyr.<\/c>\r\n<c>Pbooyrfgbarf naq ercnverq nernf sbez na harira ebnq fhesnpr, juvpu unf qvssrerag rssrpgf ba gur tevc bs gur glerf.<\/c>";
		dbTblQ[72].info = "<c>Jura bapbzvat genssvp vf qnmmyvat, qb abg ybbx qverpgyl vagb gur urnqyvtugf, ohg ghea njnl lbhe tnmr naq ybbx nf sne nf cbffvoyr gb gur evtug fvqr bs gur ebnq. Gb erqhpr gur evfx bs n pbyyvfvba qhr gb qnmmyvat genssvp, erqhpr lbhe fcrrq vs arprffnel.<\/c>";
		dbTblQ[75].info = "<c>Gur pbybheshy arba fvta pna yrnq gb bgure zbgbevfgf frrvat lbhe iruvpyr yngr. Vg znl or zber qvssvphyg gb qrgrpg bapbzvat iruvpyrf ba gvzr. Gur yvtugf bs genssvp yvtugf znl abg or erpbtavmrq va n gvzryl znaare.<\/c>";
		dbTblQ[76].info = "<c>Va pheirf, rkgerzr pragevshtny sbeprf pna npg ng uvtu fcrrqf, juvpu pna erfhyg va n ybff bs iruvpyr pbageby.<\/c>\r\n<c>Ng vagrefrpgvbaf naq whapgvbaf, uvtu fcrrq pna erfhyg va ybat oenxvat qvfgnaprf.<\/c>\r\n<c>Gurer vf n evfx gung pebffvat crqrfgevnaf jvyy or qrgrpgrq gbb yngr ng crqrfgevna pebffvatf.<\/c>";
		dbTblQ[77].info = "<c>Ng ebnq aneebjvatf, gbb uvtu n fcrrq pbhyq yrnq gb n pbyyvfvba jvgu bapbzvat genssvp orpnhfr gur oenxvat qvfgnapr vf gbb ybat. Ng yriry pebffvatf, gurer vf na vapernfrq evfx bs fxvqqvat qhr gb genpxf naq cbffvoyl harira ebnq fhesnprf.<\/c>\r\n<c>Va oyvaq pbearef, qevivat gbb snfg pna erfhyg va bgure zbgbevfgf orvat frra gbb yngr.<\/c>";
		dbTblQ[78].info = "<c>Ng gvtug oraqf gur fcrrq fubhyq abg or erqhprq bayl jvguva gur oraq, ohg nyernql orsberunaq. Vs lbh oenxr uneq va n oraq, gur iruvpyr pbhyq fjreir.<\/c>\r\n<c>Gur fnzr nccyvrf gb nppryrengvba va gur pheir, juvpu vf jul lbh fubhyq bayl nppryrengr ng gur genafvgvba gb n fgenvtug cneg bs gur ebnq.<\/c>";
		dbTblQ[82].info = "<c>Biregnxvat vf abg crezvggrq vs gur genssvp fvghngvba vf hapyrne. Gur gehpx bofpherf gur ivrj bs pebffvat genssvp nf jryy nf genssvp fvtaf.<\/c>";
		dbTblQ[86].info = "<c>Nalbar jub vf orvat biregnxra zhfg abg vapernfr gur fcrrq bs uvf be ure iruvpyr. Guvf jbhyq cebybat gur biregnxvat qvfgnapr bs gur bgure iruvpyr naq yrnq gb haarprffnel qnatre. Bgure unmneqf, fhpu nf chyyvat bhg, ner nyfb abg crezvggrq.<\/c>";
		dbTblQ[87].info = "<c>Vs gur crefba pnhtug hc jvgu fhqqrayl nppryrengrf, gur biregnxvat cebprqher zhfg or fgbccrq. Gur biregnxvat znabrhier zhfg nyfb or fgbccrq va gur rirag bs fhqqra bapbzvat genssvp.<\/c>\r\n<c>Biregnxvat vf bayl nyybjrq vs lbh pna rafher gung nal bapbzvat genssvp jvyy abg or bofgehpgrq qhevat gur ragver gvzr gung lbh ner biregnxvat. Shegurezber, biregnxvat vf bayl nyybjrq vs gur qevire vf qevivat ng n fvtavsvpnagyl uvture fcrrq guna gur crefba jub vf gb or biregnxra.<\/c>\r\n<c>Nalbar jub vf biregnxra zhfg abg vapernfr uvf be ure fcrrq.<\/c>";
		dbTblQ[88].info = "<c>Biregnxvat vf bayl nyybjrq vs lbh pna rafher gung nal bapbzvat genssvp jvyy abg or bofgehpgrq qhevat gur ragver gvzr gung lbh ner biregnxvat.<\/c>\r\n<c>Shegurezber, biregnxvat vf bayl nyybjrq vs gur qevire vf qevivat ng n fvtavsvpnagyl uvture fcrrq guna gur crefba gb or biregnxra.<\/c>\r\n<c>Biregnxvat vf abg crezvggrq vs gur genssvp fvghngvba vf hapyrne.<\/c>";
		dbTblQ[93].info = "<c>Qhr gb gur uvture prager bs tenivgl naq n ybnq gung znl or cerfrag, ybeevrf bsgra unir gb erqhpr gurve fcrrq fvtavsvpnagyl orsber ragrevat n pheir. Qrcraqvat ba gur yratgu, gur ybeel znl arrq gb irre bhg.<\/c>";
		dbTblQ[94].info = "<c>Cevbevgl ehyrf ner abg qrgrezvarq ol gur yratgu be jvqgu bs gur ebnq. <\/c>";
		dbTblQ[98].info = "<c>Gur yrnirf pbire gur ebnqjnl, znxvat vg qvssvphyg gb frr iruvpyrf ba gur ebnq pbzvat sebz gur evtug. N iruvpyr pbhyq nccebnpu sebz gur evtug, naq fvapr gurer ner ab evtug-bs-jnl fvtaf, 'evtug-orsber-yrsg' nccyvrf. Zbvfgher naq yrnirf pna vzcnve genpgvba naq guhf vapernfr oenxvat qvfgnapr.<\/c>";
		dbTblQ[101].info = "<c>Abg nyy puvyqera orunir va n ebnqjbegul znaare. Gurl pbhyq fhqqrayl eha vagb gur ebnq. Yvxrjvfr, gurl pbhyq pneryrffyl ragre gur ebnq ba ovplpyrf.<\/c>";
		dbTblQ[102].info = "<c>Nal crefba bcrengvat n erthyne ohf freivpr be n znexrq fpubby ohf zhfg fjvgpu ba unmneq jneavat yvtugf jura nccebnpuvat n ohf fgbc naq juvyr cnffratref ner obneqvat be nyvtugvat, cebivqrq gung gur nhgubevgl erfcbafvoyr sbe ebnq genafcbeg unf beqrerq fhpu orunivbhe sbe pregnva ohf fgbcf va nppbeqnapr jvgu angvbany ynj. Ncneg sebz fgbccvat naq gbjvat iruvpyrf, unmneq yvtugf znl bayl or fjvgpurq ba ol gubfr jub jnag gb raqnatre bguref ol gurve iruvpyr be jnea bguref bs qnatref, sbe rknzcyr jura nccebnpuvat n genssvp wnz be ng cnegvphyneyl fybj qevivat fcrrqf ba zbgbejnlf naq bgure snfg-zbivat ebnqf.<\/c>";
		dbTblQ[103].info = "<c>Pbzovar uneirfgref ner iruvpyrf jvgu n irel uvtu prager bs tenivgl. Vg vf guhf arprffnel sbe fhpu iruvpyrf gb erqhpr gurve fcrrq fvtavsvpnagyl orsber ragrevat n oraq. Qhr gb gur qvzrafvbaf bs gur iruvpyr, vg znl or arprffnel sbe gur pbzovar uneirfgre gb znxr n jvqr ghea. <\/c>";
		dbTblQ[104].info = "<c>Va gur pnfr bs n ynqra genvyre, vg pnaabg or ehyrq bhg gung gur vaqvpngbef be bgure yvtugf znl or pbirerq ol gur ybnq naq guhf abg or ivfvoyr. Pragevshtny sbeprf jura gheavat be oenxvat pna pnhfr cnegf bs gur ybnq gb pbzr ybbfr naq snyy bagb gur ebnq sebz gur genvyre.<\/c>";
		dbTblQ[105].info = "<c>Gur genpgbe qevire'f ivrj vf erfgevpgrq. Gur genpgbe pbhyq qevir bagb gur ebnq ng nal gvzr. Vg vf guhf vzcbegnag gb erqhpr lbhe fcrrq naq or ernql gb oenxr.<\/c>";
		dbTblQ[106].info = "<c>Jvgu ntevphygheny iruvpyrf gurer vf nyjnlf n evfx bs vaqvpngbef be bgure yvtugf orpbzvat qvegl naq guhf orpbzvat uneq gb frr. Nggnpuzragf rkgraq gur iruvpyr naq pna fjviry bhg nppbeqvatyl jura gur iruvpyr vf gheavat.<\/c>";
		dbTblQ[108].info = "<c>Ivfvovyvgl vf erfgevpgrq zrnavat gung evfxf fhpu nf bapbzvat iruvpyrf, fybj-zbivat iruvpyrf be fgngvbanel iruvpyrf ner bayl qrgrpgrq ng n yngr fgntr.<\/c>";
		dbTblQ[112].info = "<c>Qhr gb gur pbafgehpgvba fvgr, gur ebnq pna or harira naq qvegl. Vg pnaabg or ehyrq bhg gung pbafgehpgvba rdhvczrag znl or ba gur pneevntrjnl. Va nqqvgvba, pbafgehpgvba jbexref pna ragre gur ebnq ng nal gvzr.<\/c>";
		dbTblQ[116].info = "<c>Rira iruvpyrf gheavat evtug pna phg vagb gur ynarf be cnguf bs bgure zbgbevfgf. Gurersber, vg vf vzcbegnag gb purpx gung gurer vf ab bar arkg gb gur iruvpyr jub jvfurf gb qevir fgenvtug nurnq.<\/c>";
		dbTblQ[118].info = "<c>Arjyl pbafgehpgrq ebnqf va jbbqrq nernf cbfr na vapernfrq evfx bs jvyqyvsr pebffvat gur ebnq, nf gur ebnqjnl znl eha guebhtu navzny cnguf. N iruvpyr va sebag znl nyernql unir orra vaibyirq va na nppvqrag, erfhygvat va na bofgnpyr ba gur ebnq.<\/c>";
		dbTblQ[119].info = "<c>Jvyq navznyf fhpu nf qrre yvxr gb geniry va tebhcf, fb gurer vf n cbffvovyvgl gung zber navznyf pbhyq sbyybj naq pebff gur ebnq. Gur orunivbhe bs jvyq navznyf vf hacerqvpgnoyr; gurl pbhyq ghea nebhaq naq eha bagb gur ebnq ntnva.<\/c>";
		dbTblQ[122].info = "<c>Jvyq navznyf pna pebff gur ebnq ng nal gvzr. Navznyf ner, ubjrire, znvayl npgvir ng qnja nf jryy nf ng gjvyvtug.<\/c>";
		dbTblQ[123].info = "<c>Va eheny nernf, ebnq hfr ol ntevphygheny iruvpyrf zhfg or rkcrpgrq. Genpgbef naq bgure ntevphygheny iruvpyrf ner bsgra pbzcnengviryl fybj. Gur iruvpyrf pna or birefvmrq, juvpu erdhverf vapernfrq pnhgvba, rfcrpvnyyl jura biregnxvat \u2013 vs fnsr biregnxvat vf cbffvoyr ng nyy. Vs n iruvpyr ragref gur ebnq sebz n svryq be sberfg, gur ebnq znl orpbzr qvegl, juvpu va ghea pna yrnq gb n ybff bs tevc.<\/c>";
		dbTblQ[124].info = "<c>Va gur pnfr bs ntevphygheny iruvpyrf naq gurve nggnpuzragf, yvtugf pnaabg nyjnlf or zbhagrq ng gur bhgrezbfg cbvagf. Gurersber, gur iruvpyrf pna or jvqre guna gur yvtugvat fhttrfgf. Qrcraqvat ba gur glcr bs genpgbe, vg znl or cbffvoyr gb gbj hc gb gjb genvyref. Qrcraqvat ba gur qrfvta, gur genvyre znl or jvqre guna gur genpgbe. Nggnpuzragf pna or pbafvqrenoyl jvqre guna gur genpgbe, ohg qrcraqvat ba gur glcr bs vzcyrzrag, guvf vf abg nyjnlf vzzrqvngryl boivbhf \u2013 rfcrpvnyyl va gur qnex.<\/c>";
		dbTblQ[125].info = "<c>Nalbar qevivat n iruvpyr zhfg hfr qvccrq urnqyvtugf jura cnffvat guebhtu n ghaary. Guvf nyfb nccyvrf vs gur ghaary vf jryy yvg. Fhatynffrf zhfg or gnxra bss va nagvpvcngvba bs gur ynpx bs yvtug vafvqr bs gur ghaary. Bgurejvfr gur creprcgvba pbhyq or vzcnverq ol gur fhatynffrf.<\/c>";
		dbTblQ[126].info = "<c>Jura nccebnpuvat n genssvp wnz va n ghaary, gur unmneq jneavat yvtug jneaf bgure nccebnpuvat iruvpyrf bs gur vapernfrq qnatre. N fhssvpvrag fnsrgl qvfgnapr gb gur crefba va sebag vf urycshy va beqre gb or noyr gb sbez na rzretrapl ynar dhvpxyl naq fnsryl vs arprffnel.<\/c>";
		dbTblQ[127].info = "<c>Juvyr qevivat va n ghaary, bapbzvat genssvp yvtugvat naq ersyrpgvbaf ner bsgra creprvirq zber vagrafviryl, juvpu pna vzcnve nggragvba. Gur ybatre gur ghaary, gur zber zbabgbabhf gur evqr znl nccrne. Guvf pna yrnq gb n snfgre ybff bs nggragvba.<\/c>";
		dbTblQ[130].info = "<c>Nalbar qevivat n iruvpyr zhfg hfr qvccrq urnqyvtugf jura cnffvat guebhtu n ghaary naq zhfg abg ghea va gur ghaary. Vs ghaary crefbaary cebivqr pbapergr vasbezngvba be tvir vafgehpgvbaf, gurl zhfg or sbyybjrq.<\/c>";
		dbTblQ[136].info = "<c>Pregnva qehtf unir na rssrpg ba frafbel creprcgvba naq pna guhf erqhpr gur novyvgl gb qevir. Gur cbffvoyr pbafrdhraprf bs sngvthr ner bsgra haqrerfgvzngrq naq pna nyfb nssrpg gur novyvgl gb qevir. Nypbuby naq bgure qehtf pna vzcnve lbhe qevivat novyvgl.<\/c>";
		dbTblQ[137].info = "<c>Gur yriry bs nypbuby va gur obql pna or erqhprq ol nccebk. 0.1 cre zvyyr cre ubhe. Guhf, gur oernxqbja bs 1.0 cre zvyyr gnxrf nobhg gra ubhef.<\/c>";
		dbTblQ[139].info = "<c>Rira va fznyy dhnagvgvrf, nypbuby pna unir fvtavsvpnag rssrpgf. Vg pna vzcnve ivfvba naq urnevat. Vg pna nyfb nssrpg gur novyvgl gb ernpg. Gurer vf nyfb n evfx gung vg znl rapbhentr evfxl qevivat.<\/c>";
		dbTblQ[140].info = "<c>Pregnva qehtf pna vaqhpr vagbkvpngvba, juvpu va ghea pna nssrpg frafbel creprcgvba. Gurer vf nyfb n evfx bs orpbzvat nqqvpgrq gb pregnva qehtf.<\/c>";
		dbTblQ[141].info = "<c>Rira gur hfr bs YFQ, znevwhnan, unfuvfu, urebva, pbpnvar, be nzcurgnzvarf ba n fvatyr bppnfvba znl pnhfr grzcbenel vanovyvgl gb qevir.<\/c>";
		dbTblQ[145].info = "<c>Va pbagenfg gb nypbuby, GUP, juvpu vf gur npgvir vaterqvrag pbagnvarq va unfuvfu, vf abg oebxra qbja rirayl. Guvf zrnaf gung gur gvzr erdhverq sbe oernxqbja pnaabg or rfgvzngrq.<\/c>";
		dbTblQ[147].info = "<c>Qevivat haqre gur vasyhrapr bs qehtf pna or chavfurq va qvssrerag jnlf. N qevivat ona be n jvguqenjny bs gur qevivat yvprapr vf n cbffvoyr pbafrdhrapr. N svar be rira vzcevfbazrag znl or n pbafrdhrapr. Gur neenatrzrag bs n zrqvpny-cflpubybtvpny rknzvangvba (ZCH) vf cbffvoyr.<\/c>";
		dbTblQ[148].info = "<c>Gur cbffvoyr pbafrdhraprf bs pbafhzvat unfuvfu ner znavsbyq. Nzbat bgure guvatf, gurer vf n evfx bs n erfgevpgvba bs frafbel creprcgvba, vapyhqvat erqhprq erfcbafvirarff. Gur pbafhzcgvba bs unfuvfu znl erfhyg va vagbkvpngvba, vapyhqvat pbashfvba, nf jryy nf qrcerffvba bppheevat ng n yngre cbvag.<\/c>";
		dbTblQ[149].info = "<c>Qevivat haqre gur vasyhrapr bs unfuvfu pna yrnq gb zvfvagrecergngvbaf bs fcrrqf naq qvfgnaprf. Gur creprcgvba naq nffrffzrag bs unmneqf vf vzcnverq. Reebef va gur cebprffvat bs vasbezngvba ner nyfb gb or rkcrpgrq.<\/c>";
		dbTblQ[151].info = "<c>Vg vf vyyrtny gb qevax nypbubyvp orirentrf qhevat gur cebongvbanel crevbq be orsber gur ntr bs 21 nf n qevire bs n zbgbe iruvpyr ba gur ebnq be gb fgneg qevivat haqre gur vasyhrapr bs nypbuby.<\/c>";
		dbTblQ[152].info = "<c>Vg vf vyyrtny gb qevax nypbubyvp orirentrf qhevat gur cebongvbanel crevbq nppbeqvat gb \u00a7 2n be orsber gur ntr bs 21 nf n qevire bs n zbgbe iruvpyr va ebnq genssvp be gb fgneg qevivat haqre gur vasyhrapr bs nypbuby<\/c>";
		dbTblQ[153].info = "<c>Cnegvpvcngvba va ebnq genssvp erdhverf pbafgnag pnhgvba naq zhghny erfcrpg. Nalbar gnxvat cneg va genssvp zhfg orunir va fhpu n jnl gung ab bar ryfr vf unezrq, raqnatrerq be unenffrq.<\/c>";
		dbTblQ[155].info = "<c>Nalbar qevivat n iruvpyr znl abg pebff gur haqvivqrq yvar cnegvnyyl. Vs vg qryvzvgf n cnirq fvqr fgevc, ntevphygheny genpgbef naq znpuvarel, pnegf naq fvzvyne fybj iruvpyrf bhgfvqr bs ohvyg-hc nernf zhfg qevir nf sne gb gur evtug bs vg nf cbffvoyr.<\/c>\r\n<c>Nal crefba qevivat n iruvpyr fubhyq abg fgbc ba gur yrsg bs gur haqvivqrq yvar vs gurer vf n uneq fubhyqre be fcrpvny ynar ba gur evtug.<\/c>";
		dbTblQ[158].info = "<c>Zbvfgher naq fyvccrevarff erfhyg va erqhprq genpgvba naq guhf vapernfr oenxvat qvfgnapr. Ba n fybcr, gur pne nppryrengrf qhr gb gur qbjasbepr bs gur fybcr, juvpu rkgraqf gur oenxvat qvfgnapr. N genvyre vapernfrf gur znff bs gur iruvpyr, juvpu erfhygf va n ybatre oenxvat qvfgnapr jvgu gur fnzr oenxvat sbepr.<\/c>";
		dbTblQ[159].info = "<c>Gur pbaqvgvba bs n oenxvat flfgrz vasyhraprf gur oenxvat qvfgnapr. Arj oenxrf jvgu tbbq qvfpf naq shyy oenxr cnqf jbex orfg. Gur ebnq fhesnpr unf n ynetr vasyhrapr. Sbe rknzcyr, fyvccrevarff pna fvtavsvpnagyl vapernfr oenxvat qvfgnapr. Gur glcr bs glerf naq gernq qrcgu vasyhrapr gur oenxvat qvfgnapr.<\/c>";
		dbTblQ[160].info = "<c>Hayrff gurer ner bgure erfgevpgvbaf, n znkvzhz fcrrq bs 50 xz\/u nccyvrf gb nyy zbgbe iruvpyrf va ohvyg-hc nernf.<\/c>";
		dbTblQ[161].info = "<c>N qbhoyvat bs gur fcrrq erfhygf va n dhnqehcyvat bs gur oenxvat qvfgnapr. Gur ehyr bs guhzo sbe oenxvat qvfgnapr vf nf sbyybjf: (fcrrq \/ 10) k (fcrrq \/ 10).<\/c>";
		dbTblQ[162].info = "<c>Nalbar qevivat n iruvpyr znl bayl qevir nf snfg nf nyybjf gur iruvpyr gb or pbafgnagyl pbagebyyrq. Gur fcrrq fubhyq or nqncgrq gb ebnq, genssvp, ivfvovyvgl naq jrngure pbaqvgvbaf nf jryy nf gb crefbany novyvgl naq punenpgrevfgvpf bs gur iruvpyr naq ybnq.<\/c>";
		dbTblQ[163].info = "<c>Gur nirentr ernpgvba gvzr bs n uhzna orvat vf 1 frpbaq. Gur qvfgnapr pbirerq ol n iruvpyr va bar frpbaq vf gurersber gur \"ernpgvba qvfgnapr\".<\/c>\r\n<c>Gur ehyr bs guhzo sbe gur pnyphyngvba vf nf sbyybjf:<\/c>\r\n<c>Ernpgvba qvfgnapr = (fcrrq \/ 10) k 3.<\/c>";
		dbTblQ[164].info = "<c>Gur ehyr bs guhzo sbe oenxvat qvfgnapr vf nf sbyybjf: (fcrrq va xz\/u \/ 10) k (fcrrq va xz\/u \/ 10).<\/c>";
		dbTblQ[165].info = "<c>Gur oenxvat qvfgnapr vf vapernfrq ol gur qevivat fcrrq fdhnerq. Gurersber, n qbhoyvat bs gur fcrrq erfhygf va n dhnqehcyvat bs gur oenxvat qvfgnapr. Gur ehyr bs guhzo sbe fgbccvat qvfgnapr vf nf sbyybjf: (fcrrq va xz\/u \/ 10) k (fcrrq va xz\/u \/ 10) Fgbccvat qvfgnapr = (60\/10) k (60\/10) = 36 z.<\/c>";
		dbTblQ[166].info = "<c>Nf n ehyr, gur qvfgnapr gb n iruvpyr va sebag zhfg or fhpu gung vg pna or ergnvarq rira vs gur iruvpyr va sebag oenxrf fhqqrayl. Cbbe ivfvovyvgl, uvtu fcrrq naq cbbe (r.t., jrg) ebnq pbaqvgvbaf unir n qverpg vasyhrapr ba ernpgvba qvfgnapr, fgbccvat qvfgnapr naq oenxvat qvfgnapr.<\/c>";
		dbTblQ[169].info = "<c>Biregnxvat vf bayl nyybjrq vs lbh pna rafher gung gur cbffvovyvgl bs nal bofgehpgvba bs bapbzvat genssvp vf rkpyhqrq qhevat gur ragver biregnxvat cebprff. Biregnxvat vf abg crezvggrq vs gur genssvp fvghngvba vf hapyrne.<\/c>";
		dbTblQ[171].info = "<c>Nalbar jub jnagf gb biregnxr unf gb orunir va fhpu n jnl gung gurer vf ab qnatre gb gur genssvp oruvaq uvf be ure iruvpyr. Jura biregnxvat, fhssvpvrag yngreny pyrnenapr zhfg or znvagnvarq sebz bgure zbgbevfgf, va cnegvphyne sebz crqrfgevnaf naq plpyvfgf. Vs lbh biregnxr, lbh unir gb trg onpx vagb gur evtug ynar nf fbba nf cbffvoyr. Gubfr jub biregnxr zhfg abg uvaqre gubfr jub ner orvat biregnxra.<\/c>";
		dbTblQ[172].info = "<c>Vs lbh biregnxr, lbh unir gb trg onpx vagb gur evtug ynar nf fbba nf cbffvoyr. Gubfr jub biregnxr zhfg abg uvaqre gubfr jub ner orvat biregnxra. Gur biregnxvat naq ercbfvgvbavat bs gur iruvpyr funyy or fvtanyyrq pyrneyl naq va n gvzryl znaare, hfvat lbhe vaqvpngbef.<\/c>";
		dbTblQ[173].info = "<c>Nalbar jub vf orvat biregnxra zhfg abg vapernfr uvf be ure fcrrq. Vg vf arprffnel gb pbagvahr qevivat ng n pbafgnag fcrrq be gb qrpryrengr vs arprffnel. Gur biregnxvat qevire zhfg qevir ng n zhpu uvture fcrrq gb pbzcyrgr gur biregnxvat znabrhier dhvpxyl. Ubjrire, gur biregnxvat qevire zhfg or haqre pbageby bs gur iruvpyr ng nyy gvzrf. Rkprrqvat gur znkvzhz fcrrq vf nyfb abg crezvggrq qhevat biregnxvat.<\/c>";
		dbTblQ[174].info = "<c>Nalbar jub vf orvat biregnxra zhfg abg vapernfr uvf be ure fcrrq. Vg vf vzcbegnag gb qevir nf sne gb gur evtug nf cbffvoyr.<\/c>";
		dbTblQ[175].info = "<c>Biregnxvat sebz gur evtug vf abg nyybjrq va zbfg fvghngvbaf. Ohg envy iruvpyrf unir gb or biregnxra ba gur evtug. Bayl gubfr jub pnaabg qb guvf orpnhfr gur envyf ner gbb sne gb gur evtug ner nyybjrq gb biregnxr ba gur yrsg. Envyjnl iruvpyrf znl nyfb or biregnxra ba gur yrsg ba bar-jnl fgerrgf.<\/c>";
		dbTblQ[176].info = "<c>Envy iruvpyrf zhfg or biregnxra ba gur evtug. Bayl gubfr jub pnaabg qb guvf orpnhfr gur envyf ner gbb sne gb gur evtug ner nyybjrq gb biregnxr ba gur yrsg. Envyjnl iruvpyrf znl nyfb or biregnxra ba gur yrsg ba bar-jnl fgerrgf.<\/c>";
		dbTblQ[177].info = "<c>Nalbar jub jnagf gb biregnxr unf gb orunir va fhpu n jnl gung gurer vf ab qnatre gb gur genssvp oruvaq uvf be ure iruvpyr. Jura biregnxvat, fhssvpvrag yngreny pyrnenapr zhfg or znvagnvarq sebz bgure zbgbevfgf, va cnegvphyne sebz crqrfgevnaf naq plpyvfgf (abg bayl ovplpyrf ohg nyfb zbgbeplpyrf).<\/c>";
		dbTblQ[178].info = "<c>Gur biregnxvat naq ercbfvgvbavat bs gur iruvpyr fubhyq or fvtanyyrq pyrneyl naq va n gvzryl znaare ol hfvat lbhe vaqvpngbef.<\/c>";
		dbTblQ[180].info = "<c>Vs lbh jnag gb qevir cnfg n aneebjvat bs gur ebnqjnl, na bofgnpyr ba gur ebnqjnl be n fgbccvat iruvpyr ba gur yrsg, lbh zhfg nyybj bapbzvat iruvpyrf gb cnff. Guvf qbrf abg nccyl vs vaqvpngrq bgurejvfr ol genssvp fvtaf.<\/c>";
		dbTblQ[182].info = "<c>N ynar znl bayl or punatrq vs gurer vf ab qnatre gb bgure zbgbevfgf. Nal punatr bs ynar fubhyq or fvtanyyrq pyrneyl naq va n gvzryl znaare naq vaqvpngbef fubhyq or hfrq. Nggragvba zhfg or cnvq gb gur genssvp oruvaq lbh.<\/c>";
		dbTblQ[184].info = "<c>Ba ebnqf jvgu frireny ynarf sbe bar qverpgvba, vs vg vf abg cbffvoyr gb qevir pbagvahbhfyl ba bar ynar be vs bar ynar raqf, gur iruvpyrf ceriragrq sebz pbagvahvat fubhyq or nyybjrq gb cnff bire gb gur nqwnprag ynar va fhpu n jnl gung gurfr iruvpyrf pna nygreangr jvgu n iruvpyr geniryyvat ba gur pbagvahbhf ynar vzzrqvngryl orsber gur aneebjvat ortvaf (mvccre srrq-va zrgubq).<\/c>";
		dbTblQ[185].info = "<c>Nalbar qevivat n iruvpyr zhfg hfr qvccrq urnqyvtugf jura cnffvat guebhtu n ghaary naq zhfg abg ghea va gur ghaary. Gur haqvivqrq yvar znl abg rira or cnegvnyyl pebffrq.<\/c>";
		dbTblQ[196].info = "<c>Punatvat ynarf juvyr gheavat bss vaibyirf evfxf, fhpu nf pbyyvfvbaf jvgu iruvpyrf gung unir orra bireybbxrq. Vs lbh qevir gbb snfg, lbh evfx ybfvat lbhe tevc naq guhf ybfvat pbageby bs lbhe iruvpyr.<\/c>";
		dbTblQ[197].info = "<c>Bayl gur lryybj pne vf va gur pbeerpg ynar. Gur terra pne vf gbb sne gb gur yrsg; vg fubhyq unir cnffrq gur genssvp vfynaq ba gur evtug. Gur gehpx, ba gur bgure unaq, vf gbb sne gb gur evtug.<\/c>";
		dbTblQ[198].info = "<c>Nsgre gheavat yrsg, yrnir gur ynar gb gur evtug ng gur arkg whapgvba. Pbafrdhragyl, vg znxrf frafr gb cbfvgvba lbhe iruvpyr va gur evtug ynar yvxr gur erq pne fb gung lbh jvyy abg unir gb punatr ynarf yngre.<\/c>";
		dbTblQ[200].info = "<c>Gur zbgbeplpyvfg vf sbyybjvat gur cevbevgl ebnq juvpu vf jul ur unf gb vaqvpngr.<\/c>";
		dbTblQ[201].info = "<c>Nalbar qevivat n iruvpyr znl abg qevir bire gur prageny vfynaq bs gur ebhaqnobhg. Guvf cebuvovgvba qbrf abg nccyl gb iruvpyrf jubfr qvzrafvbaf jbhyq bgurejvfr cerirag gurz sebz orvat qevira ba gurfr ebnqf. Iruvpyrf zhfg abg fgbc ba gur ebnq jvguva gur ebhaqnobhg. Vs lbh jnag gb ghea, lbh zhfg fvtany guvf pyrneyl naq va n gvzryl znaare, hfvat lbhe vaqvpngbef.<\/c>";
		dbTblQ[203].info = "<c>Nyy zbgbevfgf vaibyirq jnag gb ghea naq zhfg vaqvpngr.<\/c>";
		dbTblQ[205].info = "<c>Vs lbh jnag gb ghea, lbh zhfg naabhapr guvf pyrneyl naq va n gvzryl znaare ol hfvat lbhe vaqvpngbef. Gheavat vagb whapgvbaf be cybgf bs ynaq zhfg or vaqvpngrq. Vs n cevbevgl ebnq oraqf, zbgbevfgf gung jnag gb sbyybj gur cevbevgl ebnq zhfg nyfb fvtany gb vaqvpngr gurve vagrag.<\/c>";
		dbTblQ[210].info = "<c>Jubrire jnagf gb qevir bire n ybjrerq xreofgbar bagb gur ebnq be sebz gur rqtr bs gur ebnq unf gb jnvg naq orunir va fhpu n jnl gung gurer vf ab qnatre gb bgure zbgbevfgf.<\/c>";
		dbTblQ[211].info = "<c>Vs lbh jnag gb fgneg qevivat sebz gur rqtr bs gur ebnq, lbh zhfg orunir va fhpu n jnl gung gurer vf ab qnatre gb bgure zbgbevfgf. Vs arprffnel, yrg lbhefrys or qverpgrq. Gur vagragvba gb ragre gur ebnq be fgneg gur iruvpyr zhfg or fvtanyyrq pyrneyl naq va n gvzryl znaare ol hfvat gur qverpgvba vaqvpngbef.<\/c>";
		dbTblQ[215].info = "<c>Vs gurer vf genssvp pbatrfgvba, lbh zhfg abg qevir vagb gur pebffebnqf be whapgvba qrfcvgr gur evtug bs jnl be terra yvtug fvtany. Vs gur yriry pebffvat pnaabg or pebffrq dhvpxyl naq jvgubhg n fgbc qhr gb ebnq genssvp, jnvg va sebag bs gur qvntbany pebff.<\/c>";
		dbTblQ[217].info = "<c>Cevbevgl fubhyq or tvira gb bapbzvat genssvp. Lbh zhfg erqhpr lbhe fcrrq naq, vs arprffnel, lbh zhfg jnvg fb gung bapbzvat genssvp pna cnff.<\/c>";
		dbTblQ[219].info = "<c>Vg vf abg crezvggrq gb fgbc va aneebj naq hapyrne cynprf ba gur ebnq be ng yriry pebffvatf.<\/c>";
		dbTblQ[220].info = "<c>Cnexvat vf abg crezvggrq vs vg ceriragf gur hfr bs znexrq cnexvat fcnprf. Nalbar qevivat n iruvpyr vf abg crezvggrq gb cnex ba gur ynarf bs cevbevgl ebnqf bhgfvqr ohvyg-hc nernf .<\/c>";
		dbTblQ[221].info = "<c>Nalbar qevivat n iruvpyr vf abg nyybjrq gb fgbc ba gur genpx znexrq jvgu neebjf. Nalbar qevivat n iruvpyr znl abg cnex ba gur ebnq vs gurer vf abg n ynar bs ng yrnfg 3 z orgjrra gur cnexrq iruvpyr naq gur ynar obhaqnel yvar. Nalbar qevivat n iruvpyr vf abg crezvggrq gb fgbc ng gnkv enaxf, rkprcg sbe gnkvf qebccvat bss be cvpxvat hc cnffratref.<\/c>";
		dbTblQ[222].info = "<c>Nalbar qevivat n iruvpyr zhfg abg fgbc ba crqrfgevna pebffvatf be hc gb 5 z orsber gur crqrfgevna pebffvat.<\/c>";
		dbTblQ[223].info = "<c>Cnexvat vf abg crezvggrq vs vg ceriragf gur hfr bs znexrq cnexvat fcnprf. Cnexvat va sebag bs xreof vf nyfb cebuvovgrq.<\/c>";
		dbTblQ[224].info = "<c>Vs gurer ner envyf ba gur evtug fvqr be lbh ner va n bar-jnl fgerrg, cnexvat ba gur yrsg fvqr bs gur ebnq vf nyybjrq.<\/c>";
		dbTblQ[225].info = "<c>Nalbar jub yrnirf gurve iruvpyr be unf fgbccrq sbe zber guna guerr zvahgrf unf cnexrq.<\/c>";
		dbTblQ[226].info = "<c>Nalbar qevivat n iruvpyr zhfg abg fgbc ba crqrfgevna pebffvatf be hc gb 5 z va sebag bs gurz.<\/c>";
		dbTblQ[228].info = "<c>Nalbar qevivat n iruvpyr znl abg cnex hc gb 5 z va sebag bs be oruvaq gur Fg. Naqerj'f Pebff va ohvyg-hc nernf naq hc gb 50 z bhgfvqr bs ohvyg-hc nernf.<\/c>";
		dbTblQ[229].info = "<c>Nalbar qevivat n iruvpyr znl abg cnex hc gb 5 z va sebag bs be oruvaq gur Fg. Naqerj'f Pebff va ohvyg-hc nernf naq hc gb 50 z bhgfvqr bs ohvyg-hc nernf.<\/c>";
		dbTblQ[230].info = "<c>Nalbar qevivat n iruvpyr znl abg cnex hc gb 15 z va sebag bs be oruvaq n fgbc fvta.<\/c>";
		dbTblQ[231].info = "<c>Cnexvat vf sbeovqqra ng ohf fgbcf. Nalbar jub erznvaf gurer sbe ybatre guna guerr zvahgrf vf pbafvqrerq gb unir cnexrq.<\/c>";
		dbTblQ[237].info = "<c>Fgbccvat vf abg crezvggrq ba gur yrsg fvqr bs gur ynar obhaqnel. Gur fvqr fgevc vf gb or hfrq ol fybj iruvpyrf, fhpu nf genpgbef.<\/c>";
		dbTblQ[239].info = "<c>Gur ubea vf na nhqvoyr fvtany. Fbhaq naq yvtug fvtanyf znl bayl or tvira ol gubfr jub biregnxr bhgfvqr ohvyg-hc nernf be jub frr gurzfryirf be bguref raqnatrerq.<\/c>";
		dbTblQ[240].info = "<c>Gur ubea vf na nhqvoyr fvtany. Fbhaq naq yvtug fvtanyf znl bayl or tvira ol gubfr jub biregnxr bhgfvqr ohvyg-hc nernf be jub frr gurzfryirf be bguref raqnatrerq. Va heona nernf, ubjrire, gur ubea znl bayl freir nf n jneavat fvtany.<\/c>";
		dbTblQ[241].info = "<c>Va beqre abg gb raqnatre bgure zbgbevfgf be lbhefrys, lbh fubhyq  qevir ba gb gur arkg rzretrapl onl, vs cbffvoyr. Va gur ghaary rkunhfg shzrf qb abg qvffvcngr nf rnfvyl, juvpu vf jul gur ratvar zhfg or fjvgpurq bss gb cerirag cbvfbavat. Vs n zhygv-ynar iruvpyr fgbcf ng n cbvag jurer vg pnaabg or qrgrpgrq va gvzr nf n fgngvbanel bofgnpyr, unmneq yvtugf zhfg or fjvgpurq ba vzzrqvngryl.<\/c>";
		dbTblQ[242].info = "<c>Jura nccebnpuvat n genssvp wnz, gur unmneq jneavat yvtug freirf nf n fvtany gb jnea sbyybjvat iruvpyrf. Gheavat vf sbeovqqra va gur ghaary, naq gur iruvpyr znl abg or yrsg.<\/c>";
		dbTblQ[243].info = "<c>Yvtugvat qrivprf fubhyq or svkrq gb iruvpyrf be ybnq pneevref nppbeqvat gb gur ahzore naq glcr bs yvtugvat qrivprf cerfpevorq. Gur yvtugvat rdhvczrag zhfg abg or bofpherq be qvegl.<\/c>";
		dbTblQ[246].info = "<c>Iruvpyrf zhfg jnvg sbe crqrfgevnaf ng n fnsr qvfgnapr va sebag bs gur yriry pebffvat jura n erq synfuvat yvtug be lryybj be erq yvtug fvtanyf ner tvira, jura n envyjnl rzcyblrr beqref zbgbevfgf gb fgbc, be jura gur oneevref ner ybjrerq be pybfrq.<\/c>";
		dbTblQ[247].info = "<c>Iruvpyrf zhfg jnvg va sebag bs gur Fg. Naqerj'f Pebff jura erq synfuvat yvtugf be lryybj be erq yvtug fvtanyf ner tvira be jura gur oneevref ner ybjrerq be pybfrq.<\/c>";
		dbTblQ[248].info = "<c>Iruvpyrf zhfg jnvg sbe crqrfgevnaf ng n fnsr qvfgnapr va sebag bs gur yriry pebffvat vs n envyjnl rzcyblrr beqref zbgbevfgf gb fgbc.<\/c>";
		dbTblQ[249].info = "<c>Ebnq genssvp znl nccebnpu fhpu yriry pebffvatf bayl ng n zbqrengr fcrrq. Vs gur yriry pebffvat pnaabg or pebffrq dhvpxyl naq jvgubhg n fgbc qhr gb ebnq genssvp, jnvg va sebag bs gur yriry pebffvat.<\/c>";
		dbTblQ[251].info = "<c>Gur Fg. Naqerj'f Pebff pnyyf sbe vapernfrq nggragvba, va cnegvphyne n erqhpgvba bs fcrrq va ivrj bs n qnatrebhf fvghngvba. Envy iruvpyrf unir cevbevgl ba yriry pebffvatf jvgu n Fg. Naqerj'f Pebff nf jryy nf va cbeg naq vaqhfgevny nernf, vs gur Fg. Naqerj'f Pebff jvgu gur nqqvgvbany fvta \"Cbeg nern, envy iruvpyrf unir cevbevgl\" be \"Vaqhfgevny nern, envy iruvpyrf unir cevbevgl\" vf fubja ng gur ragenaprf.<\/c>";
		dbTblQ[252].info = "<c>Envyjnl iruvpyrf unir cevbevgl ba yriry pebffvatf bire sbbgcnguf, svryq cnguf, sberfg cnguf be plpyr cnguf. Ebnq genssvp znl nccebnpu fhpu yriry pebffvatf bayl ng n zbqrengr fcrrq. Nccebnpuvat envy iruvpyrf pna or naabhaprq ol n evatvat be juvfgyvat fvtany.<\/c>";
		dbTblQ[253].info = "<c>Iruvpyrf zhfg jnvg va sebag bs gur Fg. Naqerj'f Pebff jura gur oneevref ner ybjrerq be pybfrq. Gur urnqynzcf bs jnvgvat zbgbe iruvpyrf zhfg abg qnmmyr nalobql.<\/c>";
		dbTblQ[255].info = "<c>Iruvpyrf zhfg jnvg va sebag bs gur yriry pebffvat jura n erq synfuvat yvtug be lryybj be erq yvtug fvtanyf ner tvira \u2013 rira vs gur genva unf nyernql cnffrq guebhtu gur pebffvat.<\/c>";
		dbTblQ[256].info = "<c>Vs gur yriry pebffvat pnaabg or pebffrq dhvpxyl naq jvgubhg n fgbc qhr gb ebnq genssvp, jnvg va sebag bs gur Fg. Naqerj'f Pebff.<\/c>";
		dbTblQ[258].info = "<c>Iruvpyrf zhfg jnvg va sebag bs gur yriry pebffvat jura gur oneevref ner ybjrerq be pybfrq.<\/c>";
		dbTblQ[259].info = "<c>Gur Fg. Naqerj'f Pebff (nyfb nccrnevat ubevmbagnyyl) vf hfhnyyl ybpngrq qverpgyl va sebag bs gur yriry pebffvat. Na vyyhzvangrq neebj va gur zvqqyr bs gur Fg. Naqerj'f Pebff vaqvpngrf gung gur envyjnl yvar unf n yvir bireurnq ryrpgevpny yvar. Envy iruvpyrf unir cevbevgl ba yriry pebffvatf jvgu Fg. Naqerj'f Pebff.<\/c>";
		dbTblQ[260].info = "<c>Erq beqref: \"Fgbc ng gur vagrefrpgvba\". Lbh unir gb jnvg ng gur fgbc yvar. Vs gurer vf ab yvar, jnvg ng gur yvtug fvtany.<\/c>";
		dbTblQ[263].info = "<c>Fpurqhyrq ohfrf, genzf naq znexrq fpubby ohfrf fgbccvat ng ohf fgbcf znl bayl or biregnxra pnershyyl, rira va gur rirag bs bapbzvat genssvp. Jura cnffratref ner obneqvat be qvfrzonexvat, iruvpyrf znl bayl cnff ba gur evtug fvqr ng n jnyxvat fcrrq naq bayl ng fhpu n qvfgnapr gung gurer vf ab qnatre gb cnffratref. Gurl zhfg nyfb abg or bofgehpgrq. Vs arprffnel, nalbar qevivat n iruvpyr zhfg jnvg.<\/c>";
		dbTblQ[264].info = "<c>Ohfrf naq pbnpurf hfrq sbe erthyne naq fpubby genafcbeg fubhyq or noyr gb qrcneg sebz znexrq ohf fgbcf. Vs arprffnel, bgure iruvpyrf zhfg jnvg.<\/c>";
		dbTblQ[265].info = "<c>Fpurqhyrq ohfrf, genzf naq znexrq fpubby ohfrf fgbccvat ng ohf fgbcf znl bayl or biregnxra pnershyyl, rira va gur rirag bs bapbzvat genssvp. Jura cnffratref ner obneqvat be qvfrzonexvat, iruvpyrf znl bayl cnff ba gur evtug fvqr ng n jnyxvat fcrrq naq bayl ng fhpu n qvfgnapr gung gurer vf ab qnatre gb cnffratref. Gurl zhfg nyfb abg or bofgehpgrq. Vs arprffnel, nalbar qevivat n iruvpyr zhfg jnvg.<\/c>";
		dbTblQ[267].info = "<c>Lbh zhfg rkcrpg crqrfgevnaf jnagvat gb ernpu gur ohf va n uheel. Yvxrjvfr, qvfrzonexvat cnffratref pbhyq eha qverpgyl npebff gur pneevntrjnl.<\/c>";
		dbTblQ[268].info = "<c>Gur ybnq znl rkgraq orlbaq gur ersyrpgbef ol hc gb 1 z jvgubhg nal znexvat orvat arprffnel.<\/c>";
		dbTblQ[269].info = "<c>N ybnq rkgraqvat zber guna 1 z orlbaq gur ersyrpgbef zhfg or znexrq. Va qnexarff, ng yrnfg bar ynzc jvgu n erq yvtug funyy or cynprq va gur fnzr cynpr, naq n erq ergeb-ersyrpgbe juvpu funyy abg or cynprq uvture guna 90 pz.<\/c>";
		dbTblQ[271].info = "<c>Nalbar qevivat n iruvpyr zhfg nyfb rafher gung gur iruvpyr, gur ybnq, gur evt naq gur bpphcnagf ner va nppbeqnapr jvgu gur erthyngvbaf naq gung gur ebnq fnsrgl bs gur iruvpyr vf abg nqirefryl nssrpgrq ol gur ybnq be bpphcnagf. Bireybnqvat pna unir n fvtavsvpnag vasyhrapr ba gur iruvpyr naq qevivat orunivbhe. Gurer vf n evfx bs bireybnqvat gur oenxr flfgrz. Gur fgrrevat orunivbhe pna qrgrevbengr. Gurer vf nyfb n evfx bs qnzntr gb ybnq-ornevat iruvpyr cnegf.<\/c>";
		dbTblQ[273].info = "<c>Qnatrebhf tbbqf genafcbegref zhfg or ynoryyrq jvgu benatr jneavat fvtaf.<\/c>";
		dbTblQ[274].info = "<c>Nalbar qevivat n iruvpyr erzbir gur iruvpyr, gur genva be gur pbzovangvba sebz freivpr ol gur fubegrfg cbffvoyr ebhgr vs nal qrsrpgf bpphe qhevat gur wbhearl gung fvtavsvpnagyl vzcnve ebnq fnsrgl ner abg erpgvsvrq vzzrqvngryl. Va nqqvgvba gb gur qevire, gur bjare vf nyfb erfcbafvoyr sbe gur ebnqjbeguvarff bs gur iruvpyr.<\/c>";
		dbTblQ[275].info = "<c>Nalbar qevivat n iruvpyr erzbir gur iruvpyr, gur genva be gur pbzovangvba sebz freivpr ol gur fubegrfg cbffvoyr ebhgr vs nal qrsrpgf bpphe qhevat gur wbhearl gung fvtavsvpnagyl vzcnve ebnq fnsrgl ner abg erpgvsvrq vzzrqvngryl. Gur pbagvahngvba bs gur wbhearl vf bayl crezvggrq nsgre gur qnzntr unf orra ercnverq.<\/c>";
		dbTblQ[276].info = "<c>Jbea glerf erqhpr ebnq tevc naq pna guhf raqnatre bgure zbgbevfgf. Qrsrpgvir gnvy yvtugf nyfb cbfr n qnatre. Gur fnzr nccyvrf gb vafhssvpvrag oenxvat, sbe rknzcyr, qhr gb jbea oenxr yvavatf.<\/c>";
		dbTblQ[283].info = "<c>Gurer vf n ab-cnexvat mbar ba gur mroen pebffvat. Cnexvat vf guhf abg crezvggrq. Va nqqvgvba, biregnxvat zhfg abg bpphe.<\/c>";
		dbTblQ[296].info = "<c>Gur svefg fgrc vf gb frpher gur nppvqrag fvgr va beqre gb jnea bgure zbgbevfgf naq cebgrpg gubfr vaibyirq.<\/c>";
		dbTblQ[298].info = "<c>Va gur rirag bs na nppvqrag be oernxqbja ba gur zbgbejnl, uryc pna or erdhrfgrq ol pnyyvat gur gryrcubar ahzoref 110 naq 112. Vs ab zbovyr cubar be zbovyr argjbex vf ninvynoyr, gur arnerfg rzretrapl pnyy cbvag be zbgbejnl freivpr nern pna or hfrq sbe guvf checbfr.<\/c>";
		dbTblQ[301].info = "<c>Vs n zhygv-ynar iruvpyr fgbcf ng n cbvag jurer vg pnaabg or qrgrpgrq va gvzr nf n fgngvbanel bofgnpyr, unmneq yvtugf zhfg or fjvgpurq ba vzzrqvngryl. Guvf freirf gb jnea gur zbgbevfgf sbyybjvat gur fgbccrq iruvpyr va n gvzryl znaare. Nsgre gur iruvpyr unf orra cnexrq fnsryl, gur nppvqrag fvgr zhfg or cebcreyl frpherq. Fhofrdhragyl, ivpgvzf ner gb or urycrq naq\/be na rzretrapl freivpr vf gb or vasbezrq.<\/c>";
		dbTblQ[302].info = "<c>Gur fvtaf naq vafgehpgvbaf bs gur cbyvpr bssvpref ner gb or sbyybjrq. Gurl gnxr cerprqrapr bire nyy bgure beqref naq bgure ehyrf, ohg qb abg eryrnfr gur zbgbevfg sebz gur qhgl gb cnl nggragvba.<\/c>";
		dbTblQ[304].info = "<c>Gur fvtaf naq vafgehpgvbaf bs gur cbyvpr bssvpref ner gb or sbyybjrq. Gurl gnxr cerprqrapr bire nyy bgure beqref naq bgure ehyrf, ohg qb abg eryrnfr gur zbgbevfg sebz gur qhgl gb cnl nggragvba.<\/c>";
		dbTblQ[305].info = "<c>Gur trfgher bs gur envfvat bs na nez cresbezrq ol n cbyvpr bssvpre erthyngvat genssvp vaqvpngrf \"jnvg sbe gur arkg fvta orsber pebffvat\". Zbgbevfgf ng gur vagrefrpgvba zhfg pyrne gur vagrefrpgvba.<\/c>";
		dbTblQ[306].info = "<c>Gur trfgher bs bar be obgu nezf  bhgfgergpurq fvqrjnlf npebff gur qverpgvba bs geniry cresbezrq ol n cbyvpr bssvpre pbagebyyvat gur genssvp vaqvpngrf: \"Fgbc ng gur vagrefrpgvba\".<\/c>";
		dbTblQ[308].info = "<c>Cbyvpr bssvpref znl fgbc zbgbevfgf sbe genssvp purpxf, vapyhqvat ebnqjbeguvarff purpxf, naq sbe ebnq fheirlf. N cbyvpr bssvpre znl nyfb tvir n fvta gb fgbc ol zrnaf bs nccebcevngr grpuavpny rdhvczrag ba gur rzretrapl iruvpyr, na vaqvpngbe fvtanyyvat qvfp be n erq yvtug. Gurfr fvtaf pna nyfb or hfrq gb fgbc n cerprqvat ebnq hfre. Zbgbevfgf zhfg sbyybj gur vafgehpgvbaf bs gur cbyvpr bssvpref. Qrcraqvat ba vgf hfr, gur flzoby znl nccyl gb gur iruvpyr vzzrqvngryl oruvaq be va sebag bs vg.<\/c>";
		dbTblQ[309].info = "<c>Cbyvpr bssvpref znl fgbc zbgbevfgf sbe genssvp purpxf, vapyhqvat ebnqjbeguvarff purpxf, naq sbe ebnq fheirlf. N cbyvpr bssvpre znl nyfb tvir n fvta gb fgbc ol zrnaf bs nccebcevngr grpuavpny rdhvczrag ba gur rzretrapl iruvpyr, na vaqvpngbe fvtanyyvat qvfp be n erq yvtug. Gurfr fvtaf pna nyfb or hfrq gb fgbc n cerprqvat ebnq hfre. Zbgbevfgf zhfg sbyybj gur vafgehpgvbaf bs gur cbyvpr bssvpref. Qrcraqvat ba vgf hfr, gur flzoby znl nccyl gb gur iruvpyr vzzrqvngryl oruvaq be va sebag bs vg.<\/c>";
		dbTblQ[312].info = "<c>Fvqrjnlf rkgrafvba bs bar nez be obgu nezf npebff gur qverpgvba bs geniry ol n cbyvpr bssvpre qverpgvat genssvp zrnaf: \"Fgbc orsber gur vagrefrpgvba\". Guvf nccyvrf urer gb pebff genssvp.<fcna pynff='peys'><\/fcna><fcna pynff='peys'><\/fcna>V znl pebff gur vagrefrpgvba.<\/c>";
		dbTblQ[314].info = "<c>Qhr gb gur erq genssvp yvtug, gur terra pne unf gb jnvg. Gheavat gb gur evtug vf crezvggrq, jurerol gur genssvp fvta zhfg or bofreirq, v.r., evtug-bs-jnl pebff genssvp zhfg or nyybjrq guebhtu.<\/c>";
		dbTblQ[318].info = "<c>N fvatyr-svryq fvtany genafzvggre jvgu n terra neebj vaqvpngrf gung jura gur erq yvtug nccyvrf gb gur fgenvtug-nurnq qverpgvba, vg vf crezvffvoyr gb ghea gb gur evtug. Arireguryrff, vg vf vzcbegnag gb fgbc naq pbafvqre gung yngreny genssvp, plpyvfgf naq crqrfgevnaf unir cevbevgl.<\/c>";
		dbTblQ[320].info = "<c>N fvatyr-svryq fvtany genafzvggre jvgu n terra neebj vaqvpngrf gung jura gur erq yvtug nccyvrf gb gur fgenvtug-nurnq qverpgvba, vg vf crezvffvoyr gb ghea gb gur evtug. Arireguryrff, vg vf vzcbegnag gb xrrc gb gur fgbc yvar. Vs gurer vf ab fgbc yvar, fgbc ng gur vagrefrpgvba be whapgvba.<\/c>";
		dbTblQ[321].info = "<c>Gur genssvp yvtug gnxrf cerprqrapr bire bgure genssvp fvtaf gung erthyngr cevbevgl. Gurersber, gur pebffvat zhfg or pebffrq jvgubhg fgbccvat.<\/c>";
		dbTblQ[322].info = "<c>Vs lbh jnag gb ghea, lbh unir gb lvryq gb bapbzvat iruvpyrf, envy iruvpyrf, ryrpgevp ovplpyrf naq plpyvfgf rira vs gurl ner qevivat ba be orfvqr gur ebnq va gur fnzr qverpgvba.<\/c>";
		dbTblQ[323].info = "<c>Qhr gb gur fbyvq yvar, punatvat ynarf vf abg crezvggrq. Gur neebjf fcrpvsl gur qverpgvba va juvpu lbh znl pbagvahr. Gurersber, lbh znl bayl qevir rvgure fgenvtug nurnq be ghea evtug.<\/c>";
		dbTblQ[326].info = "<c>N oyhr synfuvat yvtug beqref gur sbyybjvat: \"Nyy bgure zbgbevfgf zhfg pyrne gur jnl vzzrqvngryl\". Gurersber, vg vf arprffnel gb nfx barfrys jurer gur iruvpyr vf pbzvat sebz naq jurgure pbagvahvat lbhe wbhearl zvtug bofgehpg gur iruvpyr. <\/c>";
		dbTblQ[327].info = "<c>N lryybj synfuvat yvtug jneaf bs cbffvoyr qnatref. Vg pna jnea bs iruvpyrf jvgu hahfhny jvqguf naq fybj-zbivat ynetr-pncnpvgl genafcbegf. Gur fnzr nccyvrf gb unmneqf ng jbex naq nppvqrag fvgrf.<\/c>";
		dbTblQ[328].info = "<c>Oyhr synfuvat yvtugf nybar znl bayl or hfrq ol iruvpyrf rdhvccrq jvgu gurz naq bayl sbe jneavat va gur pnfr bs na nppvqrag be bgure pbaqvgvbaf, qhevat rzretrapl qevirf be jura nppbzcnalvat iruvpyrf be pybfrq pbaiblf.<\/c>";
		dbTblQ[329].info = "<c>Oyhr synfuvat yvtugf nybar znl bayl or hfrq ol iruvpyrf rdhvccrq jvgu gurz naq bayl sbe jneavat va gur pnfr bs na nppvqrag be bgure pbaqvgvbaf, qhevat rzretrapl qevirf be jura nppbzcnalvat iruvpyrf be pybfrq pbaiblf.<\/c>";
		dbTblQ[330].info = "<c>Ng pebffebnqf naq whapgvbaf, cevbevgl vf tvira gb gubfr pbzvat sebz gur evtug. Guvf qbrf abg nccyl vs genssvp fvtaf fcrpvnyyl erthyngr gur evtug bs jnl.<\/c>";
		dbTblQ[331].info = "<c>Ng pebffebnqf naq whapgvbaf, cevbevgl vf tvira gb gubfr pbzvat sebz gur evtug. Guvf qbrf abg nccyl vs gur evtug bs jnl vf fcrpvnyyl erthyngrq ol genssvp fvtaf be sbe iruvpyrf pbzvat sebz n qveg ebnq be sberfg ebnq gb nabgure ebnq. Nalbar jub jnagf gb qevir bire n ybjrerq xreofgbar bagb gur ebnq be sebz gur rqtr bs gur ebnq zhfg orunir va fhpu n jnl gung gurer vf ab qnatre gb bgure zbgbevfgf.<\/c>";
		dbTblQ[332].info = "<c>Vs gur evtug-bs-jnl fvghngvba vf abg vzzrqvngryl nccnerag, vg vf arprffnel gb jnvg va beqre gb svefg tenfc gur fvghngvba naq, vs arprffnel, gb pbzzhavpngr gur fvghngvba gb bgure zbgbevfgf.<\/c>";
		dbTblQ[342].info = "<c>Ng guvf vagrefrpgvba, gur evtug bs jnl vf erthyngrq ol gur genssvp fvta, juvpu vaqvpngrf gung zbgbevfgf zhfg \"tenag gur evtug bs jnl\". Gur bgure gjb iruvpyrf zhfg guhf or tvira cevbevgl.<\/c>";
		dbTblQ[343].info = "<c>Gur genssvp fvta tenagf gur evtug bs jnl. Guvf zrnaf lbh pna qevir va sebag bs gur ohf. Ubjrire, nf n zbgbevfg nobhg gb znxr n yrsg ghea, vg vf  arprffnel gb yrg gur bapbzvat genssvp \u2013 naq guhf gur zbgbeplpyr \u2013 cnff svefg.<\/c>";
		dbTblQ[344].info = "<c>Gur genssvp fvta \"Tvir jnl\" tvirf cevbevgl gb gur zbgbeplpyvfg. Gur ohf vf gheavat yrsg naq unf gb yrg gur bapbzvat genssvp cnff svefg.<\/c>";
		dbTblQ[345].info = "<c>Jnagvat gb ghea yrsg, cevbevgl zhfg or tvira gb bapbzvat zbgbevfgf. Gurersber, lbh znl bayl ghea nsgre gur zbgbeplpyr unf cnffrq. Ubjrire, gur lryybj pne unf gb jnvg orpnhfr gur pne vf gheavat bss gur znva ebnq.<\/c>";
		dbTblQ[354].info = "<c>Fvapr ab genssvp fvtaf erthyngr gur evtug bs jnl, jubrire pbzrf sebz gur evtug unf gur evtug bs jnl. Gur terra pne zhfg guhf or tvira cevbevgl.<\/c>";
		dbTblQ[357].info = "<c>Gur zbgbeplpyvfg pbzvat sebz gur yrsg vf sbyybjvat gur znva ebnq naq unf cevbevgl. Gur zbgbeplpyvfg\u2019f ynar naq gur ynar bs gur pne pbzvat sebz gur evtug ner bs rdhny enax. Fb jubrire pbzrf sebz gur evtug unf gur evtug bs jnl. Gur oyhr pne vf guhf nyybjrq gb cebprrq svefg.<\/c>";
		dbTblQ[358].info = "<c>Gur fvta \"tenag evtug bs jnl\" tvirf cevbevgl gb gur genz. Vs lbh ghea yrsg, lbh unir gb yrg gur bapbzvat genssvp tb svefg, juvpu vf jul gur zbgbeplpyr unf cevbevgl.<\/c>";
		dbTblQ[359].info = "<c>Lbhe iruvpyr vf sbyybjvat gur znva ebnq, fb gur pne pbzvat sebz gur evtug unf gb jnvg.<\/c>";
		dbTblQ[360].info = "<c>Ng guvf whapgvba, cevbevgl vf tvira gb gubfr pbzvat sebz gur evtug. Guvf nyybjf gur oyhr pne gb ghea svefg. Gur zbgbeplpyvfg, ba gur bgure unaq, vf nobhg gb znxr n yrsg ghea naq zhfg tvir cevbevgl gb bapbzvat genssvp.<\/c>";
		dbTblQ[361].info = "<c>Qhr gb gur cevbevgl ebnq, lbh zhfg cnff gur pebffebnqf svefg. Gur genz naq gur erq pne zhfg jnvg.<\/c>";
		dbTblQ[362].info = "<c>Lbh ner sbyybjvat n cevbevgl ebnq. Gurersber, gur oyhr pne zhfg jnvg. Gur terra pne vf ybpngrq ba gur cevbevgl ebnq, ohg nf vg vf nobhg gb znxr n yrsg ghea, vg nyfb zhfg jnvg.<\/c>";
		dbTblQ[373].info = "<c>Gur genssvp fvta vaqvpngrf na vagrefrpgvba be whapgvba jvgu evtug bs jnl cevbevgl.<\/c>";
		dbTblQ[375].info = "<c>Gur genssvp fvta vaqvpngrf n bar-fvqrq aneebjrq ebnqjnl. Gur obggyrarpx vf ba lbhe fvqr, fb gung bapbzvat genssvp unf cevbevgl ba n fgerrg jvgu bar ynar. Ba n pneevntrjnl jvgu gjb ynarf va bar qverpgvba, gur mvccre srrq-va zrgubq funyy or hfrq.<\/c>";
		dbTblQ[376].info = "<c>Gur genssvp fvta vaqvpngrf bapbzvat genssvp, r.t., ng gur raq bs n bar-jnl fgerrg. Qnmmyr sebz bapbzvat genssvp vf cbffvoyr ng avtug.<\/c>";
		dbTblQ[377].info = "<c>Gur genssvp fvta vaqvpngrf puvyqera znl ragre gur ebnq. Vg vf znvayl sbhaq arne xvaqretnegraf naq fpubbyf. Va ivrj bs guvf qnatre, gur qevire vf erdhverq gb cnl gur hgzbfg nggragvba. Gur fcrrq bs gur iruvpyr fubhyq or erqhprq. Gur qevire zhfg nyfb or ernql gb oenxr.<\/c>";
		dbTblQ[379].info = "<c>Bhgfvqr bs ohvyg-hc nernf, gur genssvp fvta vf trarenyyl 150 gb 250 z va sebag bs gur cbgragvny qnatre. Vs gur qvfgnapr vf pbafvqrenoyl fubegre, vg znl or vaqvpngrq jvgu na nqqvgvbany flzoby.<\/c>";
		dbTblQ[380].info = "<c>Gur genssvp fvta jneaf bs n cbgragvny qnatre Gur nqqvgvbany fvta \"Jvagre Fcbegf\" vaqvpngrf gur npghny qnatre, anzryl gung jvagre fcbegf ner cenpgvfrq ba gur ebnqjnl. Qhr gb jvagre jrngure naq ebnq pbaqvgvbaf, gur ebnq znl or fabjl be vpl.<\/c>";
		dbTblQ[382].info = "<c>Gur genssvp fvta vaqvpngrf n qbhoyr pheir. Va ivrj bs gur pragevshtny sbeprf gung pna npg va fhpu n pheir, vg vf vzcbegnag gb erqhpr lbhe fcrrq va n gvzryl znaare. Bapbzvat genssvp pbhyq vagrefrpg ng gur oraq, juvpu vf jul vg vf vzcbegnag gb qevir gb gur rkgerzr evtug.<\/c>";
		dbTblQ[383].info = "<c>Gur pbzovangvba bs qnatre fvta naq nqqvgvbany fvta jneaf bs n tenqvrag bs 800 z va yratgu.<\/c>";
		dbTblQ[385].info = "<c>Gur genssvp fvta vaqvpngrf hariraarff va gur ebnq fhesnpr. Vs gur fcrrq vf gbb uvtu, gurer vf n evfx bs fxvqqvat be qnzntr gb gur iruvpyr. Vg vf guhf arprffnel gb erqhpr lbhe fcrrq.<\/c>";
		dbTblQ[386].info = "<c>Gurer vf n jneavat bs hariraarff naq qnzntr gb gur ebnq fhesnpr. Gur iruvpyr fxvqqvat vf guhf cbffvoyr. Nqqvgvbanyyl, na nkyr oernx pbhyq pnhfr hafnsr qevivat. Va nqqvgvba, qnzntr gb gur pnetb pnaabg or ehyrq bhg.<\/c>";
		dbTblQ[387].info = "<c>Gur genssvp fvta jneaf bs gur qnatre bs fxvqqvat be fyvccvat jura gur ebnq vf jrg be qvegl.<\/c>";
		dbTblQ[388].info = "<c>Gur genssvp fvta jneaf bs n aneebjvat ebnqjnl ba obgu fvqrf. Gur fcrrq fubhyq or erqhprq. Biregnxvat vf ab ybatre cbffvoyr.<\/c>";
		dbTblQ[389].info = "<c>Gur genssvp fvta jneaf bs n ebnqjnl aneebjrq ba obgu fvqrf naq ybpngrq 50 z njnl.<\/c>";
		dbTblQ[390].info = "<c>Gur genssvp fvta jneaf bs n pbafgehpgvba fvgr. Guvf vf nppbzcnavrq ol gur evfx bs jbexref zbivat ba gur ebnq. Gurer znl nyfb or ohvyqvat zngrevnyf ba gur ebnq. Genssvp sebz pbafgehpgvba fvgr iruvpyrf vf gb or rkcrpgrq.<\/c>";
		dbTblQ[392].info = "<c>Gur genssvp fvta jneaf bs n cynpr jurer gurer vf n evfx bs genssvp wnzf. Fhqqra oenxvat bs gur cerprqvat qevire vf gb or rkcrpgrq. Na raq gb gur genssvp wnz zhfg or rkcrpgrq.<\/c>";
		dbTblQ[393].info = "<c>Gur genssvp fvta vaqvpngrf n genssvp yvtug flfgrz gung vf qvssvphyg gb erpbtavmr.<\/c>";
		dbTblQ[394].info = "<c>Gur fvta vaqvpngrf na haznexrq yriry pebffvat. Ubjrire, zbgbevfgf bayl nccebnpu guvf yriry pebffvat vs gurl sbyybj gur ebnq gb gur evtug \u2013 guvf vf vaqvpngrq ol gur nqqvgvbany fvta.<\/c>";
		dbTblQ[395].info = "<c>Gur gjb-fgevcr ornpba vaqvpngrf gung gurer vf n yriry pebffvat nccebk. 160 z njnl.<\/c>";
		dbTblQ[396].info = "<c>Gur fvatyr-fgevcr ornpba vaqvpngrf gung gurer vf n yriry pebffvat nccebk. 80 z njnl.<\/c>";
		dbTblQ[397].info = "<c>Iruvpyrf va sebag bs gur yriry pebffvat unir gb jnvg ng n fnsr qvfgnapr va sebag bs gur yriry pebffvat sbe crqrfgevnaf jura n envy iruvpyr nccebnpurf be jura n envyjnl rzcyblrr beqref n fgbc. Lbh fubhyq nyfb jnvg ng gur yriry pebffvat vs vg vf abg cbffvoyr gb pebff jvgubhg fgbccvat va gur yriry pebffvat va gur zrnagvzr.<\/c>";
		dbTblQ[400].info = "<c>Nalbar qevivat n iruvpyr zhfg sbyybj gur cerfpevorq qverpgvba bs geniry. Vs lbh jnag gb ghea, lbh zhfg fvtany guvf pyrneyl naq va n gvzryl znaare ol hfvat gur qverpgvba vaqvpngbef.<\/c>";
		dbTblQ[401].info = "<c>Nalbar qevivat n iruvpyr zhfg sbyybj gur cerfpevorq qverpgvba bs geniry. Vs lbh jnag gb ghea, lbh zhfg fvtany guvf pyrneyl naq va n gvzryl znaare ol hfvat gur qverpgvba vaqvpngbef.<\/c>";
		dbTblQ[402].info = "<c>Bayl qevir fgenvtug nurnq be gb gur evtug. Vs lbh jnag gb ghea evtug, lbh zhfg vaqvpngr guvf pyrneyl naq va n gvzryl znaare ol hfvat gur qverpgvba vaqvpngbef.<\/c>";
		dbTblQ[403].info = "<c>Jubrire qevirf n iruvpyr zhfg sbyybj gur cerfpevorq ehyrf sbe cnffvat.<\/c>";
		dbTblQ[404].info = "<c>Zbgbevfgf zhfg cnl fcrpvny nggragvba gb gur puvyqera. Gur nvz vf gb erqhpr fcrrq naq or ernql gb oenxr.<\/c>";
		dbTblQ[406].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"Fgneg bs n crqrfgevna mbar\". Nal crefba jub vf abg n crqrfgevna fubhyq abg hfr gur crqrfgevna mbar.<\/c>";
		dbTblQ[408].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"Zbcrqf ner cebuvovgrq\". Vg vf sbeovqqra gb qevir ba gur ebnq jvgu n zbcrq.<\/c>";
		dbTblQ[409].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"Cebuvovgvba bs ragel\". Nalbar qevivat n iruvpyr znl abg qevir bagb gur ynar gb juvpu gur fvta nccyvrf. Nqqvgvbanyyl, nggragvba zhfg or cnvq gb iruvpyrf rkvgvat guvf ebnq.<\/c>";
		dbTblQ[411].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"yvzvgrq fgbccvat erfgevpgvba\". Nal crefba qevivat n iruvpyr znl abg fgbc ba gur ebnq sbe zber guna guerr zvahgrf, rkprcg sbe obneqvat, qvfrzonexvat, ybnqvat be haybnqvat.<\/c>";
		dbTblQ[412].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel qverpgvba: \"yvzvgrq fgbccvat erfgevpgvba\". N crefba qevivat n iruvpyr znl abg fgbc ba gur ebnq sbe zber guna guerr zvahgrf, rkprcg jura trggvat vagb be bhg bs gur iruvpyr be jura ybnqvat be haybnqvat. Gur nqqvgvbany fvta rkpyhqrf frireryl unaqvpnccrq crbcyr jvgu rkgenbeqvanel jnyxvat qvfnovyvgvrf, ovyngreny nzryvn be cubxbzryvn (ovegu qrsrpgf) be jvgu pbzcnenoyr shapgvba erfgevpgvbaf nf jryy nf oyvaq crbcyr. Va rnpu pnfr, gur unaqvpnccrq crefba zhfg or va cbffrffvba bs n fcrpvny cnexvat crezvg eryrnfvat uvz be ure sebz gur fgbc cebuvovgvba. Gur rkrzcgvba bayl nccyvrf vs gur cnexvat pneq vf pyrneyl yrtvoyr.<\/c>";
		dbTblQ[414].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"Tvir cevbevgl gb bapbzvat genssvp.\" Nalbar qevivat n iruvpyr zhfg tvir cevbevgl gb bapbzvat genssvp.<\/c>";
		dbTblQ[418].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"Evtug be yrsg\". Nalbar qevivat n iruvpyr zhfg sbyybj gur cerfpevorq qverpgvba bs geniry. Pbagvahr rvgure gb gur yrsg be gb gur evtug.<\/c>";
		dbTblQ[421].info = "<c>Gur nqqvgvbany fvta vaqvpngrf n fpubby ohf fgbc. Puvyqera va cnegvphyne ner yvxryl gb or pneryrff naq pebff gur fgerrg dhvpxyl gb ernpu gur ohf va gvzr. Puvyqera jvyy abg arprffnevyl pubbfr gur fubegrfg ebhgr.<\/c>";
		dbTblQ[426].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"Crqrfgevna\". Bayl crqrfgevnaf znl hfr gur fvqrjnyx. Na rkprcgvba vf qryvirel genssvp, juvpu vf rkpyhqrq ol gur nqqvgvbany fvta.<\/c>";
		dbTblQ[427].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel qverpgvba: \"Fpurqhyrq ohfrf\". Fcrpvny ohf ynarf ner bayl gb or hfrq ol erthyne ohfrf, pbnpurf, iruvpyrf orybatvat gb qvfnoyrq vaqvivqhnyf naq fpubby ohfrf, juvpu ner gb or znexrq jvgu gur fpubby ohf fvta va nppbeqnapr jvgu cnffratre genafcbeg ynj.<\/c>";
		dbTblQ[428].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"Cebuvovgvba sbe nyy glcrf bs iruvpyrf\". Gurer vf n cebuvovgvba sbe nyy glcrf bs iruvpyrf. Gur nqqvgvbany fvta nyybjf erfvqragf gb ragre guvf ebnq. Erfvqragf naq ivfvgbef bs gur erfvqragf ner ertneqrq nf erfvqragf.<\/c>";
		dbTblQ[430].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"Cebuvovgvba sbe zbgbe iruvpyrf\". Gurer vf n ona ba zbgbe iruvpyrf.<\/c>";
		dbTblQ[431].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"Plpyvat vf cebuvovgrq\". Gur erthyngvba fvta cebuvovgf ovplpyrf sebz hfvat gur ebnqjnl.<\/c>";
		dbTblQ[432].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"Zbgbeplpyrf jvgu fvqrpnef naq zbcrqf ner cebuvovgrq\".<\/c>";
		dbTblQ[433].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"Cebuvovgvba bs ragel\". Nal crefba qevivat n iruvpyr znl abg ragre gur ynar gb juvpu gur fvta nccyvrf. Va guvf pnfr, vg ersref gb n ynar ng n qvfgnapr bs 100 z.<\/c>";
		dbTblQ[436].info = "<c>Gur fvta vaqvpngrf gur sbyybjvat znaqngbel ehyr: \"Fgneg bs gur 30 xz\/u fcrrq yvzvg mbar\". Nalbar qevivat n iruvpyr znl abg qevir snfgre guna gur znkvzhz fcrrq vaqvpngrq jvguva guvf mbar.<\/c>";
		dbTblQ[437].info = "<c>Gur genssvp fvta vaqvpngrf n genssvp-pnyzrq ohfvarff nern. Gurer vf yvxryl gb or urnil crqrfgevna genssvp. Gur cnexvat gvzr vf yvzvgrq gb gjb ubhef naq zhfg or qrzbafgengrq ol zrnaf bs n cnexvat qvfp.<\/c>";
		dbTblQ[438].info = "<c>Gur genssvp fvta vaqvpngrf gur raq bs n 30 xz\/u mbar.<\/c>";
		dbTblQ[439].info = "<c>Gur nqqvgvbany flzoby cebuvovgf zbgbevfgf sebz rkprrqvat gur fcrpvsvrq fcrrq jura gur ebnq fhesnpr vf jrg.<\/c>";
		dbTblQ[441].info = "<c>Gur genssvp fvta cebuvovgf zbgbe iruvpyr qeviref sebz biregnxvat zhygv-ynar zbgbe iruvpyrf naq zbgbeplpyrf jvgu fvqrpnef. Fvapr n zbgbeplpyr jvgubhg n fvqrpne vf abg n zhygv-genpx iruvpyr, vg znl or biregnxra.<\/c>";
		dbTblQ[442].info = "<c>Gur genssvp fvta cebuvovgf zbgbe iruvpyr qeviref sebz biregnxvat zhygv-genpx zbgbe iruvpyrf naq zbgbeplpyrf jvgu fvqrpnef. Gur nqqvgvbany punenpgre vaqvpngrf gur yratgu bs gur cebuvovgvba ntnvafg biregnxvat.<\/c>";
		dbTblQ[443].info = "<c>Gur genssvp fvta cebuvovgf zbgbe iruvpyr qeviref sebz biregnxvat zhygv-genpx zbgbe iruvpyrf naq zbgbeplpyrf jvgu fvqrpnef. Gur nqqvgvbany fvta vaqvpngrf gur qvfgnapr sebz juvpu gur cebuvovgvba nccyvrf.<\/c>";
		dbTblQ[444].info = "<c>Gur genssvp fvta cbvagf gb gur raq bs n fcrrq yvzvg bs 60 xz\/u.<\/c>";
		dbTblQ[445].info = "<c>Gur genssvp fvta vaqvpngrf gur raq bs nyy qvfgnapr-eryngrq fcrrq erfgevpgvbaf naq cebuvovgvbaf ba biregnxvat.<\/c>";
		dbTblQ[446].info = "<c>Fgbccvat ba gur ebnq vf sbeovqqra. Gur nqqvgvbany punenpgre rkcnaqf gur fgbc cebuvovgvba gb gur fvqr fgevc.<\/c>";
		dbTblQ[447].info = "<c>Nal crefba qevivat n iruvpyr znl abg fgbc jvguva gur znexrq mbar sbe zber guna guerr zvahgrf, rkprcg sbe obneqvat, qvfrzonexvat, ybnqvat be haybnqvat.<\/c>";
		dbTblQ[448].info = "<c>Gur genssvp fvta vaqvpngrf gur raq bs n yvzvgrq ab-jnvgvat nern.<\/c>";
		dbTblQ[452].info = "<c>Vs lbh jnag gb ghea, lbh zhfg naabhapr guvf pyrneyl naq va n gvzryl znaare ol hfvat gur qverpgvba vaqvpngbef \u2013 rira jura yrnivat n ebhaqnobhg. Ubjrire, jura ragrevat fhpu n ebhaqnobhg, gur hfr bs gur qverpgvba vaqvpngbe vf cebuvovgrq.<\/c>";
		dbTblQ[453].info = "<c>Vs gur fvta vaqvpngvat gung zbgbevfgf zhfg \"tvir jnl\" vf ybpngrq ng gur whapgvba jvgu n ebhaqnobhg, genssvp ba gur pvephyne ebnq unf gur evtug bs jnl. Vs lbh jnag gb ghea, lbh zhfg naabhapr guvf pyrneyl naq va n gvzryl znaare ol hfvat gur qverpgvba vaqvpngbef.<\/c>";
		dbTblQ[454].info = "<c>Ab fgbccvat vf crezvggrq ba gur ebnq jvguva gur ebhaqnobhg.<\/c>";
		dbTblQ[455].info = "<c>Vs gur fvta vaqvpngvat gung zbgbevfgf zhfg \"tvir jnl\" vf ybpngrq ng gur whapgvba jvgu n ebhaqnobhg, genssvp ba gur pvephyne ebnq unf gur evtug bs jnl. Vs lbh jnag gb ghea, lbh zhfg naabhapr guvf pyrneyl naq va n gvzryl znaare ol hfvat gur qverpgvba vaqvpngbef.<\/c>";
		dbTblQ[456].info = "<c>Vs gur fvta vaqvpngvat gung zbgbevfgf zhfg \"tvir jnl\" vf ybpngrq ng gur whapgvba jvgu n ebhaqnobhg, genssvp ba gur pvephyne ebnq unf gur evtug bs jnl. Vs lbh jnag gb ghea, lbh zhfg naabhapr guvf pyrneyl naq va n gvzryl znaare ol hfvat gur qverpgvba vaqvpngbef.<\/c>";
		dbTblQ[457].info = "<c>Gur genssvp fvta vaqvpngrf gung evtug bs jnl rkvfgf ng gur arkg vagrefrpgvba be whapgvba.<\/c>";
		dbTblQ[460].info = "<c>Gur genssvp fvta vaqvpngrf gur sbyybjvat: \"Uvtujnl\". Sebz guvf fvta bajneq, gur ehyrf sbe genssvp ba zbgbejnlf nccyl.<\/c>";
		dbTblQ[463].info = "<c>Genssvp fvta ab. 1 vaqvpngrf gung evtug bs jnl rkvfgf ng gur arkg vagrefrpgvba be whapgvba. Ahzore 2: \"Raq bs cevbevgl ebnq\". Ahzore 3: \"Cevbevgl bire bapbzvat genssvp va n obggyrarpx\".<\/c>";
		dbTblQ[464].info = "<c>Gur fvta ab. 2 vaqvpngrf gung evtug bs jnl rkvfgf ng gur arkg vagrefrpgvba be whapgvba.<\/c>";
		dbTblQ[466].info = "<c>Sbe cnexvat, hfr gur evtug-unaq uneq fubhyqre, juvpu nyfb vapyhqrf cnexvat fcnprf ynvq bhg nybat gur ebnq vs gurer vf fhssvpvrag fcnpr. Bgurejvfr nccebnpu gur evtug-unaq rqtr bs gur ebnq. Guvf nyfb hfhnyyl nccyvrf vs lbh whfg jnag gb fgbc.<\/c>";
		dbTblQ[468].info = "<c>Gur genssvp fvta vaqvpngrf gur raq bs gur cevbevgl ebnq.<\/c>";
		dbTblQ[469].info = "<c>Lbh unir cevbevgl bire bapbzvat genssvp. Arireguryrff, vg vf cbffvoyr gung bapbzvat genssvp vf nyernql cnffvat gur obggyrarpx. Nppbeqvatyl, gur obggyrarpx zhfg or serr va beqre gb cnff vg. Orpnhfr bs bapbzvat genssvp, vg znl or arprffnel gb fgbc qrfcvgr guvf cevbevgl gb bapbzvat genssvp.<\/c>";
		dbTblQ[471].info = "<c>Bayl erfvqragf jvgu na nccebcevngryl ahzorerq cnexvat crezvg znl cnex urer.<\/c>";
		dbTblQ[472].info = "<c>Gur cnexvat crezvg vf erfgevpgrq gb frireryl qvfnoyrq crbcyr jvgu rkgenbeqvanel jnyxvat qvfnovyvgvrf, ovyngreny nzryvn be cubxbzryvn (ovegu qrsrpgf), crbcyr jvgu pbzcnenoyr shapgvbany erfgevpgvbaf, naq oyvaq crbcyr naq gurve thvqrf.<\/c>";
		dbTblQ[473].info = "<c>Cnexvat vf bayl nyybjrq jvgu n cnexvat gvpxrg. Vg zhfg or cbfvgvbarq va n jnl fb gung vg pna or rnfvyl ernq. Vg vf abg crezvggrq gb rkprrq gur cnexvat gvzr vaqvpngrq ba gur gvpxrg.<\/c>";
		dbTblQ[474].info = "<c>Nalbar qevivat n iruvpyr jvgu n znkvzhz crezvffvoyr znff rkprrqvat 2.8 gbaarf znl abg cnex ba fvqrjnyxf. Gur znkvzhz crezvffvoyr znff bs n zbgbeplpyr vf ybjre, fb vg pna or cnexrq urer.<\/c>";
		dbTblQ[475].info = "<c>Gur genssvp fvta vaqvpngrf n zbgbejnl. Zbgbejnlf naq uvtujnlf znl bayl or hfrq jvgu zbgbe iruvpyrf jubfr znkvzhz fcrrq rkprrqf 60 xz\/u. <\/c>";
		dbTblQ[478].info = "<c>Gur genssvp fvta vaqvpngrf n qrnq raq.<\/c>";
		dbTblQ[479].info = "<c>Gur genssvp fvta vaqvpngrf n svefg nvq fgngvba.<\/c>";
		dbTblQ[481].info = "<c>Gur ynagrea evat fvta vaqvpngrf yvtugf gung ner abg yvg gur ragver avtug va ohvyg-hc nernf. Gur gvzr ng juvpu gur yvtug vf fpurqhyrq gb or ghearq bss znl or vaqvpngrq va juvgr cevag vafvqr bs gur erq nern.<\/c>";
		dbTblQ[482].info = "<c>Gur genssvp fvta vaqvpngrf n Ohaqrffgen&fmyvt;r. Gur ahzore vaqvpngrf gur ahzore bs gur srqreny ebnq.<\/c>";
		dbTblQ[483].info = "<c>Gur flzoby vaqvpngrf nygreangvir ebhgrf ba zbgbejnlf, gur hfr bs juvpu vf erpbzzraqrq vs arprffnel (ebhgr erpbzzraqngvba).<\/c>";
		dbTblQ[484].info = "<c>Nalbar qevivat n iruvpyr zhfg hfr qvccrq urnqyvtugf jura cnffvat guebhtu n ghaary.<\/c>";
		dbTblQ[486].info = "<c>Nalbar qevivat n iruvpyr zhfg hfr qvccrq urnqyvtugf jura cnffvat guebhtu n ghaary. Vs fhatynffrf ner jbea, gurl zhfg or erzbirq.<\/c>";
		dbTblQ[487].info = "<c>Rira vs gur ghaary vf oevtugyl yvg, nalbar qevivat n iruvpyr zhfg hfr qvccrq urnqyvtugf jura qevivat guebhtu n ghaary.<\/c>";
		dbTblQ[488].info = "<c>Gur genssvp fvta vaqvpngrf gur raq bs n genssvp-pnyzvat mbar.<\/c>";
		dbTblQ[489].info = "<c>Cnexvat jneavat fvtaf znl vaqvpngr genvyref cnexrq ba gur ebnq jvguva ohvyg-hc nernf. Gurl ner nyfb hfrq sbe znexvat iruvpyrf jvgu rkprff jvqgu.<\/c>";
		dbTblQ[493].info = "<c>Vafhssvpvrag gler cerffher vapernfrf shry pbafhzcgvba. Vg nyfb yrnqf gb uvture gler noenfvba.<\/c>";
		dbTblQ[494].info = "<c>Sbe ybatre crevbqf bs vqyr gvzr, vg vf erpbzzraqrq gb fjvgpu bss gur ratvar. Guvf vf bsgra gur pnfr jura jnvgvat ng envy pebffvatf. Guvf nyfb nccyvrf gb ybatre jnvgvat gvzrf va genssvp wnzf.<\/c>";
		dbTblQ[495].info = "<c>Ratvar bvyf naq fvzvyne yhoevpnagf ner unmneqbhf gb jngre. Bar qebc pna znxr nccebk. 600 yvgerf bs jngre haqevaxnoyr.<\/c>";
		dbTblQ[496].info = "<c>Qb abg vaunyr shry incbhef jura ershryyvat. Qb abg ershry jura gur gnax vf shyy nppbeqvat gb gur abmmyr nf gur shry vf pbby naq pbhyq rkcnaq.<\/c>";
		dbTblQ[506].info = "<c>N cebnpgvir qevivat fglyr pbagevohgrf gb ybj shry pbafhzcgvba naq vf guhf pbafvqrerq raivebazragnyyl pbafpvbhf. Vg urycf gb nibvq haarprffnel nppryrengvba naq oenxvat.<\/c>";
		dbTblQ[509].info = "<c>Gur pbafvqrengvba bs shry pbafhzcgvba jura ohlvat n pne pbagevohgrf gb n erqhprq raivebazragny vzcnpg. N cebnpgvir qevivat fglyr erqhprf shry pbafhzcgvba. Gur hfr bs choyvp genafcbeg eryvrirf gur oheqra ba gur raivebazrag.<\/c>";
		dbTblQ[510].info = "<c>Nibvqvat gevcf vf tbbq sbe gur raivebazrag. Guvf vf cnegvphyneyl gehr sbe wbhearlf gb pebjqrq pvgvrf, fubeg wbhearlf naq shyy guebggyr wbhearlf.<\/c>";
		dbTblQ[513].info = "<c>Gur uvture gur fcrrq va gur pheir, gur uvture gur pragevshtny sbepr. Gur fznyyre gur pheir enqvhf, gur uvture gur pragevshtny sbepr.<\/c>";
		dbTblQ[517].info = "<c>Qrsrpgvir fubpx nofbeoref pna nqirefryl nssrpg gur vapyvangvba bs gur iruvpyr naq guhf vzcnve qevivat fgnovyvgl. Guvf znl pnhfr fxvqqvat ba oraqf. Vs gur gler cerffher vf gbb ybj be inevrf, guvf unf na hasnibhenoyr rssrpg ba ebnq tevc naq qevivat fgnovyvgl.<\/c>";
		dbTblQ[520].info = "<c>Phggvat pbearef vf qnatrebhf orpnhfr gurer vf n evfx bs pbyyvfvba jvgu bapbzvat genssvp. Yngr qvzzvat znl qnmmyr bapbzvat genssvp, juvpu znl pebff gur ynar be yrnir gur ynar.<\/c>";
		dbTblQ[523].info = "<c>Yvfgravat gb ybhq zhfvp vf n qvfgenpgvba gung nssrpgf gur qevire'f nggragvba. Oyvaq crqrfgevnaf pna or qvfgheorq va gurve bevragngvba ol gur ybhq zhfvp.<\/c>";
		dbTblQ[525].info = "<c>Vs lbh nccebnpu ng n uvtu fcrrq, gurer vf n evfx gung bgure zbgbevfgf jvyy abg erpbtavmr lbhe iruvpyr nccebnpuvat va gvzr. Gurl znl chyy bhg gb biregnxr orsber gurl frr lbhe iruvpyr nccebnpuvat. Gur uvture gur fcrrq, gur terngre gur rssrpg bs pebffjvaq ba qevivat fgnovyvgl.<\/c>";
		dbTblQ[527].info = "<c>Enva nsgre cebybatrq qel crevbqf pna perngr n ternfl svyz ba gur ebnq fhesnpr. Vs fcynfu jngre ernpurf gur uryzrg ivfbe be fnsrgl tbttyrf, gurer vf n evfx bs pbafvqrenoyl erqhprq ivfvovyvgl.<\/c>";
		dbTblQ[529].info = "<c>Jura qevivat pybfr gb gur prager yvar qhevat n yrsg ghea, gur obql guerngraf gb cebgehqr vagb gur ynar bs bapbzvat genssvp. Qevivat ba gur ebnq znexvatf znl erfhyg va cbbere tevc naq gur zbgbeplpyr znl fyvc.<\/c>";
		dbTblQ[531].info = "<c>Pbooyrfgbar cnirzrag qbrf abg bssre cnegvphyneyl tbbq genpgvba, juvpu qrgrevbengrf nqqvgvbanyyl va jrg pbaqvgvbaf. Guvf zrnaf gung gurer vf n evfx bs vapernfrq oybpxvat bs gur oenxrf. Gurer vf na vapernfrq evfx bs snyyvat. Va nqqvgvba, gur erne jurry pna fcva be fyvc jura nppryrengvat.<\/c>";
		dbTblQ[533].info = "<c>Obgu enva naq fcynfu jngre pna fvtavsvpnagyl vzcnve ivfvovyvgl guebhtu ivfbef naq cebgrpgvir tbttyrf. Ebnq qnzntrf ner bsgra erpbtavmrq yngre be ner trarenyyl abg nf rnfvyl erpbtavmnoyr. Gur fcynfu jngre sebz bgure iruvpyrf nyfb vzcnvef ivfvovyvgl.<\/c>";
		dbTblQ[535].info = "<c>Gb cerirag glerf sebz fyvccvat be jrqtvat, genzyvarf fubhyq cersrenoyl or pebffrq ng n jvqr natyr (cersrenoyl iregvpnyyl). Gurer vf nyjnlf na vapernfrq evfx bs fyvccvat naq guhf snyyvat ba gur envyf bs n genz.<\/c>";
		dbTblQ[536].info = "<c>Bvy ba gur ebnq fhesnpr pna fvtavsvpnagyl vzcnve ebnq tevc naq guhf vapernfr gur evfx bs snyyf. Jura qevivat bire ebnq znexvatf, gurer vf nyfb n evfx bs n qrgrevbengvba va tevc.<\/c>";
		dbTblQ[537].info = "<c>Qverpg pbagnpg orgjrra gur ebnq fhesnpr naq gur glerf cebzvfrf gur orfg tevc. Sbyvntr naq fnaq vzcnve genpgvba. Yvxrjvfr, znaubyr pbiref pna vzcnve genpgvba.<\/c>";
		dbTblQ[538].info = "<c>Nf enva frgf va, oenxr qvfpf naq cnqf orpbzr qnzc, punatvat gurve cebcregvrf. Va guvf pnfr, oenxr pnershyyl. Gur fnzr vf gehr jura qevivat ba pbooyrfgbarf, orpnhfr gur tevc ba pbooyrfgbarf vf pbzcnengviryl cbbe.<\/c>";
		dbTblQ[539].info = "<c>Jbea glerf unir cbbe jngre qvfcynprzrag, juvpu va ghea pna pnhfr ndhncynavat. Jngre npphzhyngrf va ehgf, juvpu vapernfrf gur qnatre. Gur uvture gur fcrrq, gur jbefr gur jngre vf qenvarq guebhtu gur gernqf.<\/c>";
		dbTblQ[541].info = "<c>Gur biregnxvat ynar vf pbirerq jvgu fyhfu, juvpu pna frireryl vzcnve ebnq tevc. Va nqqvgvba, gurer vf gur qnatre gung gur ebnq haqre gur fyhfu znl fgvyy or vpl. Gur iruvpyrf gb or biregnxra pna fcynfu fyhfu naq jngre, juvpu vzcnvef ivfvovyvgl.<\/c>";
		dbTblQ[542].info = "<c>Va fgebat pebffjvaqf, pbhagre-fgrrevat urycf gb xrrc gur iruvpyr ba genpx. N erqhpgvba va fcrrq urycf gb xrrc gur iruvpyr haqre pbageby qrfcvgr fgebat fvqr jvaqf.<\/c>";
		dbTblQ[544].info = "<c>Gur jvaq inar fvtanyf n fvqr jvaq sebz gur evtug, fb lbhe pne vf chfurq gb gur yrsg. Jura qevivat vagb gur fyvcfgernz bs gur gehpx, gur pebffjvaq ab ybatre npgf fb fgebatyl chyyvat gur pne gb gur evtug.<\/c>";
		dbTblQ[546].info = "<c>Urnil envasnyy vzcnvef ivfvovyvgl naq guhf erdhverf fcrrq nqwhfgzrag. Ng gur fnzr gvzr, ndhncynavat vf n evfx. Gur oenxvat qvfgnapr vf rkgraqrq ol urnil zbvfgher.<\/c>";
		dbTblQ[548].info = "<c>N qrgrevbengvba va gur pbaqvgvba bs gur ebnq fhesnpr znl erfhyg va fxvqqvat be fyvccvat, r.t., qhr gb cbgubyrf be erqhprq genpgvba pnhfrq ol gur ebnq fhesnpr. N onq ebnq bsgra pnhfrf glerf gb cebqhpr ybhq abvfrf.<\/c>";
		dbTblQ[550].info = "<c>Ebjf bs gerrf ner n punenpgrevfgvp bs nirahrf. Gurfr bsgra erfhyg va gvtug oraqf naq pna vzcnve ivfvovyvgl. Gur pneevntrjnl znl or aneebj naq pheirq, juvpu erdhverf vapernfrq pnhgvba, rfcrpvnyyl va gur pnfr bs bapbzvat genssvp.<\/c>";
		dbTblQ[551].info = "<c>Jngre pna pbyyrpg va qvcf va gur ebnqjnl, juvpu pna pnhfr ndhncynavat. <\/c>";
		dbTblQ[553].info = "<c>Qhfg naq bgure qveg cnegvpyrf ba gur jvaqfuvryq pna sbez n ternfl svyz, znxvat ivfvovyvgl qvssvphyg. N fvzvyne svyz pna nyfb sbez ba gur ebnq fhesnpr, juvpu pna yrnq gb qrgrevbengvba va tevc.<\/c>";
		dbTblQ[554].info = "<c>Va gur pnfr bs enva, n yhoevpngvat svyz pna sbez ba gur ebnq fhesnpr, juvpu jbefraf gur ebnq tevc. Qhfg naq bgure qveg cnegvpyrf ba gur jvaqfuvryq pna sbez n ternfl svyz, znxvat ivfvovyvgl qvssvphyg.<\/c>";
		dbTblQ[555].info = "<c>Pebffvat gur zvqqyr yvar znl erqhpr gur evfx bs trggvat bss gur ebnq, ohg vg vapernfrf gur evfx bs pbyyvfvba jvgu bapbzvat genssvp. Gurersber, vg vf abg nyybjrq gb hfr gur ebnqjnl va guvf znaare.<\/c>";
		dbTblQ[556].info = "<c>Lbhe fcrrq fubhyq or nqncgrq va cnegvphyne gb ebnq, genssvp, ivfvovyvgl naq jrngure pbaqvgvbaf nf jryy nf gb gur crefbany novyvgvrf naq punenpgrevfgvpf bs gur iruvpyr naq ybnq. Vs ivfvovyvgl qhr gb sbt, fabj be enva vf yrff guna 50 z, gur fcrrq zhfg abg rkprrq 50 xz\/u hayrff n ybjre fcrrq vf erdhverq. Vs sbt fhqqrayl nccrnef naq ivfvovyvgl qrgrevbengrf lbhe fcrrq zhfg guhf or nqncgrq vzzrqvngryl gb gur arj ivfvovyvgl pbaqvgvbaf. Fjvgpuvat ba gur qvccrq ornz vf arprffnel va beqre gb or frra zber rnfvyl ol bgure zbgbevfgf.<\/c>";
		dbTblQ[557].info = "<c>Bire gvzr, fznyy qebcf bs sbt znl npphzhyngr ba gur jvaqfperra naq nssrpg ivfvovyvgl. Hfvat gur jvaqfperra jvcref nf erdhverq urycf gb znvagnva tbbq ivfvovyvgl. Gehpxf va cnegvphyne pna fcynfu ynetr dhnagvgvrf bs fyhfu bagb gur jvaqfperra, juvpu vzzrqvngryl erfgevpgf gur ivfvovyvgl bs gur ebnq naq genssvp. Fjvgpuvat ba gur jvaqfperra jvcref orsberunaq ceriragf guvf evfx.<\/c>";
		dbTblQ[560].info = "<c>Vs jvyq navznyf ner qnmmyrq ol shyy ornz, gurl bsgra fgbc va gur ornz bs yvtug. Gurersber, gur uvtu ornzf zhfg or ghearq bss vzzrqvngryl. Nqqvgvbany ubaxvat bs gur ubea pna qenj gur navzny'f nggragvba gb gur nccebnpuvat qnatre. Va nqqvgvba, gur oenxrf zhfg or nccyvrq gb cerirag n pbyyvfvba.<\/c>";
		dbTblQ[564].info = "<c>Va gur qnex, n jrg ebnq pna vagrafvsl gur rssrpg qnmmvat urnqyvtugf. Va nqqvgvba, fgernxf ba gur jvaqfperra ner zber ivfvoyr va gur qnex naq pna fvtavsvpnagyl vzcnve ivfvovyvgl.<\/c>";
		dbTblQ[565].info = "<c>Jura qevivat ng uvtu fcrrq sbe n ybatre crevbq bs gvzr, gur creprcgvba punatrf naq zbgbevfgf bsgra haqrerfgvzngr gur fcrrq. Fvapr snfg qevivat erdhverf n uvtu qrterr bs pbapragengvba, gur novyvgl gb pbapragengr qrpernfrf bire gvzr.<\/c>";
		dbTblQ[566].info = "<c>Jura qevivat ng uvtu fcrrq sbe n ybatre crevbq bs gvzr, gur creprcgvba punatrf naq zbgbevfgf bsgra haqrerfgvzngr gur fcrrq. Qhr gb gur vasyhraprq creprcgvba, zbgbevfgf graq gb qevir pybfr gb gur iruvpyrf va sebag bs gurz.<\/c>";
		dbTblQ[569].info = "<c>Jura gur ebnq vf jvqr naq jryy qrirybcrq, fcrrq vf bsgra pbafvqrerq gb or gbb ybj. Cebybatrq qevivat ng uvtu fcrrq unf n fvzvyne rssrpg.<\/c>";
		dbTblQ[572].info = "<c>Nirahrf ner obeqrerq ol gerrf naq bsgra unir n aneebj ynar. Guvf znxrf vg nyy gur zber vzcbegnag gb pbafvqre gur yngreny qvfgnapr gjvpr, v.r., gb bapbzvat genssvp naq gerrf. Vs na bapbzvat iruvpyr vf irel jvqr, vg znl or arprffnel sbe lbhe iruvpyr gb fgbc va beqre sbe obgu iruvpyrf gb qevir cnfg rnpu bgure fnsryl.<\/c>";
		dbTblQ[574].info = "<c>Gur ynfg crefba va n pbaibl gb biregnxr unf gb pbire gur ybatrfg biregnxvat qvfgnapr naq vf guhf va gur ynar bs bapbzvat genssvp sbe n cnegvphyneyl ybat gvzr. Ng gur fnzr gvzr, vg vf gb or rkcrpgrq gung bgure zbgbevfgf jvyy nyfb yrnir gur pbaibl. Vs vg fubhyq or arprffnel gb zretr onpx vagb gur bevtvany ynar, na nppvqrag pbhyq bpphe.<\/c>";
		dbTblQ[576].info = "<c>Iruvpyrf zhfg biregnxr ba gur yrsg. Gurer vf ab ernfba gb biregnxr sebz gur evtug, rfcrpvnyyl nf gurer vf ab dhrhr ba gur yrsg.<\/c>";
		dbTblQ[577].info = "<c>Gur biregnxvat qvfgnapr gb gur oraq vf fubeg, juvpu znxrf biregnxvat gbb qnatrebhf. Va nqqvgvba, gur yvtug-pbybherq pne pbhyq chyy bhg gb biregnxr.<\/c>";
		dbTblQ[585].info = "<c>Vg vf abg lrg pyrne jurgure gur genpgbe jvyy erznva ba gur fvqr fgevc. Gung'f jul vg'f vzcbegnag gb xrrc na rlr ba gur genpgbe. Vs gur qevire bs gur genpgbe fvtanyf n ghea, ur zhfg or noyr gb znxr gur punatr.<\/c>";
		dbTblQ[586].info = "<c>Irrevat fvqrjnlf vf nyfb cbffvoyr ba qel ebnqf. N fgebat pebffjvaq gung fhqqrayl bpphevat pna pnhfr guvf. Vs n gler ohefgf, gur qevivat fgnovyvgl vf vzcnverq naq gur iruvpyr pna nyfb irre fvqrjnlf.<\/c>";
		dbTblQ[587].info = "<c>Qevivat va n fyvtugyl fgnttrerq cbfvgvba jvguva bar'f bja ynar urycf gb orggre haqrefgnaq gur genssvp fvghngvba naq, sbe rknzcyr, erpbtavmr qnatrebhf fvghngvbaf rneyvre. Gur ivrj guebhtu gur jvaqbjf bs gur cerprqvat iruvpyrf pna or fvzvyneyl hfrshy.<\/c>";
		dbTblQ[591].info = "<c>Gur svefg fgrc vf gb xrrc gur iruvpyr haqre pbageby naq oevat vg fybjyl ohg fheryl gb n fgnaqfgvyy. Vs cbffvoyr, qb abg fgbc ba gur ebnqjnl; engure, fgbc ba gur uneq fubhyqre bs gur ebnq.<\/c>";
		dbTblQ[596].info = "<c>Gur yrsg ynar raqf. Gurersber, gur pne va sebag jvyy punatr gb gur evtug ynar. Gur zretvat bs obgu ynarf erfhygf va n qrafvsvpngvba bs genssvp.<\/c>";
		dbTblQ[599].info = "<c>Ol fjvgpuvat ba gur unmneq jneavat yvtug, bgure zbgbevfgf ner jnearq rneyvre, juvpu erqhprf gur evfx bs nppvqragf. Vs gur genssvp ba zbgbejnlf naq rkgen-heona ebnqf vf pbatrfgrq jvgu ng yrnfg gjb ynarf sbe bar qverpgvba, iruvpyrf zhfg sbez n serr ynar va gur zvqqyr bs gur qverpgvbany ynar sbe gur cnffntr bs cbyvpr naq nhkvyvnel iruvpyrf. Va gur pnfr bs ynarf jvgu guerr ynarf sbe bar qverpgvba, guvf serr ynar zhfg or sbezrq orgjrra gur yrsg ynar naq gur zvqqyr ynar.<\/c>";
		dbTblQ[601].info = "";
		dbTblQ[602].info = "";
		dbTblQ[604].info = "<c>Va gur pnfr bs sngvthr, bayl erpbirel urycf. Gur obql zhfg or tvira na nccebcevngryl ybat oernx. Tlzanfgvp rkrepvfrf uryc gb fgvzhyngr gur pvephyngvba naq npgvingr gur obql nf n jubyr.<\/c>";
		dbTblQ[605].info = "<c>Yviryl pbairefngvbaf \u2013 jvgu cnffratref be ba gur gryrcubar \u2013 nggenpg nggragvba naq pna pbagevohgr gb gur snpg gung vafhssvpvrag nggragvba vf cnvq gb ebnq genssvp. Gur fnzr nccyvrf gb yvfgravat gb rkpvgvat cebtenzzrf ba gur pne enqvb be qevivat jura vzcnpgrq ol fgebat rzbgvbaf.<\/c>";
		dbTblQ[606].info = "<c>Yvtugvat n pvtnerggr juvyr qevivat erdhverf zber nggragvba guna vf trarenyyl nffhzrq. Sbe guvf ernfba, vg vf n znwbe qvfgenpgvba. Puvyqera juvavat pna fvtavsvpnagyl erqhpr gur qevire'f pbapragengvba, nf pna znxvat n cubar pnyy juvyr oruvaq gur jurry.<\/c>";
		dbTblQ[627].info = "<c>Fvapr gurer vf bayl bar ynar va rnpu qverpgvba, lbh fubhyq cbfvgvba lbhe iruvpyr gbjneqf gur zvqqyr bs gur ebnqjnl jvgubhg bofgehpgvat bapbzvat genssvp.<\/c>";
		dbTblQ[628].info = "<c>Bhgfvqr bs ohvyg-hc nernf, vg vf cbffvoyr sbe zbcrqf naq r-ovxrf gb hfr plpyr cnguf. Bgurejvfr \u2013 hayrff n genssvp fvta fnlf bgurejvfr \u2013 gur zbcrq znl bayl or chfurq.<\/c>";
		dbTblQ[629].info = "<c>Vs fhssvpvrag fcnpr vf ninvynoyr, plpyvfgf naq zbcrqf znl biregnxr gur iruvpyrf jnvgvat ba gur evtug-unaq ynar ng zbqrengr fcrrq naq jvgu cnegvphyne pnhgvba.<\/c>";
		dbTblQ[631].info = "<c>Vs, bhgfvqr bs ohvyg-hc nernf, guerr be zber ynarf ner fvtacbfgrq sbe bar qverpgvba ol n thvqryvar, zbgbe iruvpyrf znl, va qrivngvba sebz gur erdhverzrag gb qevir nf sne gb gur evtug nf cbffvoyr, qevir pbagvahbhfyl ba gur prageny ynar vs \u2013 rira bppnfvbanyyl \u2013 n iruvpyr fgbcf be qevirf gb gur evtug bs vg. Gurersber, gur hfr bs gur zvqqyr ynar vf crezvggrq va guvf pnfr.<\/c>";
		dbTblQ[633].info = "<c>Qevir guebhtu chqqyrf bs jngre  fybjyl, naq xrrc lbhe srrg ba gur sbbgerfgf.<\/c>";
		dbTblQ[634].info = "<c>Gur znkvzhz crezvggrq fcrrq vf 25 xz\/u.<\/c>";
		dbTblQ[638].info = "<c>Gur fgbccvat qvfgnapr pbafvfgf bs gur ernpgvba qvfgnapr + oenxvat qvfgnapr. Ernpgvba qvfgnapr va z = Fcrrq va xz\/u \/ 10 k 3 Oenxvat qvfgnapr va z nppbeqvat gb gur ehyr bs guhzo = Fcrrq va xz\/u \/ 10 k Fcrrq va xz\/u \/ 10 Ernpgvba qvfgnapr bs gur gnfx = 100 \/ 10 k 3 = 30 z Oenxvat qvfgnapr bs gur gnfx = 100 \/ 10 k 100 \/ 10 = 100 z Ernpgvba qvfgnapr + oenxvat qvfgnapr = 30 + 100 = 130 z<\/c>";
		dbTblQ[639].info = "<c>Gur oenxvat qvfgnapr va z nppbeqvat gb gur ehyr bs guhzo vf nf sbyybjf: fcrrq va xz\/u \/ 10 k fcrrq va xz\/u \/ 10 oenxvat qvfgnapr bs gur gnfx = 100 \/ 10 k 100 \/ 10 = 100 z<\/c>";
		dbTblQ[640].info = "<c>Gur ernpgvba qvfgnapr vf gur qvfgnapr pbirerq ol gur iruvpyr sebz gur qrgrpgvba bs gur qnatre gb gur vavgvngvba bs oenxvat. Gur ernpgvba qvfgnapr nppbeqvat gb ehyr bs guhzo vf nf sbyybjf: fcrrq va xz\/u \/ 10 k 3 Ernpgvba qvfgnapr bs gur gnfx = 100 \/ 10 k 3 = 30 z<\/c>";
		dbTblQ[641].info = "<c>Gur fgbccvat qvfgnapr pbafvfgf bs gur ernpgvba qvfgnapr + oenxvat qvfgnapr. Gur ehyr bs guhzo vf nf sbyybjf: Ernpgvba qvfgnapr va z = Fcrrq va xz\/u \/ 10 k 3 Oenxvat qvfgnapr va z nppbeqvat gb ehyr bs guhzo = Fcrrq va xz\/u \/ 10 k Fcrrq va xz\/u \/ 10 Ernpgvba qvfgnapr bs gnfx = 50 \/ 10 k 3 = 15 z Oenxvat qvfgnapr bs gnfx = 50 \/ 10 k 50 \/ 10 = 25 z Ernpgvba qvfgnapr + Oenxvat qvfgnapr = 15 + 25 = 40 z<\/c>";
		dbTblQ[642].info = "<c>Gur oenxvat qvfgnapr va z nppbeqvat gb gur ehyr bs guhzo vf nf sbyybjf: fcrrq va xz\/u \/ 10 k fcrrq va xz\/u \/ 10 oenxvat qvfgnapr bs gur gnfx = 50 \/ 10 k 50 \/ 10 = 25 z<\/c>";
		dbTblQ[643].info = "<c>Ernpgvba qvfgnapr va z = Fcrrq va xz\/u \/ 10 k 3 Ernpgvba qvfgnapr bs gur gnfx = 50 \/ 10 k 3 = 15 z<\/c>";
		dbTblQ[644].info = "<c>Ba ynarf gung ner fb aneebj gung bapbzvat iruvpyrf pbhyq or raqnatrerq, lbh zhfg qevir fybj rabhtu gb fgbc ng yrnfg jvguva unys bs gur ivfvoyr qvfgnapr. Gurersber, gur fgbccvat qvfgnapr zhfg abg rkprrq 25 z jura ivrjrq sebz n qvfgnapr bs 50 z.<\/c>";
		dbTblQ[647].info = "<c>Va gur rirag bs n qnatrebhf oenxvat znabrhier, oenxvat vf zber ivbyrag, juvpu vf jul gur oenxvat qvfgnapr vf fubegre.<\/c>\r\n<c>Gur ehyr bs guhzo sbe oenxvat qvfgnapr va z vf nf sbyybjf: fcrrq va xz\/u \/ 10 k fcrrq va xz\/u \/ 10<\/c>\r\n<c>Jvgu <fgebat>unmneq oenxvat<\/fgebat> gur oenxvat qvfgnapr vf unyirq. Gurersber, gur sbyybjvat nccyvrf:<\/c>\r\n<c>(fcrrq va xz\/u \/ 10 k fcrrq va xz\/u \/ 10) \/ 2<\/c>";
		dbTblQ[648].info = "<c>Va gur rirag bs n qnatrebhf oenxvat znabrhier, oenxrf jvyy or hfrq va n zber ivbyrag znaare, juvpu vf jul gur oenxvat qvfgnapr vf fubegre.<\/c>\r\n<c>Oenxvat qvfgnapr va z nppbeqvat gb gur ehyr bs guhzo vf nf sbyybjf:<\/c>\r\n<c>fcrrq va xz\/u \/ 10 k fcrrq va xz\/u \/ 10<\/c>\r\n<c>Gur oenxvat qvfgnapr vf unyirq va gur rirag bs qnatrebhf oenxvat.<\/c>\r\n<c>Oenxvat qvfgnapr bs gur gnfx =<\/c>\r\n<c>(50 \/ 10 k 50 \/ 10) \/ 2 = 12.5 z<\/c>";
		dbTblQ[649].info = "<c>Gur znkvzhz nhgubevfrq fcrrq sbe zbgbe iruvpyrf rdhvccrq jvgu fabj punvaf vf 50 xz\/u, rira haqre gur zbfg snibhenoyr pbaqvgvbaf. Ertneqyrff bs gur glcr bs iruvpyr, lbh zhfg abg qevir snfgre.<\/c>";
		dbTblQ[652].info = "<c>Rira haqre gur zbfg snibhenoyr pbaqvgvbaf, gur znkvzhz nhgubevfrq fcrrq vf 100 xz\/u  sbe cnffratre pnef naq bgure zbgbe iruvpyrf jvgu n znkvzhz nhgubevfrq znff abg rkprrqvat 3.5 gbaarf.<\/c>";
		dbTblQ[653].info = "<c>Rira haqre gur zbfg snibhenoyr pbaqvgvbaf, gur znkvzhz nhgubevfrq fcrrq vf 100 xz\/u sbe cnffratre pnef naq bgure zbgbe iruvpyrf jvgu n znkvzhz nhgubevfrq znff abg rkprrqvat 3.5 gbaarf.<\/c>";
		dbTblQ[654].info = "<c>Rira haqre gur zbfg snibhenoyr pbaqvgvbaf bhgfvqr ohvyg-hc nernf, gur znkvzhz nhgubevfrq fcrrq vf 80 xz\/u sbe ybeevrf naq zbgbe pneninaf hc gb n znkvzhz nhgubevfrq znff bs 3.5 gbaarf jvgu genvyre.<\/c>";
		dbTblQ[657].info = "";
		dbTblQ[660].info = "";
		dbTblQ[665].info = "";
		dbTblQ[666].info = "";
		dbTblQ[668].info = "<c>Gur zvavzhz qvfgnapr pnaabg bayl or qrevirq sebz gur fcrrqbzrgre. Nygreangviryl, bhgfvqr ohvyg-hc nernf, gur gjb-frpbaq vagreiny vf nccyvpnoyr. Gjb frpbaqf ner pbhagrq. Gur cbvag ng juvpu gur iruvpyr va sebag jnf ng gur ortvaavat bs gur gvzr qrgrezvangvba znl abg or ernpurq nsgre gjb frpbaqf ng gur rneyvrfg.<\/c>";
		dbTblQ[669].info = "<c>Va ohvyg-hc nernf, gur fnsrgl qvfgnapr fubhyq or ng yrnfg 15 zrgerf be nccebk. guerr pne yratguf.<\/c>";
		dbTblQ[670].info = "<c>Bhgfvqr ohvyg-hc nernf, gur fnsrgl qvfgnapr fubhyq or ng yrnfg unys gur fcrrq bs gur nhgbzbovyr nf fubja ba gur fcrrqbzrgre.<\/c>";
		dbTblQ[672].info = "<c>Nal nhgbzbovyr naq genvyre pbzovangvba gung rkprrqf 7.00 z (gur pbzovarq yratgu bs gur pne naq genvyre) qevivat bhgfvqr bs ohvyg-hc nernf zhfg nyjnlf xrrc n fhssvpvrag qvfgnapr sebz gur iruvpyr va sebag bs vg fb gung na biregnxvat iruvpyr pna zretr.<\/c>";
		dbTblQ[676].info = "";
		dbTblQ[677].info = "";
		dbTblQ[684].info = "";
		dbTblQ[686].info = "";
		dbTblQ[687].info = "<c>Bayl plpyvfgf naq zbgbeplpyvfgf znl evqr cnfg fgngvbanel iruvpyrf. Gurersber, vg vf arprffnel gb fgnl va lbhe bja ynar naq jnvg oruvaq gur ynfg pne.<\/c>";
		dbTblQ[688].info = "<c>Jvguva ohvyg-hc nernf \u2013 rkprcg ba zbgbejnlf \u2013 zbgbevfgf qevivat iruvpyrf jvgu n znkvzhz crezvffvoyr znff bs hc gb 3.5 g znl serryl pubbfr juvpu ynar gb hfr vs zhygvcyr ynarf va gur fnzr qverpgvba rkvfg.<\/c>";
		dbTblQ[689].info = "<c>Gheavat vf cebuvovgrq ba zbgbejnlf naq uvtujnlf.<\/c>";
		dbTblQ[692].info = "";
		dbTblQ[693].info = "";
		dbTblQ[695].info = "<c>Fgbccvat vf abg crezvggrq va gur nern bs funec pheirf nf jryy nf ba zbgbejnlf naq uvtujnlf. Va obgu pnfrf, gurer vf na vapernfrq evfx bs nppvqragf.<\/c>";
		dbTblQ[697].info = "<c>Cnexvat vf abg crezvggrq va sebag bs cebcregl ragenaprf naq rkvgf nf jryy nf ba aneebj ynarf bccbfvgr cebcregl ragenaprf naq rkvgf. Gur cnexrq iruvpyr jbhyq or gbb ovt bs na bofgnpyr gurer. Nalbar qevivat n iruvpyr vf abg crezvggrq gb fgbc ng gnkv fgnaqf, rkprcg sbe gnkvf cebivqvat sbe gur pneevntr bs cnffratref. Lbh unir gb pbagvahr qevivat naq svaq nabgure cnexvat cbffvovyvgl.<\/c>";
		dbTblQ[700].info = "<c>Nalbar qevivat n iruvpyr znl abg cnex ba fvqrjnyxf jvgu iruvpyrf jvgu n znkvzhz crezvffvoyr znff rkprrqvat 2.8 gbaarf. Nqqvgvbany fvtaf pna nqqvgvbanyyl erfgevpg gur cnexvat crezvg ol, sbe rknzcyr, yvzvgvat gur cnexvat gvzr naq cerfpevovat gur hfr bs n cnexvat abgvpr.<\/c>";
		dbTblQ[702].info = "<c>Nalbar qevivat n iruvpyr zhfg xrrc n zvavzhz qvfgnapr bs 10 z va sebag bs n genssvp yvtug va beqre gb cerirag gur iruvpyr pbaprnyvat gur genssvp yvtug. Gur fnzr nyfb nccyvrf gb gur fvtaf \"Tvir cevbevgl gb envy genafcbeg\", \"Tvir evtug bs jnl\" naq \"Fgbc! Tvir evtug bs jnl!<\/c>";
		dbTblQ[703].info = "<c>Jvguva ohvyg-hc nernf, zbgbe iruvpyr genvyref jvgu n crezvffvoyr gbgny znff bs zber guna 2 g ner abg crezvggrq gb cnex va 1. cher naq trareny erfvqragvny nernf, 2. fcrpvny erperngvbany nernf, 3. fcn nernf naq 4. pyvavp nernf orgjrra 10 c.z. naq 6 n.z. ubhef be ba Fhaqnlf naq choyvp ubyvqnlf. Guvf qbrf abg nccyl gb nccebcevngryl znexrq cnexvat fcnprf be gb gur cnexvat bs erthyne ohfrf ng grezvany fgbcf. Cnexvat va vaqhfgevny nernf vf nyfb crezvggrq.<\/c>";
		dbTblQ[704].info = "<c>Cnexvat gvzr znl or yvzvgrq qrcraqvat ba gur cnexvat fcnpr. Genvyref jvgubhg n gbjvat iruvpyr znl abg or cnexrq sbe zber guna gjb jrrxf. Guvf qbrf abg nccyl gb nccebcevngryl znexrq cnexvat fcnprf.<\/c>";
		dbTblQ[705].info = "";
		dbTblQ[706].info = "";
		dbTblQ[707].info = "<c>Vs n cnexvat zrgre be n cnexvat gvpxrg znpuvar vf abg shapgvbavat, cnexvat znl bayl or pneevrq bhg hc gb gur fcrpvsvrq znkvzhz cnexvat qhengvba. Va guvf pnfr, gur cnexvat qvfp zhfg or hfrq. N cnexvat qvfp fubhyq or hfrq vs gur genssvp fvta fb erdhverf.<\/c>";
		dbTblQ[708].info = "<c>Rira vs nabgure crefba unf cnvq, gur hfr bs gur erznvavat cnexvat gvzr ba n cnexvat zrgre vf crezvggrq.<\/c>";
		dbTblQ[709].info = "<c>Fgbccvat naq cnexvat ner crezvggrq bayl sbe gur gvzr vaqvpngrq ba gur nqqvgvbany cyngr, cebivqrq gung gur iruvpyr unf n cnexvat qvfp gung vf pyrneyl yrtvoyr sebz gur bhgfvqr, naq gur cbvagre bs gur qvfp vf frg gb gur yvar bs unys na ubhe sbyybjvat gur gvzr bs fgbccvat. Gur gvzr vaqvpngrq ba gur cnexvat qvfp znl or ebhaqrq hc gb gur unys ubhe sebz gur gvzr gung gur iruvpyr unf cnexrq.<\/c>";
		dbTblQ[710].info = "<c>Cnexvat zrgref znl bayl or bcrengrq juvyr gur pybpx vf ehaavat, naq cnexvat gvpxrg znpuvarf znl bayl bcrengr jvgu n cnexvat gvpxrg, juvpu zhfg or pyrneyl yrtvoyr sebz gur bhgfvqr ba be va gur iruvpyr, sbe gur qhengvba bs gur crezvggrq cnexvat gvzr. Rkprrqvat gur crezvggrq cnexvat gvzr vf abg crezvggrq. Va guvf pnfr, n arj cnexvat gvpxrg zhfg or vffhrq.<\/c>";
		dbTblQ[711].info = "<c>Rdhvczrag naq qrivprf sbe zbavgbevat cnexvat gvzr arrq abg or bcrengrq jura ragrevat be yrnivat gur iruvpyr be sbe ybnqvat be haybnqvat. Fhpu npgvbaf hfhnyyl erdhver bayl n fubeg fgbccvat gvzr, fb gurer vf ab arrq gb cnl.<\/c>";
		dbTblQ[713].info = "<c>Sbe gur zbgbeplpyr gb fgnaq frpheryl ba gur fvqr fgnaq, gur fgnaq zhfg or shyyl sbyqrq bhg. Gur tebhaq zhfg or fhvgnoyr naq, nzbat bgure guvatf, fgebat rabhtu.<\/c>";
		dbTblQ[715].info = "<c>Vg vf abg erpbzzraqrq gb cnex ba fbsg tebhaq hfvat n fgnaq, nf gur tebhaq znl tvir jnl naq gur iruvpyr znl gvc bire. Gur fnzr nccyvrf gb cnexvat nernf jvgu n fgrrc vapyvar.<\/c>";
		dbTblQ[716].info = "<c>Hajnagrq guveq-cnegl hfr zhfg or ehyrq bhg. Sbe guvf ernfba, gur xrl zhfg or erzbirq. Gur unaqyrone zhfg nyfb or ybpxrq. Gur zbgbeplpyr fubhyq nyfb or cnexrq ba svez tebhaq.<\/c>";
		dbTblQ[720].info = "<c>Nalbar trggvat va be bhg bs gur iruvpyr zhfg orunir va fhpu n jnl gung gurer vf ab qnatre gb bgure zbgbevfgf. Guvf znxrf vg arprffnel gb svefg nfpregnva naq gura trg bhg. Nalbar qevivat n iruvpyr zhfg gnxr gur arprffnel zrnfherf gb nibvq nppvqragf be genssvp qvfehcgvbaf jura yrnivat gur iruvpyr. Zbgbe iruvpyrf zhfg nyfb or frpherq ntnvafg hanhgubevfrq hfr. Gurersber, vg znl or arprffnel gb nccyl gur cnexvat oenxr be unaqoenxr ba fybcrf. Gur iruvpyr zhfg nyfb or ybpxrq.<\/c>";
		dbTblQ[722].info = "<c>Nalbar trggvat va be bhg bs gur iruvpyr zhfg orunir va fhpu n jnl gung gurer vf ab qnatre gb bgure zbgbevfgf. Guvf nyfb vapyhqrf gur crbcyr jub jnag gb trg vagb be bhg bs gur iruvpyr.<\/c>";
		dbTblQ[723].info = "<c>Nalbar trggvat va be bhg bs gur iruvpyr zhfg orunir va fhpu n jnl gung gurer vf ab qnatre gb bgure zbgbevfgf. Guvf nyfb vapyhqrf gur crbcyr jub jnag gb trg vagb be bhg bs gur iruvpyr. Vapernfrq pnhgvba vf erdhverq, rfcrpvnyyl sbe puvyqera.<\/c>";
		dbTblQ[724].info = "<c>Gur gbjvat bs n zbgbeplpyr vf abg crezvggrq. Ubjrire, vg znl or chfurq. Ybnqvat jvgu fhofrdhrag erzbiny bs gur zbgbeplpyr vf nyfb crezvggrq.<\/c>";
		dbTblQ[729].info = "<c>Cbjre fgrrevat vf abg fhccbegrq jvgubhg n ehaavat zbgbe. Nf n erfhyg, fgrrevat vf fyhttvfu naq fgvssre.<\/c>";
		dbTblQ[731].info = "<c>Gur unmneq jneavat yvtugf zhfg or fjvgpurq ba vzzrqvngryl. Gurernsgre, ng yrnfg bar pbafcvphbhf jneavat fvta fubhyq or cynprq va n pyrneyl ivfvoyr ybpngvba ng n fhssvpvrag qvfgnapr. Va gur pnfr bs snfg genssvp, vg fubhyq or cynprq ng n qvfgnapr bs nccebkvzngryl 100 zrgerf.<\/c>";
		dbTblQ[733].info = "<c>Jura gbjvat, gur qvfgnapr orgjrra gur gjb iruvpyrf funyy abg rkprrq 5 z. Vg vf arprffnel gb znex gur gbjvat nvq (r.t., jvgu n erq synt).<\/c>";
		dbTblQ[734].info = "<c>Bhgfvqr bs ohvyg-hc nernf, biregnxvat znl or vaqvpngrq ol fubeg fbhaq be yvtug fvtanyf. Synfuvat urnqyvtugf npgf nf fhpu n ornpba. Jura synfuvat jvgu uvtu ornz, bapbzvat zbgbevfgf zhfg abg or qnmmyrq.<\/c>";
		dbTblQ[735].info = "<c>Vs gur erne sbt ynzcf ner fjvgpurq ba, gurl zhfg or vaqvpngrq gb gur qevire ol na nzore vaqvpngbe yvtug, juvpu zhfg or pyrneyl ivfvoyr va gur qevire\u2019f svryq bs ivfvba.Guvf vf n erdhverzrag gung nccyvrf gb znahsnpgheref. Rirel ertvfgrerq iruvpyr vf rdhvccrq jvgu guvf srngher.<\/c>";
		dbTblQ[739].info = "<c>Vs sbt, fabjsnyy be enva pbafvqrenoyl bofgehpgf ivfvovyvgl, lbh fubhyq qevir jvgu ybj ornz qhevat gur qnl. Sbt urnqynzcf znl bayl or fjvgpurq ba va fhpu jrngure pbaqvgvbaf.<\/c>";
		dbTblQ[742].info = "<c>Yvtugf zhfg or qvzzrq va n gvzryl znaare vs n iruvpyr vf nccebnpuvat be qevivat n fubeg qvfgnapr nurnq. Bgure zbgbevfgf zhfg abg or qnmmyrq.<\/c>";
		dbTblQ[744].info = "<c>Vs sbt, fabjsnyy be enva pbafvqrenoyl bofgehpgf ivfvovyvgl, lbh fubhyq qevir jvgu ybj ornz qhevat gur qnl. Sbt urnqynzcf znl bayl or fjvgpurq ba va fhpu jrngure pbaqvgvbaf.<\/c>";
		dbTblQ[745].info = "<c>Erne sbt ynzcf znl bayl or hfrq jura gur ivfvovyvgl qhr gb sbt vf yrff guna 50 z. Bgurejvfr gurl znl qnmmyr bgure zbgbevfgf orpnhfr bs gurve oevtugarff.<\/c>";
		dbTblQ[746].info = "<c>Iruvpyrf fgbccvat bhgfvqr ohvyg-hc nernf fubhyq or yvg jvgu gurve bja yvtug fbhepr. Jvguva ohvyg-hc nernf, vg vf fhssvpvrag gb znex bayl gur fvqr bs gur iruvpyr snpvat gur ebnq jvgu cnexvat ynzcf be bgure nccebirq zrnaf. Guvf rafherf gung bgure zbgbevfgf erpbtavmr cnexrq iruvpyrf nf bofgnpyrf.<\/c>";
		dbTblQ[752].info = "<c>Ng qhfx, va gur qnex be jura ivfvovyvgl bgurejvfr erdhverf, gur cerfpevorq yvtugvat rdhvczrag zhfg or hfrq. Guvf pna zrna univat gb qevir jvgu qvccrq urnqyvtugf qhevat gur qnl.<\/c>";
		dbTblQ[753].info = "<c>Iruvpyrf fgbccvat bhgfvqr ohvyg-hc nernf funyy or yvg jvgu gurve bja yvtug fbheprf. Jvguva ohvyg-hc nernf, vg vf fhssvpvrag gb znex bayl gur fvqr bs gur iruvpyr snpvat gur ebnq jvgu cnexvat ynzcf be bgure nccebirq zrnaf. Guvf rafherf gung bgure zbgbevfgf erpbtavmr cnexrq iruvpyrf nf bofgnpyrf.<\/c>";
		dbTblQ[757].info = "";
		dbTblQ[758].info = "";
		dbTblQ[759].info = "";
		dbTblQ[761].info = "<c>Va gur rirag bs n oernxqbja ba gur zbgbejnl, vg vf crezvggrq gb fgbc ba gur uneq fubhyqre.<\/c>";
		dbTblQ[762].info = "<c>Qeviref bs cnffratre pnef naq bgure zbgbe iruvpyrf jvgu n tebff iruvpyr jrvtug bs hc gb 3.5 g ner nqivfrq abg gb qevir snfgre guna 130 xz\/u ba zbgbejnlf (erpbzzraqrq fcrrq), rira va snibhenoyr ebnq, genssvp, ivfvovyvgl naq jrngure pbaqvgvbaf.<\/c>";
		dbTblQ[764].info = "<c>Nf n ehyr, gur qvfgnapr gb n iruvpyr va sebag zhfg or fhpu gung vg pna or uryq rira va gur rirag bs fhqqra oenxvat ol gur qevire va sebag. Guvf znl znxr vg arprffnel gb nqwhfg lbhe bja fcrrq. Bgure zbgbevfgf fubhyq abg or sbeprq gb fgbc gurve biregnxvat znabrhier. Vafgrnq, gurl unir gb or nyybjrq gb biregnxr.<\/c>";
		dbTblQ[765].info = "<c>Ng ybj genssvp qrafvgvrf, gur evtug-unaq qevivat erdhverzrag nccyvrf. Qevivat ba gur yrsg ynar vf crezvggrq va beqre gb biregnxr bgure zbgbevfgf be gb sbyybj biregnxra iruvpyrf.<\/c>";
		dbTblQ[767].info = "<c>Ragrevat zbgbejnlf vf bayl crezvggrq ng vagrefrpgvbaf be whapgvbaf. Gheavat ba zbgbejnlf vf cebuvovgrq.<\/c>";
		dbTblQ[769].info = "<c>Vs gur genssvp ba gur nhgbonua vf pbatrfgrq jvgu ng yrnfg gjb ynarf sbe bar qverpgvba, iruvpyrf zhfg sbez n serr ynar va gur zvqqyr bs gur qverpgvbany ynar sbe gur cnffntr bs cbyvpr naq nhkvyvnel iruvpyrf. Va gur pnfr bs ynarf jvgu guerr ynarf sbe bar qverpgvba, guvf jbhyq or orgjrra gur yrsg naq gur zvqqyr ynar. Guvf vf pehpvny sbe erfphref gb trg gb gur fprar dhvpxyl.<\/c>";
		dbTblQ[770].info = "<c>Jura gbjvat n iruvpyr gung unf fgbccrq ba gur zbgbejnl, yrnir gur zbgbejnl ng gur arkg rkvg. Guvf vf vzcrengvir, rira vs vg jbhyq or urycshy gb gnxr n yngre rkvg jvgu ertneq gb gur qrfgvangvba. Juvyr orvat gbjrq, obgu iruvpyrf zhfg unir gurve unmneq jneavat yvtugf fjvgpurq ba. Guvf zrnfher urycf bgure zbgbevfgf erpbtavfr gur gjb iruvpyrf nf rneyl nf cbffvoyr.<\/c>";
		dbTblQ[771].info = "<c>Gheavat naq erirefvat ner sbeovqqra ba gur zbgbejnl. Yvxrjvfr fgbccvat \u2013 rira ba gur uneq fubhyqre \u2013 vf nyfb sbeovqqra.<\/c>";
		dbTblQ[781].info = "<c>Orsber fgnegvat gur wbhearl, gur cnffratre zhfg or vasbezrq gung n fnsrgl uryzrg zhfg or jbea. Gur cnffratre fubhyq nyfb or vafgehpgrq gb cynpr uvf be ure srrg ba gur sbbgerfgf.<\/c>";
		dbTblQ[783].info = "<c>N puvyq haqre frira lrnef bs ntr znl bayl evqr ba n zbgbevmrq ovplpyr va n fcrpvny puvyq\u2019f frng gung unf sbbgerfgf.<\/c>";
		dbTblQ[784].info = "<c>Ncneg sebz n srj rkprcgvbaf, r.t., ba pbafgehpgvba fvgrf, vg vf sbeovqqra gb gnxr crbcyr ba gur ybnqvat nern. Fnsr genafcbeg bs cnffratref vf bayl thnenagrrq va gur pno bs gur gehpx.<\/c>";
		dbTblQ[785].info = "<c>Orsber fgnegvat n wbhearl, vg zhfg or rafherq gung fnsrgl vf abg vzcnverq va nal jnl. Gur ivrj zhfg abg or erfgevpgrq. Bowrpgf gung pna vawher gur bpphcnagf va gur rirag bs n pbyyvfvba zhfg or erzbirq be fgbjrq fnsryl orsber qevivat. Gur qevire vf erfcbafvoyr sbe gur cnffratref naq zhfg rafher gung gurl pna snfgra gurve frngorygf.<\/c>";
		dbTblQ[786].info = "<c>Puvyqera haqre gur ntr bs 12 jub ner fznyyre guna 150 pz znl evqr va zbgbe iruvpyrf ba frngf sbe juvpu fnsrgl orygf ner cerfpevorq bayl vs puvyq erfgenvagf ner hfrq. Jvgubhg gur hfr bs fhpu flfgrzf \u2013 rira vs gur puvyq vf fvggvat orvat uryq ba gur ync bs na nqhyg \u2013 nqrdhngr fnsrgl pnaabg or thnenagrrq.<\/c>";
		dbTblQ[787].info = "<c>Puvyqera haqre gur ntr bs 12 jub ner fznyyre guna 150 pz znl evqr va zbgbe iruvpyrf ba frngf sbe juvpu fnsrgl orygf ner cerfpevorq bayl vs puvyq erfgenvagf ner hfrq. Guhf, va yvtug bs gur ntr bs gur puvyq, gurer vf ab jnl nebhaq gur hfr bs na nccebirq erfgenvag flfgrz.<\/c>";
		dbTblQ[789].info = "<c>Erfgenvag qrivprf zhfg or fhvgnoyr sbe gur puvyq va dhrfgvba, v.r., gnxvat fvmr naq jrvtug vagb nppbhag. Puvyq frngf znl bayl or hfrq va pne zbqryf pregvsvrq ol gur znahsnpghere.<\/c>";
		dbTblQ[790].info = "<c>Gurer ner znal qnatref vaibyirq va abg jrnevat n frng oryg \u2013 obgu va gur sebag naq erne pne frngf. Rira ng ybj fcrrqf gurer vf n evfx bs frevbhf vawhel. Crbcyr jub ner abg fgenccrq va ner ng evfx bs orvat guebja bhg bs gur iruvpyr qhr gb gur rabezbhf sbeprf gung pna or rkregrq va n pbyyvfvba.<\/c>";
		dbTblQ[793].info = "<c>Jvgubhg n frng oryg ba, sngny vawhevrf pna bpphe ng na vzcnpg fcrrq bs 30 xz\/u be zber.<\/c>";
		dbTblQ[794].info = "<c>Ertneqyrff bs juvpu frngf ner frpherq jvgu nveontf, fnsrgl orygf zhfg or jbea ba rnpu frng.<\/c>";
		dbTblQ[796].info = "<c>Puvyqera haqre gur ntr bs 12 jub ner fznyyre guna 150 pz znl evqr va zbgbe iruvpyrf ba frngf sbe juvpu fnsrgl orygf ner cerfpevorq bayl vs puvyq erfgenvagf ner hfrq. Vs gurer ner abg rabhtu erfgenvag qrivprf, frireny gevcf ner arprffnel.<\/c>";
		dbTblQ[799].info = "<c>Gur vaqvivqhny urvtug bs rnpu bpphcnag znxrf vg arprffnel gb nqwhfg urnqerfgf nppbeqvatyl.<\/c>";
		dbTblQ[800].info = "<c>Gur nveont vaqvpngbe yvtug vaqvpngrf n grpuavpny snhyg \u2013 gur nveont znl ab ybatre or shapgvbany. N tnentr jbexfubc fubhyq or ivfvgrq va beqre sbe gur cebcre ercnvef gb or znqr.<\/c>";
		dbTblQ[803].info = "";
		dbTblQ[810].info = "<c>Gur genafcbeg bs ybnqf ba gur ebbs vapernfrf gur prager bs tenivgl bs gur iruvpyr, juvpu erfhygf va n fgebatre vapyvangvba va oraqf, nzbat bgure guvatf. Ng gur fnzr gvzr, gur fhesnpr vf vapernfrq, znxvat gur iruvpyr zber fhfprcgvoyr gb fvqr jvaqf.<\/c>";
		dbTblQ[811].info = "<c>Gur hfr bs ovplpyrf ba gur ebbs erdhverf gur hfr bs n fhvgnoyr ubyqvat qrivpr sbe frpher nggnpuzrag. Erthyne vafcrpgvbaf ner arprffnel gb rafher fnsr genafcbeg rira bire ybat qvfgnaprf. Nibvq uvtu fcrrqf.<\/c>";
		dbTblQ[812].info = "<c>Gur hfr bs n erne pneevre vf bayl crezvggrq vs gur iruvpyr vf fhvgnoyr sbe vg. Purpx gung gur erne pneevre qbrf abg pbire gur yvtugf be gur ertvfgengvba cyngr. Pbirevat vf abg crezvggrq, ohg pna or fbyirq ol nccebcevngr rkgrafvbaf (r.t., yvtug onef). Nyfb purpx gung obgu gur erne pneevre naq gur ovplpyrf ner frpheryl snfgrarq.<\/c>";
		dbTblQ[815].info = "<c>Vs gur ybnq cebgehqrf yngrenyyl zber guna 40 pz orlbaq gur iruvpyr yvtugf be, va gur pnfr bs n zbgbe iruvpyr, orlbaq gur bhgre rqtr bs gur yvtug-rzvggvat fhesnprf bs gur sebag be erne cbfvgvba ynzcf, gur ybnq fubhyq or znexrq va qnexarff be cbbe ivfvovyvgl ng n znkvzhz bs 40 pz sebz vgf rqtr naq ng n znkvzhz bs 1,50 z nobir gur ebnq. Vg fubhyq or znexrq ol n juvgr ynzc va gur sebag naq ol n erq ynzc ng gur onpx.<\/c>";
		dbTblQ[816].info = "<c>Gur frphevat qrivpr zhfg abg or cynprq uvture guna 1.50 z nobir gur ebnq fhesnpr. N uvture vafgnyyngvba znl qrprvir fhofrdhrag genssvp naq fhttrfg n shegure qvfgnapr, nygubhtu guvf vf abg gur pnfr.<\/c>";
		dbTblQ[818].info = "<c>Va gur pnfr bs n ybnq hc gb n urvtug bs 2.50 z ba gbc bs gur gbjvat iruvpyr, gur genvyre zhfg abg cebwrpg sbejneq bire gur iruvpyr. Va nqqvgvba, va gur pnfr bs n ybnq bs hc gb 50 pz nobir gur gbjvat iruvpyr, gur ybnq cebwrpgvba znl cebwrpg hc gb 50 pz orlbaq gur iruvpyr.<\/c>";
		dbTblQ[820].info = "<c>Nalbar qevivat n iruvpyr zhfg nyfb rafher gung gur iruvpyr, gur genvyre, gur pbzovangvba, gur ybnq naq gur bpphcnagf ner va nppbeqnapr jvgu gur erthyngvbaf naq gung gur ebnq fnsrgl bs gur iruvpyr vf abg nqirefryl nssrpgrq ol gur ybnq be bpphcnagf. Guvf znxrf vg arprffnel gb ercynpr gur gbea ynfuvat fgenc jvgu nabgure ynfuvat fgenc be bgure frphevat qrivpr naq bayl gura pbagvahr gur wbhearl.<\/c>";
		dbTblQ[821].info = "<c>Gur ybnq frphevat erthyngvbaf nccyl gb nyy zbgbe iruvpyrf naq guhf nyfb gb inaf. <\/c>";
